INSERT INTO `glpi_knowbaseitems` (`id`, `name`, `answer`, `is_faq`, `users_id`, `view`, `date_creation`, `date_mod`, `begin_date`, `end_date`) VALUES
(1, 'WAN menggunakan setting DHCP dan seringkali mati hidup', '&#60;p&#62;&#60;strong&#62;Penyebab&#60;/strong&#62;:&#60;br&#62;Jangkauan access point Sonicwall TZ-300W yang kurang kuat.&#60;br&#62;&#60;br&#62;&#60;strong&#62;Solusi&#60;/strong&#62;:&#60;br&#62;IP Address WAN DHCP telah kami ubah ke IP Static, detailnya Bapak/Ibu bisa lihat di konfigurasi Sonicwall pada menu Network-Interface. Konfigurasi Radio Mode pada Sonicwall diubah ke 2.4 Ghz.&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:15:09', '2023-02-15 08:15:09', NULL, NULL),
(2, 'Jaringan Wireless tidak dapat melakukan Ping pada jaringan kabel (PC).', '&#60;p&#62;&#60;strong&#62;Penyebab:&#60;/strong&#62;&#60;br&#62;Access rules WAN to LAN pada Sonicwall statusnya DENY.&#60;br&#62;&#60;br&#62;&#60;strong&#62;Solusi:&#60;/strong&#62;&#60;br&#62;Ubah access rules WAN to LAN ke ALLOW.&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:17:06', '2023-02-15 08:17:06', NULL, NULL),
(3, 'Pegawai tidak ada di community / unit kerja pegawai tidak update', '&#60;p&#62;&#60;strong&#62;Penyebab:&#60;/strong&#62;&#60;br /&#62;Data pegawai belum diupdate Kepegawaian&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Solusi:&#60;/strong&#62;&#60;br /&#62;1. Pastikan bahwa pegawai tersebut dapat login ke email BPS&#60;br /&#62;2. Eskalasi permasalahan ke Kepegawaian&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:18:16', '2023-02-15 08:22:38', NULL, NULL),
(4, 'Gagal koneksi ke wi-fi tertentu', '&#60;p&#62;&#60;strong&#62;Penyebab&#60;/strong&#62;:&#60;br /&#62;PC/laptop sudah terhubung terlalu lama dengan wifi&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Solusi&#60;/strong&#62;:&#60;br /&#62;1. Refresh koneksi wi-fi dengan menonaktifkan terlebih dahulu dan mengaktifkan lagi&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:20:12', '2023-02-15 08:22:53', NULL, NULL),
(5, 'Tidak bisa login ke community', '&#60;p&#62;&#60;strong&#62;Penyebab:&#60;/strong&#62;&#60;br /&#62;Pegawai belum didaftarkan alamat emailnya di community atau data pegawai pada Active Directory kurang lengkap&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Solusi&#60;/strong&#62;:&#60;br /&#62;1. Pastikan bahwa pegawai tersebut dapat login ke email BPS&#60;br /&#62;2. Pastikan bahwa pegawai tersebut sudah terdaftar di community dan periksa apakah alamat email pegawai tersebut tampil di community&#60;br /&#62;3. Jika pegawai dapat login ke email BPS, tetapi alamat email pegawai tidak tampil di community, eskalasi permintaan ke JKD untuk didaftarkan ke community&#60;br /&#62;4. Jika pegawai dapat login ke email BPS dan alamat email pegawai tampil di community, eskalasi permintaan ke JKD untuk pengecekan di Active Directory&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:21:01', '2023-02-15 08:23:06', NULL, NULL),
(6, 'Email yang dikirimkan ke domain @bps.go.id tidak sampai.', '&#60;p&#62;&#60;strong&#62;Penyebab 1:&#60;/strong&#62;&#60;br /&#62;Kuota email dari si pengirim email telah penuh.&#60;br /&#62;&#60;strong&#62;Solusi 1:&#60;/strong&#62;&#60;br /&#62;1. Cek kuota dari si pengirim email, dengan cara mengarahkan kursor ke \'nama Anda\' disebelah pojok kanan atas tampilan email.&#60;br /&#62;2. Lakukan penghapusan pada email-email yang sudah tidak digunakan lagi.&#60;br /&#62;3. Sebelum di hapus, Anda dapat melakukan back-up untuk email-email yang dirasa penting melalui Zimbra Desktop. Panduan dapat diunduh pada link berikut:&#60;br /&#62;&#60;a href=\"https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf\" data-cke-saved-href=\"https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf\"&#62;https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf&#60;/a&#62;&#60;br /&#62;3. Email-email yang telah dihapus akan masuk ke folder \'Trash\' dan masih memakan kuota dari email. Kosongkan folder \'Trash\' agar tidak memenuhi kuota email Anda, dengan cara klik kanan lalu pilih \'Empty Trash\'.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Penyebab 2:&#60;/strong&#62;&#60;br /&#62;Kuota email dari si penerima email telah penuh.&#60;br /&#62;&#60;strong&#62;Solusi 2:&#60;/strong&#62;&#60;br /&#62;1. Setelah menghapus beberapa email atau mengosongkan kuota email pada si penerima, silakan menunggu beberapa saat agar email-email yang tertunda mulai masuk ke Inbox si penerima email.&#60;br /&#62;2. Email yang dapat masuk ke inbox penerima email hanyalah email-email yang dikirim kurang dari 3 hari yang lalu sejak si penerima mengosongkan kuota emailnya.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Penyebab 3:&#60;/strong&#62;&#60;br /&#62;Akun email si penerima sementara di close oleh admin JKD karena terkena spam atau virus.&#60;br /&#62;&#60;strong&#62;Solusi 3:&#60;/strong&#62;&#60;br /&#62;1. Akun email yang diclose oleh admin JKD tidak dapat menerima email untuk sementara waktu.&#60;br /&#62;2. Apabila dalam 3 hari sejak email dikirimkan akun penerima masih dalam status close, maka email yang dikirimkan tidak akan masuk ke kedalam inbox (kotak masuk) email si penerima.&#60;br /&#62;3. Silakan menunggu sampai akun penerima diaktifkan kembali oleh admin JKD.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Penyebab 4:&#60;/strong&#62;&#60;br /&#62;Terdapat filter pada email si penerima yang membuat email-email yang mengandung kata tertentu di tolak atau langsung di hapus oleh email si penerima&#60;br /&#62;&#60;strong&#62;Solusi 4:&#60;/strong&#62;&#60;br /&#62;1. Cek kembali filter pada si penerima email (pada menu Preferences &#38;gt; Filters)&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Penyebab 5:&#60;/strong&#62;&#60;br /&#62;Email masuk ke folder Junk karena dianggap spam.&#60;br /&#62;&#60;strong&#62;Solusi 5:&#60;/strong&#62;&#60;br /&#62;1. Cek folder Junk pada email penerima.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Penyebab 6:&#60;/strong&#62;&#60;br /&#62;Kesalahan setting/konfigurasi Zimbra Destop pada email si penerima, yang mengakibatkan email baru akan langsung dihapus setelah didownload oleh Zimbra Desktop.&#60;br /&#62;&#60;strong&#62;Solusi 6:&#60;/strong&#62;&#60;br /&#62;1. Cek kembali konfigurasi Zimbra Desktop pada email si penerima.&#60;br /&#62;2. Silakan ikuti panduan Back Up Email Melalui Zimbra Desktop pada link berikut untuk memastikan konfigurasi yang digunakan sudah sesuai:&#60;br /&#62;&#60;a href=\"https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf\" data-cke-saved-href=\"https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf\"&#62;https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf&#60;/a&#62;&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:21:44', '2023-02-15 08:23:22', NULL, NULL),
(7, 'Pengajuan pergantian nama (username) email.', '&#60;p&#62;&#60;strong&#62;Penyebab 1:&#60;/strong&#62;&#60;br&#62;User mengajukan pergantian alamat (username) email&#60;br&#62;&#60;br&#62;&#60;strong&#62;Solusi 1:&#60;/strong&#62;&#60;br&#62;User dapat mengajukan pergantian alamat (username) email melalui tiket dengan ketentuan penamaan email sebagai berikut:&#60;br&#62;1. Nama tunggal&#60;br&#62;nama@bps.go.id&#60;br&#62;Contoh: Miswar akan memiliki alamat email miswar@bps.go.id&#60;br&#62;2. Nama dengan dua suku kata&#60;br&#62;sukukatapertama.sukukatakedua@bps.go.id&#60;br&#62;Contoh: Siska Ambarwati akan memiliki alamat email siska.ambarwati@bps.go.id&#60;br&#62;3. Nama duplikat&#60;br&#62;sukukatapertama.sukukatakedua(n)@bps.go.id. dimana n menyatakan nomor yang belum digunakan.&#60;br&#62;Contoh: Siska Ambarwati yang kedua akan memiliki alamat email siska.ambarwati2@bps.go.id&#60;br&#62;4. Nama dengan spasi&#60;br&#62;Spasi akan dihilangkan dan nama akan digabungkan. Ini akan dilakukan baik pada nama depan maupun nama belakang.&#60;br&#62;Contoh: Hery Al Amin akan memiliki alamat email hery.alamin@bps.go.id&#60;br&#62;5. Nama dengan apostrof (tanda petik) atau tanda baca yang lain&#60;br&#62;Apostrof atau tanda baca yang lain akan dihilangkan&#60;br&#62;Contoh: Sa’diyah akan memiliki alamat email sadiyah@bps.go.id&#60;br&#62;6. Nama dengan lebih dari dua suku kata&#60;br&#62;Sukukatapertama.sukukatakedua@bps.go.id atau sukukatapertama.sukukataterakhir@bps.go.id&#60;br&#62;Contoh: Ahmad Hartiono Utomo akan memiliki email ahmad.hartiono@bps.go.id atau ahmad.utomo@bps.go.id bila&#60;br&#62;email pertama sudah terpakai&#60;br&#62;7. Nama dengan gelar&#60;br&#62;Gelar dihilangkan dan hanya digunakan nama resminya&#60;br&#62;Contoh: Dr. Indria Sasmita akan memiliki email indria.sasmita@bps.go.id&#60;br&#62;RA. Asih Sulistiowati akan memiliki email asih.sulistiowati@bps.go.id&#60;br&#62;9. Nama Panggilan&#60;br&#62;Nama panggilan tidak lagi diperkenankan sebagai alamat email&#60;br&#62;Contoh: Handi Priyadi lebih dikenal dengan nama panggilan Jebot. Maka, email yang diberikan tetap handi.priyadi@bps.go.id&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;Permintaan penggantian alamat email dapat dilakukan untuk hal-hal berikut :&#60;/strong&#62;&#60;br&#62;1. Admin salah membuatkan nama email&#60;br&#62;2. Penamaan email mencirikan kesalahan gender (Pemilik email laki-laki tapi diberikan nama akun perempuan atau sebaliknya)&#60;br&#62;3. Nama akun terdengar ‘porno/tidak pantas’ pada bahasa tertentu&#60;br&#62;4. Jika dilakukan penggantian username email, maka pengguna disarankan membackup file di layanan laci-nya dikarenakan akun laci yang lama tidak akan bisa diakses lagi setelah username diganti&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:24:45', '2023-02-15 08:24:45', NULL, NULL),
(8, 'Perangkat TI End-User (Laptop, PC, Printer, dll.) mengalami kerusakan/kinerja buruk', '&#60;p&#62;&#60;strong&#62;Penyebab:&#60;/strong&#62;&#60;/p&#62;\r\n&#60;p&#62;Barang mengalami kerusakan pada satu atau beberapa &#60;em&#62;sparepart.&#60;/em&#62;&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;Solusi:&#60;/strong&#62;&#60;/p&#62;\r\n&#60;p&#62;Terkait permasalahan yang sebelumnya sudah dilaporkan melalui tiket HaloSIS, menindaklanjuti hal tersebut dimohon agar Anda dapat menuliskan rincian barang IT yang dimaksud sebagai berikut.&#60;/p&#62;\r\n&#60;ol&#62;\r\n&#60;li&#62;Jelaskan permasalahan tersebut dengan detail agar tim teknis paham dengan kerusakan yang terjadi. Jangan mendeskripsikan hal kerusakan tersebut dengan ambigu, misal (red: \"PC rusak/PC lemot/Laptop lelet, butuh perbaikan), karena tim teknis butuh rincian kerusakan agar bisa mendiagnosis penyebab kerusakannya.&#60;/li&#62;\r\n&#60;li&#62;Model PC -&#38;gt; Biasanya ada di stiker belakang atau atas PC (misal HP ProDesk G4 440)&#60;/li&#62;\r\n&#60;li&#62;SN atau ST (Serial Number atau Service Tag) -&#38;gt; Nomor unik identifier dari PC (misal SGH345GHK)&#60;/li&#62;\r\n&#60;li&#62;NUP BMN -&#38;gt; Nomor baris kedua yang tertera di stiker BMN (misal 3100102003-2035)&#60;/li&#62;\r\n&#60;/ol&#62;\r\n&#60;p&#62;Kami memerlukan data rincian tersebut sebelum barang IT akan diperbaiki/dirawat sebagai bukti pelaporan unik. Anda wajib untuk menuliskan rincian tersebut agar bisa diproses lebih lanjut. Jika rincian sudah kami peroleh, Anda dapat mengirimkan barang ke Gd. 1 Lt. 2 Ruang Teknisi Komputer Fungsi PTI untuk dilakukan perbaikan/perawatan. Terima kasih atas kerjasamanya.&#60;/p&#62;\r\n&#60;p&#62; &#60;/p&#62;\r\n&#60;p&#62;Salam&#60;strong&#62; HaloSIS : )&#60;/strong&#62;&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:26:20', '2023-02-15 09:47:29', NULL, NULL),
(9, 'Monitor PC rusak/mati total', '&#60;p&#62;&#60;strong&#62;Solusi:&#60;/strong&#62;&#60;br&#62;1. Cek kabel &#60;em&#62;power&#60;/em&#62; apakah sudah terpasang dengan benar.&#60;br&#62;2. Jika menggunakan UPS, cek kabel dari monitor ke UPS apakah sudah terpasang dengan benar.&#60;br&#62;3. Jika menggunakan UPS, cek apakah UPS sudah dinyalakan atau belum.&#60;br&#62;&#60;strong&#62;Apabila solusi diatas tidak berhasil, buat tiket keluhan ke halosis, sebutkan merk, tipe dan nomor BMN perangkat. Tunggu arahan berupa balasan tiket dari tim teknis atau operator berupa balasan tiket.&#60;/strong&#62;&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:27:57', '2023-02-15 08:28:11', NULL, NULL),
(10, 'Akses PC/Server yang dinginkan tidak sesuai', '&#60;p&#62;&#60;strong&#62;Penyebab 1:&#60;/strong&#62;&#60;br&#62;Tidak dapat akses ke IP PC/Server&#60;br&#62;&#60;br&#62;&#60;strong&#62;Solusi 1:&#60;/strong&#62;&#60;br&#62;1. PC/Server yang akan di remote dalam kondisi hidup&#60;br&#62;2. Memiliki akses ke PC/Server&#60;br&#62;&#60;br&#62;&#60;strong&#62;Penyebab 2:&#60;/strong&#62;&#60;br&#62;Operating Sistem atau browser tidak di support&#60;br&#62;&#60;br&#62;&#60;strong&#62;Solusi 2:&#60;/strong&#62;&#60;br&#62;1. Pastikan Operating system minimal windows 7&#60;br&#62;2. Browser minimal IE&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:31:36', '2023-02-15 08:31:36', NULL, NULL),
(11, 'Tidak dapat upload file ke laci', '&#60;p&#62;&#60;strong&#62;Penyebab:&#60;/strong&#62;&#60;br&#62;Tidak dapat upload file ke laci&#60;br&#62;&#60;br&#62;&#60;strong&#62;Solusi:&#60;/strong&#62;&#60;br&#62;1. Pastikan kecepatan download dan upload anda stabil (untuk speed test ke server bps &#60;a href=\"http://filelib.bps.go.id/speed\" data-cke-saved-href=\"http://filelib.bps.go.id/speed\"&#62;http://filelib.bps.go.id/speed&#60;/a&#62; )&#60;br&#62;untuk laci,&#60;br&#62;2. Bila memang kesulitan upload menggunakan web, silahkan menggunakan aplikasi owncloud desktop, dengan aplikasi desktop tersebut, memungkinkan untuk resume upload. Silahkan klik username dan pilih personal, setelah masuk personal pilih desktop app, akan muncul window baru, pilih desktop client, nah download berdasar sistem operasi yang dipakai di komputer anda&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:32:58', '2023-02-15 08:32:58', NULL, NULL),
(12, 'Tidak dapat membuka laci', '&#60;p&#62;&#60;strong&#62;Penyebab:&#60;/strong&#62;&#60;br&#62;Muncul error \"This connection is untrusted\"&#60;br&#62;&#60;br&#62;&#60;strong&#62;Solusi:&#60;/strong&#62;&#60;br&#62;1. Clear recent history pada browser Anda&#60;br&#62;2. Eskalasi ke technical support JKD&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:33:39', '2023-02-15 08:33:39', NULL, NULL),
(13, 'Pra-perbaikan laptop Dell Latitude 7320 (Masa Garansi)', '&#60;p&#62;1.    &#60;strong&#62;Jaga-jaga mengalami penggantian sparepart atau upgrade ke windows 11, harus dilakukan langkah2x berikut:&#60;/strong&#62;&#60;br&#62;Bit locker lock: win explorer -&#38;gt;folder C klik kanan -&#38;gt; manage bit locker -&#38;gt; backup your recovery key -&#38;gt; save key number (txt) ada opsi cara save nya pilih salah satu-&#38;gt; ke usb flash/akun microsft (jika tidak memilih opsi print) &#60;/p&#62;\r\n&#60;p&#62;2.    &#60;strong&#62;Mic/speaker pelan&#60;/strong&#62;&#60;br&#62;* Update semua driver menggunakan aplikasi supportassist bawaan laptop dell 7320&#60;br&#62;* Update windows&#60;br&#62;(Intinya semua harus sudah update terbaru) &#60;/p&#62;\r\n&#60;p&#62;3.    &#60;strong&#62;Apabila engsel laptop pecah, layar laptop jangan dibuka.&#60;/strong&#62;&#60;br&#62;Jika dibuka layar akan pecah dan garansi akan VOID (batal)&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:35:14', '2023-02-15 08:35:14', NULL, NULL),
(14, 'Tidak dapat terkonek Personal VPN', '&#60;p&#62;Apabila pengguna mengalami permasalahan koneksi VPN Eksternal BPS, mohon terlebih dahulu mengikuti langkah-langkah troubleshooting berikut ini:&#60;/p&#62;\r\n&#60;p&#62;1. Pastikan pengguna telah memasukkan username dan password dengan benar.&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;2.&#60;/strong&#62; Pastikan pengguna telah diberikan hak untuk mengakses VPN Eksternal BPS.&#60;/p&#62;\r\n&#60;p&#62;Pengguna dapat memperoleh informasi mengenai kredensial dan hak akses yang diberikan dengan menghubungi Fungsi Jaringan Komunikasi Data, Direktorat Sistem Informasi Statistik BPS melalui email ke jkd@bps.go.id.&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;3. &#60;/strong&#62;Apabila saat memulai koneksi mengalami kegagalan dan muncul pesan “Perangkat anda tidak memenuhi kriteria standar untuk terkoneksi ke VPN BPS” seperti pada gambar di bawah berikut, berarti perangkat pengguna terdeteksi memiliki permasalahan pada antivirus atau firewall.&#60;/p&#62;\r\n&#60;p&#62;&#60;img src=\"https://laci.bps.go.id/index.php/apps/files_sharing/ajax/publicpreview.php?x=1920&#38;amp;y=447&#38;amp;a=true&#38;amp;file=gambar1new3.jpg&#38;amp;t=XyiljA0urGWqhVM&#38;amp;scalingup=0\" alt=\"\" data-cke-saved-src=\"https://laci.bps.go.id/index.php/apps/files_sharing/ajax/publicpreview.php?x=1920&#38;amp;y=447&#38;amp;a=true&#38;amp;file=gambar1new3.jpg&#38;amp;t=XyiljA0urGWqhVM&#38;amp;scalingup=0\"&#62;&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;4.&#60;/strong&#62; Pengguna harus memastikan bahwa terdapat antivirus yang memiliki real-time protection yang aktif dan virus/threat definition yang terbaru (up-to-date) di perangkat. Selain itu pengguna juga harus memastikan bahwa firewall yang terdapat di perangkatnya berada dalam kondisi aktif.&#60;/p&#62;\r\n&#60;p&#62;Setelah memastikan kedua hal tersebut, pengguna dapat mencoba kembali untuk memulai koneksi VPN Eksternal BPS.&#60;/p&#62;\r\n&#60;p&#62;&#60;img src=\"https://laci.bps.go.id/index.php/apps/files_sharing/ajax/publicpreview.php?x=1920&#38;amp;y=447&#38;amp;a=true&#38;amp;file=gambar2new.jpg&#38;amp;t=AqKPzDECbLnLCAS&#38;amp;scalingup=0\" alt=\"\" data-cke-saved-src=\"https://laci.bps.go.id/index.php/apps/files_sharing/ajax/publicpreview.php?x=1920&#38;amp;y=447&#38;amp;a=true&#38;amp;file=gambar2new.jpg&#38;amp;t=AqKPzDECbLnLCAS&#38;amp;scalingup=0\"&#62;&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;5.&#60;/strong&#62; Apabila pada pengujian dengan melakukan &#60;strong&#62;&#60;em&#62;ping&#60;/em&#62;&#60;/strong&#62;&#60;em&#62; &#60;/em&#62;menghasilkan &#60;strong&#62;100% &#60;em&#62;loss&#60;/em&#62;&#60;/strong&#62;, lakukan &#60;em&#62;nameserver lookup&#60;/em&#62; dengan menjalankan &#60;strong&#62;&#60;em&#62;nslookup &#60;/em&#62;&#60;/strong&#62;akses.bps.go.id. Pastikan anda mendapatkan jawaban &#60;strong&#62;Address:&#60;/strong&#62; &#60;strong&#62;203.123.60.248&#60;/strong&#62; atau &#60;strong&#62;Address:&#60;/strong&#62; &#60;strong&#62;203.123.6248&#60;/strong&#62;.&#60;/p&#62;\r\n&#60;p&#62;&#60;img src=\"https://laci.bps.go.id/index.php/apps/files_sharing/ajax/publicpreview.php?x=1920&#38;amp;y=447&#38;amp;a=true&#38;amp;file=gambar%25203new1.jpg&#38;amp;t=ne9ArMenzOGpDoY&#38;amp;scalingup=0\" alt=\"\" data-cke-saved-src=\"https://laci.bps.go.id/index.php/apps/files_sharing/ajax/publicpreview.php?x=1920&#38;amp;y=447&#38;amp;a=true&#38;amp;file=gambar%25203new1.jpg&#38;amp;t=ne9ArMenzOGpDoY&#38;amp;scalingup=0\"&#62;&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;6.&#60;/strong&#62;  Apabila masih terjadi permasalahan dan pengguna tidak dapat terhubung ke VPN Eksternal BPS, silakan melaporkan permasalahan yang dialami dengan menghubungi Fungsi Jaringan Komunikasi Data, Direktorat Sistem Informasi Statistik BPS melalui email ke &#60;a href=\"mailto:jkd@bps.go.id\" data-cke-saved-href=\"mailto:jkd@bps.go.id\"&#62;jkd@bps.go.id&#60;/a&#62;&#60;u&#62;.&#60;/u&#62;&#60;/p&#62;\r\n&#60;p&#62; &#60;/p&#62;', 1, 2, 0, '2023-02-15 08:35:58', '2023-02-15 08:35:58', NULL, NULL),
(15, 'Mouse/Keyboard Rusak', '&#60;p&#62;&#60;strong&#62;Solusi:&#60;/strong&#62;&#60;/p&#62;\r\n&#60;p&#62;Buat tiket HaloSIS dengan mencantumkan identitas dari PC tersebut, berupa&#60;/p&#62;\r\n&#60;ol&#62;\r\n&#60;li&#62;NUP BMN (wajib lengkap termasuk 2-5 digit terpisah terakhir, misal 3100102001-9803)&#60;/li&#62;\r\n&#60;li&#62;Model barang Monitor dan PC (wajib lengkap, misal HP P232, lalu HP Probook G4 440)&#60;/li&#62;\r\n&#60;li&#62;Serial Number/Service Tag Monitor dan PC (wajib lengkap, biasanya ada di stiker tertempel di sekitar PC atau monitor)&#60;/li&#62;\r\n&#60;li&#62;Jika barang masih masuk masa garansi (setelah balasan atau pengecekan dari operator atau tim teknisi melalui HaloSIS), maka penggantian tidak akan diproses, melainkan klaim garansi&#60;/li&#62;\r\n&#60;li&#62;Jika barang sudah lewat masa garansi, maka barang akan ditukar dengan satu set pasangan Mouse + Keyboard yang ada/ Wireless (baru) sesuai dengan keadaan masa pengadaan pemeliharaan barang TI end-user.&#60;/li&#62;\r\n&#60;/ol&#62;', 1, 2, 0, '2023-02-15 08:43:02', '2023-02-15 08:43:02', NULL, NULL),
(16, 'Zimbra Desktop Tidak Sinkron', '&#60;p&#62;Untuk permasalahan Zimbra Desktop yang belum bisa sinkron, silakan mengikuti panduan berikut:&#60;br&#62;1. Pilih Menu &#60;strong data-redactor-tag=\"strong\"&#62;setup &#60;/strong&#62;yang berada di pojok kanan atas tampilan Zimbra Desktop.&#60;br&#62;&#60;br&#62;&#60;img src=\"https://halosis-archive.bps.go.id/file.php?key=_i4done460fky-kzui8icxwnimnc9j-q&#38;amp;expires=1676505600&#38;amp;signature=7f751fcfd878190e189109fa00fb9976a47bc4d6&#38;amp;disposition=inline\" alt=\"image\" width=\"654\" height=\"512\" data-cid=\"_i4done460fky-kzui8icxwnimnc9j-q\" data-verified=\"redactor\"&#62;&#60;br&#62;&#60;br&#62;2. Selanjutnya pilih &#60;strong data-redactor-tag=\"strong\"&#62;Edit&#60;/strong&#62;.&#60;br&#62;&#60;br&#62;&#60;img src=\"https://halosis-archive.bps.go.id/file.php?key=efejctbfjuiwdf_e1twnrexfy2s8o3jm&#38;amp;expires=1676505600&#38;amp;signature=5b3619c235a5196fcb33b64d12e65082e7d6f820&#38;amp;disposition=inline\" alt=\"image\" width=\"650\" height=\"509\" data-cid=\"efejctbfjuiwdf_e1twnrexfy2s8o3jm\" data-verified=\"redactor\"&#62;&#60;br&#62;&#60;br&#62;3. Selanjutnya pilih antara &#60;strong data-redactor-tag=\"strong\"&#62;TLS &#60;/strong&#62;dan &#60;strong data-redactor-tag=\"strong\"&#62;SSL&#60;/strong&#62;. Apabila sebelumnya menggunakan &#60;strong data-redactor-tag=\"strong\"&#62;SSL&#60;/strong&#62;, silakan pilih &#60;strong data-redactor-tag=\"strong\"&#62;TLS&#60;/strong&#62;. Apabila sebelumnya menggunakan &#60;strong data-redactor-tag=\"strong\"&#62;TLS &#60;/strong&#62;silakan dipilih &#60;strong data-redactor-tag=\"strong\"&#62;SSL&#60;/strong&#62;. Kemudian pilih &#60;strong data-redactor-tag=\"strong\"&#62;Validate and Save&#60;/strong&#62;.&#60;br&#62;&#60;br&#62;&#60;img src=\"https://halosis-archive.bps.go.id/file.php?key=p4yi85lg2ngqrc0vkpixfuqbwg_g9xz4&#38;amp;expires=1676505600&#38;amp;signature=403072d6f903bcc85440e2fa65fb2c1100fdb335&#38;amp;disposition=inline\" alt=\"image\" width=\"845\" height=\"795\" data-cid=\"p4yi85lg2ngqrc0vkpixfuqbwg_g9xz4\" data-verified=\"redactor\"&#62;&#60;br&#62;&#60;br&#62;4. Launch Zimbra Desktop kembali.&#60;br&#62;&#60;br&#62;&#60;img src=\"https://halosis-archive.bps.go.id/file.php?key=oiyvmxsje_2u0dm8z-k4mzoyrwnt3nwc&#38;amp;expires=1676505600&#38;amp;signature=bdd011752cadee81762629f59386e67ff4abd616&#38;amp;disposition=inline\" alt=\"image\" width=\"886\" height=\"829\" data-cid=\"oiyvmxsje_2u0dm8z-k4mzoyrwnt3nwc\" data-verified=\"redactor\"&#62;&#60;br&#62;&#60;br&#62;5. Klik &#60;strong data-redactor-tag=\"strong\"&#62;Send/Receive&#60;/strong&#62;.&#60;br&#62;&#60;br&#62;&#60;img src=\"https://halosis-archive.bps.go.id/file.php?key=raod6eym9_vxwl80jdf3ay3quz_2kuvo&#38;amp;expires=1676505600&#38;amp;signature=0f61baede0c7c2904744314664804ce64b16297c&#38;amp;disposition=inline\" alt=\"image\" width=\"886\" height=\"352\" data-cid=\"raod6eym9_vxwl80jdf3ay3quz_2kuvo\" data-verified=\"redactor\"&#62;&#60;br&#62;&#60;br&#62;Semoga membantu.&#60;br&#62;&#60;br&#62;Terima kasih.&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:51:45', '2023-02-15 08:51:45', NULL, NULL),
(17, 'Unduh Multiple Files Kolaborasi', '&#60;p&#62;Untuk mengunduh multiple files pada Portal Kolaborasi, silakan ikuti langkah berikut:&#60;br&#62;1. Buka portal kolaborasi menggunakan browser &#60;strong data-redactor-tag=\"strong\"&#62;Internet Explorer&#60;br&#62;&#60;/strong&#62;2. Buka folder dokumen dimana file akan diunduh.&#60;br&#62;3. Klik &#60;strong data-redactor-tag=\"strong\"&#62;All Document&#60;/strong&#62; yang berada di sebelah kanan atas tampilan dokumen, lalu pilih &#60;strong data-redactor-tag=\"strong\"&#62;View in File Explorer.&#60;/strong&#62;&#60;br&#62;&#60;img src=\"https://halosis-archive.bps.go.id/file.php?key=u55_p-68rph9uiv6v7dylh5snd83tlnc&#38;amp;expires=1676505600&#38;amp;signature=708209fe09d9fd83eafc58d52896106927258ad3&#38;amp;disposition=inline\" alt=\"image\" width=\"906\" height=\"510\" data-cid=\"u55_p-68rph9uiv6v7dylh5snd83tlnc\" data-verified=\"redactor\"&#62;&#60;br&#62;4. Silakan copy folder/file kedalam penyimpanan lokal PC Anda dengan cara yang sama seperti saat Anda mengcopy folder/file pada File Explorer (CTRL+A untuk memilih semua file/folder, CTRL+C untuk men copy file/folder dan CTRL+V untuk mempaste file/folder yang telah dicopy).&#60;br&#62;&#60;br&#62;Terima kasih.&#60;/p&#62;', 1, 2, 0, '2023-02-15 08:52:40', '2023-02-15 08:52:40', NULL, NULL),
(18, 'Template Tutup Tiket (Tim Teknis Perangkat Keras)', '&#60;p&#62;Yth. Ibu/Bapak&#60;br&#62;Di Tempat,&#60;br&#62;&#60;br&#62;Mohon maaf, apakah permasalahan Anda sudah selesai terperbaiki ?&#60;br&#62;Jika tidak ada respons jawaban kembali, maka kami akan menutup tiket laporan ini.&#60;br&#62;Mohon agar Anda membuat tiket baru jika masih terdapat permasalahan dan atau terdapat permasalahan berbeda dari tiket ini.&#60;br&#62;&#60;br&#62;Terima kasih, salam HALOSIS : )&#60;/p&#62;', 0, 2, 0, '2023-02-15 08:54:23', '2023-02-15 08:54:23', NULL, NULL),
(19, 'Template Tiket Jatuh Tempo (Semua)', '&#60;p&#62;Yth. Bpk/Ibu&#60;br&#62;&#60;br&#62;Sebagai informasi, tiket Anda telah jatuh tempo.&#60;br&#62;Apakah jawaban/solusi yang diberikan sudah bisa memecahkan masalah yang dihadapi?&#60;br&#62;Jika sudah, maka kami akan menutup tiket.&#60;br&#62;Mohon konfirmasinya, terima kasih.&#60;/p&#62;\r\n&#60;p&#62; &#60;/p&#62;\r\n&#60;p&#62;Salam HaloSIS : )&#60;/p&#62;', 0, 2, 0, '2023-02-15 08:55:31', '2023-02-15 08:55:31', NULL, NULL),
(20, 'Template Tiket Barang Inden (Tim Teknis Perangkat Keras)', '&#60;p&#62;Yth Bapak/Ibu&#60;br&#62;&#60;br&#62;Berkaitan dengan permasalahan pada tiket Anda, kami menginformasikan bahwa barang yang diminta belum tersedia, untuk itu kami akan menutup tiket tersebut. Apabila ada informasi mengenai barang yang diminta maka akan kami sampaikan melalui tiket ini juga.&#60;br&#62;&#60;br&#62;Terimakasih telah menggunakan layanan HaloSIS : )&#60;/p&#62;', 0, 2, 0, '2023-02-15 08:59:50', '2023-02-15 08:59:50', NULL, NULL),
(21, 'Lupa Password PC atau Laptop', '&#60;p&#62;&#60;strong&#62;Silakan mencoba beberapa kombinasi username dan password di bawah ini&#60;/strong&#62;&#60;br&#62;&#60;br&#62;Username:&#60;br&#62;.\\Bps-Client (lokal domain)&#60;br&#62;.\\bps&#60;br&#62;.\\administrator&#60;br&#62;\\BPS-Client (domain bps)&#60;br&#62;&#60;br&#62;Password:&#60;br&#62;(kosongkan)&#60;br&#62;password&#60;br&#62;p4ssword&#60;/p&#62;\r\n&#60;p&#62; &#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;atau yang tertera pada gambar berikut:&#60;/strong&#62;&#60;/p&#62;\r\n&#60;p&#62;&#60;a href=\"/front/document.send.php?docid=6&#38;itemtype=KnowbaseItem&#38;items_id=21\" target=\"_blank\" &#62;&#60;img alt=\"e650493b-1dc0d356-63eca3374066e2.28610521\" width=\"175\" src=\"/front/document.send.php?docid=6&#38;itemtype=KnowbaseItem&#38;items_id=21\" /&#62;&#60;/a&#62;&#60;/p&#62;\r\n&#60;p&#62; &#60;/p&#62;\r\n&#60;p&#62;Salam HaloSIS : )&#60;/p&#62;', 1, 2, 1, '2023-02-15 09:18:15', '2023-02-15 09:18:15', NULL, NULL),
(22, 'Permintaan Pembuatan dan atau Pelatihan Course E-Learning', '&#60;p&#62;Yth. Bapak/Ibu&#60;br /&#62;&#60;br /&#62;Untuk tindak lanjut terhadap tiket permintaan yang akan menggunakan layanan e-learning, silakan mengikuti ketentuan berikut:&#60;br /&#62;&#60;br /&#62;&#60;/p&#62;\r\n&#60;ol&#62;\r\n&#60;li&#62;Setiap kelas online training setidaknya memiliki satu orang yang ditunjuk sebagai admin dari Subdirektorat terkait. Admin yang telah ditunjuk selanjutnya akan menyiapkan kelas pelatihan elearningnya. Untuk courseid kelas pelatihan onlinenya akan dibuatkan oleh tim e-Learning SIS.&#60;/li&#62;\r\n&#60;li&#62;Menyampaikan tanggal mulai dan berakhirnya kelas pelatihan online survei terkait pada e-Learning (setelah tanggal berakhir, pelatihan akan dihapus dari e-Learning) beserta rundown atau susunan acara pelatihan&#60;/li&#62;\r\n&#60;li&#62;Menyediakan bahan pembelajaran dapat juga menyertakan file berupa foto, video maupun dokumen yang nantinya akan diupload oleh admin Subdirektorat terkait.&#60;/li&#62;\r\n&#60;li&#62;Menyediakan detail kebutuhan fitur pada kelas yang akan dibuat.&#60;/li&#62;\r\n&#60;li&#62;Mohon untuk melengkapi tiket ini dengan form &#60;a title=\"Formulir Permintaan Zoom Unlimited\" href=\"https://halosis-dev.bps.go.id/front/formulir_permintaan_zoom\" target=\"_blank\" rel=\"noopener\"&#62;https://laci.bps.go.id/s/9l8BG6Nf0DhrSyt/download&#60;/a&#62; apabila dibutuhkan lisensi akun zoom untuk kegiatan pelatihan nantinya.&#60;/li&#62;\r\n&#60;li&#62;Membuat rapat inisiasi dan mengundang tim e-Learning BPS setelah menerima informasi ini dengan mengundang tim E-learning SIS dari Subdirektorat Pengembangan Basis Data, yaitu: Dr. Novianto Budi Kurniawan SST.,M.T dan tim yang akan ditunjuk.&#60;/li&#62;\r\n&#60;/ol&#62;', 1, 2, 0, '2023-02-15 09:22:34', '2023-02-15 09:22:43', NULL, NULL),
(23, 'Template Respons Tiket Permasalahan CAPI', 'Mohon untuk melengkapi informasi berikut:\r\n1. Nama survei CAPI yang diikuti :\r\n2. Jabatan di survei tersebut (pencacah/pengawas/pegawai kabkot/pegawai provinsi) :\r\n3. Aplikasi android/web :\r\n4. Keluhan yang dilaporkan :\r\n5. Nama user login CAPI yang digunakan :', 0, 2, 0, '2023-02-15 09:24:30', '2023-02-15 09:24:30', NULL, NULL),
(24, 'Email Terblokir/Perlu Reset Password', '&#60;p&#62;Yth Bp/Ibu&#60;br&#62;&#60;br&#62;Jika akun email Anda dinonaktifkan, kemungkinan dikarenakan &#60;strong data-redactor-tag=\"strong\"&#62;&#60;u data-redactor-tag=\"u\"&#62;terdeteksi melakukan aktivitas penyebaran spam&#60;/u&#62;&#60;/strong&#62;. Silahkan ikuti langkah di bawah untuk proses penggantian password. Segera &#60;strong data-redactor-tag=\"strong\"&#62;&#60;u data-redactor-tag=\"u\"&#62;lakukan install/update antivirus &#38;amp; scan perangkat&#60;/u&#62;&#60;/strong&#62; untuk kenyamanan penggunaan email ke depan.&#60;br&#62;&#60;br&#62;Untuk beberapa waktu kedepan, akun tersebut akan kami pantau dan akan kami non-aktifkan kembali jika terdapat indikasi yang sama.&#60;br&#62;&#60;br&#62;Password sementara :&#60;br&#62;&#60;br&#62;Jangan menggunakan kembali password lama&#60;br&#62;&#60;br&#62;Permintaan telah kami penuhi, untuk akses dan penggantian password silahkan ikuti langkah berikut:&#60;br&#62;1. Akses mail.bps.go.id dan login ke akun email.&#60;br&#62;2. Gunakan password sementara di atas untuk login.&#60;br&#62;3. Selanjutnya akan diminta mengisi password baru saat pertama kali login.&#60;br&#62;4. Masukkan password baru yang diinginkan (minimal 6 karakter kombinasi huruf dan angka, jangan menggunakan kembali password lama maupun password sementara di atas).&#60;br&#62;* 5. Jika penggantian password telah berhasil, lakukan juga login ke community agar password dapat tersinkronisasi 1-2 jam berikutnya dengan aplikasi yang menggunakan SSO.&#60;br&#62;&#60;br&#62;NB:&#60;br&#62;Jika email diakses melalui smartphone, mohon untuk settingan password juga diganti.&#60;br&#62;Hal tersebut dikarenakan smartphone akan mereload terus-menerus menggunakan password lama, sehingga account akan terkunci **. Mohon dapat diinformasikan pula bagi pengguna email tersebut untuk menggunakan password baru dikarenakan jika salah memasukkan password hingga 5 kali, maka account juga akan terkunci **.&#60;br&#62;&#60;br&#62;*) Hanya untuk email Pribadi&#60;br&#62;**) Jika account terkunci maka harus menunggu 30 menit kemudian untuk dapat diakses kembali.&#60;br&#62;&#60;br&#62;Mohon membalas tiket ini jika permasalahan telah/belum terselesaikan. Jika dalam waktu 2 x 24 jam tidak ada respon dari tiket ini, maka tiket ini kami tutup karena kami anggap masalah telah terselesaikan.&#60;br&#62;&#60;br&#62;Terima kasih.&#60;/p&#62;', 1, 2, 0, '2023-02-15 09:30:58', '2023-02-15 09:30:58', NULL, NULL),
(25, 'Permintaan Alokasi Barang TI End-Point (PC, Printer, Laptop, dll.)', '&#60;p&#62;Sesuai dengan peraturan yang berlaku, Anda bisa melakukan permintaan alokasi barang (bukan kondisi baru) langsung ke Bagian Inventarisasi, Penyimpanan dan Penghapusan - Biro Umum. Silakan langsung menemui narahubung/pegawai dari bagian tersebut agar Anda bisa mengetahui rincian lengkap dan prosedurnya.&#60;/p&#62;\r\n&#60;p&#62; &#60;/p&#62;\r\n&#60;p&#62;Terima kasih atas perhatian dan kerjasamanya, salam HaloSIS : )&#60;/p&#62;', 1, 2, 0, '2023-02-15 09:41:31', '2023-02-15 09:41:31', NULL, NULL),
(26, 'Penghapusan Perangkat TI End-Point', '&#60;p&#62;Untuk pengembalian perangkat keras, maka perlu dibuatkan surat pengantar penghapusan barang kepada Bagian Inventarisasi, Penyimpanan dan Penghapusan - Biro Umum. Nota permintaan penghapusan barang wajib melampirkan daftar perangkat yang akan dikembalikan dengan mencantumkan informasi merk, tipe, serial number, dan NUP BMN. Daftar tersebut nantinya akan dicek oleh narahubung/pegawai bagian tersebut terkait apakah perangkat tersebut masih disupport atau sudah layak dihapus. &#60;/p&#62;\r\n&#60;p&#62;&#60;br&#62;Penghapusan perangkat TI dilakukan oleh bagian tersebut, dan bukan wewenang dari Direktorat Sistem Informasi Statistik. Demikian yang dapat kami sampaikan.&#60;br&#62;&#60;br&#62;Terimakasih sudah menghubungi &#60;strong&#62;Halosis : )&#60;/strong&#62;&#60;/p&#62;', 1, 2, 0, '2023-02-15 09:51:09', '2023-02-15 09:51:09', NULL, NULL),
(27, 'Uninstall Antivirus', '&#60;p&#62;Yth. Bapak/Ibu,&#60;br&#62;&#60;br&#62;Apabila aplikasi antivirus pada perangkat Anda memang diperlukan &#60;em&#62;uninstall &#60;/em&#62;untuk menjalankan aplikasi yang berhubungan dengan pekerjaan BPS, maka Anda bisa melakukan beberapa dari opsi berikut:&#60;/p&#62;\r\n&#60;ul&#62;\r\n&#60;li&#62;Trend Micro: Password unistall antivirus Trend Micro adalah &#60;strong&#62;pti4540&#60;/strong&#62;&#60;/li&#62;\r\n&#60;li&#62;McAfee: Silakan buat tiket gangguan agar aplikasi bisa diuninstall lewat console server BPS Pusat&#60;/li&#62;\r\n&#60;li&#62;Symantec: Silakan unduh uninstaller pada laman &#60;a title=\"Download Symantec Uninstaller\" href=\"https://knowledge.broadcom.com/external/article/178870/download-the-cleanwipe-removal-tool-to-u.html\" target=\"_blank\" rel=\"noopener\"&#62;berikut&#60;/a&#62;&#60;/li&#62;\r\n&#60;li&#62;Secara umum, Anda pun dapat uninstall beragam antivirus menggunakan aplikasi Revo Uninstaller yang bisa diunduh lewat laman &#60;a title=\"Download Revo Uninstaller\" href=\"https://www.revouninstaller.com/products/revo-uninstaller-free/\" target=\"_blank\" rel=\"noopener\"&#62;berikut&#60;/a&#62;, lalu uninstall dan hapus paksa file yang berkaitan dengan aplikasi antivirus tersebut.&#60;/li&#62;\r\n&#60;/ul&#62;\r\n&#60;p&#62;Sekian, terima kasih. Salam &#60;strong&#62;HaloSIS : )&#60;/strong&#62;&#60;/p&#62;', 1, 2, 0, '2023-02-15 10:02:48', '2023-02-15 10:02:48', NULL, NULL),
(28, 'Setting Zimbra Desktop', '&#60;p&#62;Untuk panduan setting aplikasi Zimbra Dekstop dapat dilihat pada link berikut:&#60;br&#62;&#60;br&#62;s.bps.go.id/zimbradesktop.&#60;br&#62;&#60;br&#62;Terima kasih.&#60;/p&#62;', 1, 2, 0, '2023-02-15 10:03:28', '2023-02-15 10:03:28', NULL, NULL),
(29, 'Apa itu Kofax Kapow', '&#60;p&#62;&#60;strong data-redactor-tag=\"strong\"&#62;Kofax Kapow&#60;/strong&#62; adalah sebuah platform aplikasi perangkat lunak dari Kofax yang dapat digunakan untuk melakukan ekstraksi informasi dari berbagai sumber laman web sebagai kebutuhan pengumpulan data dan informasi dari dunia maya, baik berdasar pendekatan waktu tertentu maupun terjadwal secara berkala.&#60;br&#62;&#60;br&#62;&#60;br&#62;&#60;img src=\"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTArSFB5Snt9P4r6jRE27xtGxwr1I2AhbdICQ&#38;amp;usqp=CAU\" alt=\"Kapow RPA Software - Robotic Process Automation Companies\"&#62;&#60;br&#62;&#60;br&#62;&#60;br&#62;Proses ekstraksi informasi oleh Kapow dilakukan oleh Robot yang dirancang melalui perangkat lunak pendukung &#60;strong data-redactor-tag=\"strong\"&#62;Design Studio&#60;/strong&#62;. &#60;strong data-redactor-tag=\"strong\"&#62;Robot&#60;/strong&#62; rancangan digunakan untuk melakukan &#60;strong data-redactor-tag=\"strong\"&#62;otomatisasi&#60;/strong&#62; proses ekstrak informasi yang dilakukan secara &#60;strong data-redactor-tag=\"strong\"&#62;manual&#60;/strong&#62; pada laman web tujuan. Robot kemudian akan diunggah pada sebuah &#60;em data-redactor-tag=\"i\"&#62;repository&#60;/em&#62; dalam sistem &#60;em data-redactor-tag=\"i\"&#62;Management Console &#60;/em&#62;untuk kemudian dapat dieksekusi secara terjadwal melalui laman aplikasi web bernama &#60;strong data-redactor-tag=\"strong\"&#62;Kapplets.&#60;/strong&#62;&#60;br&#62;&#60;br&#62;Ilustrasi otomatisasi proses ekstrak informasi secara manual oleh pengguna dapat digambarkan sebagai berikut: Dalam kesehariannya, pengguna biasa melakukan ekstrak informasi pada laman web dengan melakukan pencarian (&#60;strong data-redactor-tag=\"strong\"&#62;&#60;em data-redactor-tag=\"i\"&#62;search&#60;/em&#62;&#60;/strong&#62;) secara manual terlebih dahulu, kemudian melakukan penyalinan (&#60;strong data-redactor-tag=\"strong\"&#62;&#60;em data-redactor-tag=\"i\"&#62;copy&#60;/em&#62;&#60;/strong&#62;) informasi hasil keluaran sesuai kebutuhan yang selanjutnya dilakukan penempelan (&#60;strong data-redactor-tag=\"strong\"&#62;&#60;em data-redactor-tag=\"i\"&#62;paste&#60;/em&#62;&#60;/strong&#62;) salinan dimaksud pada wadah penyimpanan data tertentu, seperti aplikasi pengolah data (&#60;em data-redactor-tag=\"i\"&#62;spreadsheet&#60;/em&#62;), dan sebagainya. Robot kemudian dirancang untuk membantu melakukan proses otomatisasi hal manual dimaksud secara berulang menyesuaikan kebutuhan. Selanjutnya, berikut gambaran bisnis proses kegiatan dimaksud:&#60;/p&#62;\r\n&#60;p&#62;&#60;img src=\"https://smartrpa.com/wp-content/uploads/2018/10/smartrpa-process-automation-platform-1024x499.png\" alt=\"Robot Process Automation\"&#62;Sejauh ini, pemanfaatan Kofax Kapow pada kegiatan oleh BPS untuk proses ekstraksi penggalian informasi pada laman web diantaranya adalah sebagai berikut:&#60;br&#62;&#60;br&#62;&#60;/p&#62;\r\n&#60;ul&#62;\r\n&#60;li&#62;Pencarian berita dan atau artikel pada sejumlah kanal berita mengenai BPS.&#60;/li&#62;\r\n&#60;li&#62;Penggalian informasi direktori pemenang maupun peserta lelang pada sejumlah laman web LPSE (Layanan Pengadaan Secara Elektronik) yang dikhususkan hanya untuk kegiatan lelang pada kategori konstruksi.&#60;/li&#62;\r\n&#60;li&#62;Pengambilan informasi direktori badan usaha pada laman web LPJK (Lembaga Pengembagan Jasa Konstruksi) seluruh Indonesia.&#60;/li&#62;\r\n&#60;li&#62;Penggalian informasi berita dan atau artikel pada sejumlah kanal berita yang digunakan sebagai penentuan isu terkini dan menjadi acuan penyusunan publikasi Analisis Isu Terkini.&#60;/li&#62;\r\n&#60;li&#62;Penggalian informasi berita dan atau artikel pada sejumlah kanal berita yang digunakan sebagai analisis lanjutan fenomena Ketenagakerjaan&#60;/li&#62;\r\n&#60;li&#62;Penggalian informasi terkait atlet dan asal negara Asian Games 2018 Jakarta – Palembang sebagai analisis Pengunjung Asian Games dengan menggunakan MPD&#60;/li&#62;\r\n&#60;li&#62;Penggalian informasi terkait jadwal &#60;em data-redactor-tag=\"i\"&#62;event&#60;/em&#62; serta &#60;em data-redactor-tag=\"i\"&#62;venue&#60;/em&#62; Asian Games 2018 Jakarta – Palembang sebagai analisis Pengunjung Asian Games dengan menggunakan MPD&#60;/li&#62;\r\n&#60;li&#62;Media otomatisasi proses imputasi dan edit SE2016 Lanjutan&#60;/li&#62;\r\n&#60;li&#62;Penggalian informasi perubahan terkini harga Bahan Bakar Khusus (BBK) pada laman web Pertamina&#60;/li&#62;\r\n&#60;li&#62;Penggalian informasi harga paket paket telepon dan internet operator seluler bulanan pada laman web Telkomsel&#60;/li&#62;\r\n&#60;li&#62;Penggalian informasi cuitan pada laman web Twitter sebagai bahan pengukur efektifitas dampak promosi wisata oleh Kementerian Pariwisata pada sosial media&#60;/li&#62;\r\n&#60;li&#62;Penggalian informasi direktori bandara di Indonesia pada laman web Kementerian Perhubungan&#60;/li&#62;\r\n&#60;li&#62;Media otomatisasi pengambilan data imigrasi berbasis web service dari Direktorat Jenderal Imigrasi&#60;/li&#62;\r\n&#60;/ul&#62;', 1, 2, 0, '2023-02-15 10:08:27', '2023-02-15 10:08:27', NULL, NULL),
(30, 'Inbox Email Hilang', '&#60;p&#62;Yth. Bpk/Ibu&#60;br&#62;&#60;br&#62;Silakan diperiksa setting pada email tersebut apakah email melakukan forward otomatis ke email lain, sehingga akan menghapus email yang masuk ke inbox.&#60;br&#62;&#60;br&#62;Pilih menu &#60;strong data-redactor-tag=\"strong\"&#62;Preferences&#60;/strong&#62;, kemudian pilih &#60;strong data-redactor-tag=\"strong\"&#62;Mail&#60;/strong&#62;.&#60;br&#62;&#60;br&#62;Selanjutnya perhatikan pada isian &#60;strong data-redactor-tag=\"strong\"&#62;Forward Copy to&#60;/strong&#62;, pastikan &#60;strong data-redactor-tag=\"strong\"&#62;TIDAK ADA TANDA CENTANG&#60;/strong&#62; pada kolom \'Dont Keep a Local copy of message\'.&#60;br&#62;&#60;br&#62;Apabila kolom tersebut terdapat tanda centang, email akan otomatis melakukan forward ke email yang diisikan diatasnya lalu menghapus email yang asli pada inbox. Hal inilah yang menyebabkan inbox tidak menerima email masuk, karena setelah diforward email otomatis dihapus.&#60;br&#62;&#60;br&#62;&#60;img src=\"https://halosis-archive.bps.go.id/file.php?key=qm7kmjqrz-pvvs4eukwbbeavh8ovfcg0&#38;amp;expires=1676505600&#38;amp;signature=56baccd40702c8f0eacef0095b24e584007b791d&#38;amp;disposition=inline\" alt=\"image\" width=\"612\" height=\"291\" data-cid=\"qm7kmjqrz-pvvs4eukwbbeavh8ovfcg0\" data-verified=\"redactor\"&#62;&#60;br&#62;&#60;br&#62;Terima kasih&#60;/p&#62;', 1, 2, 0, '2023-02-15 10:09:27', '2023-02-15 10:09:27', NULL, NULL),
(31, 'Troubleshooting Update Laptop Dell Latitude 7320', '&#60;p&#62;Langkah yg perlu dilakukan:&#60;br&#62;&#60;br&#62;1. Biarkan laptop melakukan update windows hingga tuntas (jangan dimatikan selama proses update), setelah update windows silahkan lakukan update driver melalui aplikasi bawaan laptop yaitu \"SupportAssist\", akan dilakukan scanning driver yang perlu diupdate dan lakukan update driver sesuai saran aplikasi.&#60;/p&#62;\r\n&#60;p&#62;2. apabila terdapat kendala lain seperti sound hilang atau wireless tidak bisa dapat mengecek driver, driver lain yang dapat diunduh melalui link berikut&#60;br&#62;&#60;a href=\"https://www.dell.com/support/home/en-id/product-support/product/latitude-13-7320-2-in-1-laptop/drivers\" target=\"_blank\" rel=\"noopener\"&#62;https://www.dell.com/support/home/en-id/product-support/product/latitude-13-7320-2-in-1-laptop/drivers&#60;/a&#62;&#60;/p&#62;\r\n&#60;p&#62; &#60;/p&#62;\r\n&#60;p&#62;Terima kasih, salam &#60;strong&#62;HaloSIS : )&#60;/strong&#62;&#60;/p&#62;', 1, 2, 0, '2023-02-15 10:11:10', '2023-02-15 10:11:10', NULL, NULL),
(32, 'List Formulir Permintaan Pelaporan di HaloSIS', '&#60;p&#62;&#60;a href=\"https://s.bps.go.id/form-halosis\"&#62;https://s.bps.go.id/form-halosis&#60;/a&#62;&#60;/p&#62;', 1, 2, 2, '2023-02-15 10:11:54', '2023-02-15 10:11:54', NULL, NULL),
(33, 'Error SMART', '&#60;p&#62;Silakan mengikuti langkah berikut:&#60;/p&#62;\r\n&#60;ol&#62;\r\n&#60;li&#62;Apabila menggunakan Browser Firefox:\r\n&#60;ol&#62;\r\n&#60;li&#62;buka tab baru&#60;/li&#62;\r\n&#60;li&#62;ketik \"about:config\"&#60;/li&#62;\r\n&#60;li&#62;ubah \"network.websocket.allowInsecureFromHTTPS\" jadi true&#60;/li&#62;\r\n&#60;/ol&#62;\r\n&#60;/li&#62;\r\n&#60;li&#62;Apabila menggunakan browser selain Firefox, silakan gunakan Citrix Receiver. Cara install citrix receiver:\r\n&#60;ol&#62;\r\n&#60;li&#62;Klik nama Anda di sebelah pojok kanan atas&#60;/li&#62;\r\n&#60;li&#62;Pilih Change CItrix Receiver&#60;/li&#62;\r\n&#60;li&#62;Pilih Instal/Detect Receiver&#60;/li&#62;\r\n&#60;li&#62;Tunggu sampai file receiver sudah selesai di download&#60;/li&#62;\r\n&#60;li&#62;Install file receiver yang sudah berhasil di download&#60;/li&#62;\r\n&#60;li&#62;Kembali ke halaman smart bps. Reload browser atau klik Detect Again&#60;/li&#62;\r\n&#60;/ol&#62;\r\n&#60;/li&#62;\r\n&#60;/ol&#62;\r\n&#60;p&#62;Terima kasih&#60;/p&#62;', 1, 2, 1, '2023-02-15 10:12:52', '2023-02-15 10:12:52', NULL, NULL),
(34, 'Email Hacked (Auto-Forwarding)', '&#60;p&#62;Yth Bapak/Ibu&#60;br&#62;&#60;br&#62;Mohon untuk melakukan pemeriksaan pengaturan pada menu Preferences -&#38;gt; Mail di bagian Receiving Messages.&#60;br&#62;Hilangkan isian pada field \"Forward a copy to\" dan \"Send a notification message to\".&#60;br&#62;Hilangkan juga checklist pada pilihan \"Don\'t keep a local copy of messages\".&#60;br&#62;&#60;br&#62;Selanjutnya tekan tombol \"Save\"di pojok kiri atas untuk menyimpan perubahan.&#60;br&#62;&#60;br&#62;Sebaiknya dilakukan reset password akun email tersebut dikarenakan dicurigai telah terinject virus atau diretas pihak yang kurang bertanggungjawab. Jika berkenan dilakukan reset password, silahkan balas pada tiket ini dengan menyertakan alamat email alternatif untuk menginformasikan informasi tata cara penggantian password.&#60;/p&#62;\r\n&#60;p&#62;Jika Anda telah membuat tiket, mohon diinformasikan:&#60;br&#62;- Apakah sebelumnya pernah mengisikan username dan password pada alamat yang mengatasnamakan Admin Email BPS?&#60;br&#62;- Apakah sebelumnya pernah menyimpan user dan password untuk login email, community, SSO lain dari BPS pada browser, baik pada perangkat pribadi yang digunakan maupun pada perangkat PC lain?&#60;br&#62;- Apakah sebelumnya pernah menggunakan akun email BPS untuk didaftarkan pada media sosial, market place, maupun untuk subscription aplikasi di luar BPS?&#60;br&#62;&#60;br&#62;Mohon dapat dilakukan langkah-langkah berikut:&#60;br&#62;1. Abaikan email di atas, klik kanan pada email dan \"Mark as Spam\"&#60;br&#62;2. Sebaiknya perangkat yang digunakan untuk akses email dan aplikasi BPS lainnya diinstal, diupdate, dan discan menggunakan antivirus yang disediakan dari BPS, yang bisa diakses di &#60;a href=\"https://s.bps.go.id/antivirus\"&#62;https://s.bps.go.id/antivirus&#60;/a&#62;.&#60;br&#62;3. Selanjutnya menginformasikan kepada kami untuk dilakukan reset password email BPS (dilampirkan akun email alternatif untuk informasi password baru).&#60;br&#62;&#60;br&#62;Mohon membuat dan atau merespons tiket Anda yang berhubungan dengan permasalahan ini. Jika permasalahan telah/belum terselesaikan. Jika dalam waktu 2 x 24 jam tidak ada respon dari tiket ini, maka tiket tersebut kami tutup karena kami anggap masalah telah terselesaikan.&#60;br&#62;&#60;br&#62;Terima kasih.&#60;/p&#62;', 1, 2, 1, '2023-02-15 10:14:49', '2023-02-15 10:16:09', NULL, NULL),
(35, 'Template Tiket Non-Respons (Semua)', '&#60;p&#62;Yth. Bapak/Ibu&#60;br&#62;&#60;br&#62;Karena tidak ada respon lanjutan, kami asumsikan permasalahan solved , maka tiket kami tutup. Silahkan membuka tiket kembali apabila masih terdapat permasalahan.&#60;br&#62;Terima kasih telah menghubungi HaloSIS&#60;/p&#62;', 0, 2, 0, '2023-02-15 10:17:05', '2023-02-15 10:17:05', NULL, NULL),
(36, 'Pengajuan atau Verifikasi Sertifikat Elektronik (E-Sign)', '&#60;p&#62;Permohonan pengajuan sertifikat elektronik sudah kami ajukan ke lemsaneg, langkah selanjutnya yang harus dilakukan masing-masing user:&#60;br&#62;1. Aktifasi/verifikasi akun:&#60;/p&#62;\r\n&#60;ul&#62;\r\n&#60;li&#62;buka email&#60;/li&#62;\r\n&#60;li&#62;buka link aktifasi/verifikasi&#60;/li&#62;\r\n&#60;li&#62;unggah KTP&#60;/li&#62;\r\n&#60;li&#62;unggah foto selfie&#60;/li&#62;\r\n&#60;li&#62;isi formulir yang diberikan&#60;/li&#62;\r\n&#60;li&#62;klik aktifkan/verifikasi&#60;/li&#62;\r\n&#60;/ul&#62;\r\n&#60;p&#62;2. Menunggu diverifikasi oleh verifikator instansi&#60;br&#62;3. Setelah diverifikasi maka akan mendapatkan username dan password untuk login ke portal bsre&#60;br&#62;4. kemudian lakukan pengajuan sertifikat melalui &#60;a href=\"https://portal-bsre.bssn.go.id/\"&#62;https://portal-bsre.bssn.go.id&#60;/a&#62; dengan cara:&#60;/p&#62;\r\n&#60;ul&#62;\r\n&#60;li&#62;Masuk ke menu sertifikat saya, pilih permohonan baru&#60;/li&#62;\r\n&#60;li&#62;Pilih produk =&#38;gt; Esign&#60;/li&#62;\r\n&#60;li&#62;pilih Jenis Sertifikat Elektronik =&#38;gt; Individu&#60;/li&#62;\r\n&#60;li&#62;Klik Enroll&#60;/li&#62;\r\n&#60;li&#62;klik pilih file, kemudian pilih surat rekomendasi (terlampir: surat rekomendasi - BPS Lombok utara.pdf)&#60;/li&#62;\r\n&#60;li&#62;klik submit&#60;/li&#62;\r\n&#60;li&#62;Setelah berhasil maka link set passphrase akan dikirimkan ke email masing-masing&#60;/li&#62;\r\n&#60;/ul&#62;\r\n&#60;p&#62;5. Buka email masing-masing, kemudian cari email set passphrase untuk membuat passphrase. Passphrase tidak sama dengan password. Password digunakan untuk login, sedangkan passphrase digunakan untuk menandatangani dokumen.&#60;br&#62;6. Tunggu hingga verifikasi yang dilakukan oleh RA BSrE selesai dilakukan. Setelah selesai masing-masing user akan mendapatkan email dengan subject \"[BSrE] Certificate Issued\" yang menandakan sertifikat elektronik sudah dapat digunakan. Baik di aplikasi &#60;a href=\"https://esign-bsre.bssn.go.id/\"&#62;https://esign-bsre.bssn.go.id&#60;/a&#62; maupun &#60;a href=\"https://ettd.bps.go.id/\"&#62;https://ettd.bps.go.id&#60;/a&#62;&#60;br&#62;7. Untuk penggunaan role Signer pada aplikasi ETTD BPS perlu klaim role signer di menu profil(klik nama di pojok kanan atas), kemudian klik Klaim Signer&#60;/p&#62;', 1, 2, 0, '2023-02-15 10:22:16', '2023-02-15 10:22:16', NULL, NULL),
(37, 'Aktivasi Office 2010 dan 2013', '&#60;p&#62;Yth. Bpk/Ibu&#60;br&#62;Untuk aktivasi Office dapat di unduh di community: &#60;a href=\"https://community.bps.go.id/portal/files/panduan%20aktivasi%20office.pdf\"&#62;https://community.bps.go.id/portal/files/panduan aktivasi office.pdf.&#60;/a&#62;&#60;br&#62;&#60;br&#62;Terima kasih telah menghubungi HaloSIS&#60;br&#62;Salam.&#60;/p&#62;', 1, 2, 1, '2023-02-15 10:23:23', '2023-02-15 10:23:23', NULL, NULL),
(38, 'Lisensi/Aktivasi Office 2019, 2013, dan 2010', '&#60;p&#62;&#60;em&#62;&#60;strong&#62;Lisensi  Microsoft Office BPS&#60;/strong&#62;&#60;/em&#62;&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;Office 2019&#60;/strong&#62;&#60;br&#62;8HMN8-WMDWQ-VVX96-JD8BB-39P63&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;Panduan Instalasi Office 2019&#60;/strong&#62; &#60;/p&#62;\r\n&#60;p&#62;Installer: &#60;a title=\"Installer Office 2019 Pro\" href=\"https://halosis-dev.bps.go.id/front/s.bps.go.id/msoffice2019pro\" target=\"_blank\" rel=\"noopener\"&#62;Office 2019 Pro&#60;/a&#62;  &#60;/p&#62;\r\n&#60;p&#62;Buku Petunjuk: &#60;a title=\"Buku Petunjuk Instalasi Office 2019 Pro\" href=\"http://s.bps.go.id/petunjuk_msoffice2019pro\" target=\"_blank\" rel=\"noopener\"&#62;Office 2019 Pro&#60;/a&#62;&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;Office 2013&#60;/strong&#62;&#60;br&#62;GN2P2-Y3FQT-97PXH-8MK94-JHR3H&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;Office 2010&#60;/strong&#62;&#60;br&#62;FD4J4-GRCTY-YBH64-44RQC-PKPK6&#60;/p&#62;', 1, 2, 8, '2023-02-15 10:27:33', '2023-02-15 10:27:33', NULL, NULL),
(39, 'UPS mati total', 'Solusi : &#60;br /&#62;1. Cek kabel apakah sudah terpasang dengan benar&#60;br /&#62;&#60;strong&#62;&#60;br /&#62;Jika solusi diatas tidak berhasil, buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
