(41, 'Printer / Scanner paper jam', 'Penyebab :&#60;br /&#62;1. Kertas kotor atau lengket atau masih ada stapless nya&#60;br /&#62;2. Masih ada kertas / sisa kertas yang menyangkut &#60;br /&#62;&#60;br /&#62;Solusi : &#60;br /&#62;1.Ganti menggunakan kertas yang lebih layak untuk digunakan&#60;br /&#62;2.Matikan mesin dan tarik kertas / sisa kertas yang tersangkut searah dengan putaran roller&#60;br /&#62;&#60;strong&#62;&#60;br /&#62;Jika solusi diatas tidak berhasil, &#60;/strong&#62;&#60;strong&#62;buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(42, 'Printer / Scanner tidak bisa menarik kertas karena roller atau gearbox rusak', ' &#60;strong&#62;B&#60;/strong&#62;&#60;strong&#62;uat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(43, 'Hasil print tidak jelas atau buram atau bergaris', 'Penyebab : toner habis &#60;br /&#62; Solusi : Ganti toner&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Jika solusi tidak berhasil, b&#60;/strong&#62;&#60;strong&#62;uat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
