(45, 'Hasil scan bergaris / terdapat noda', 'Penyebab : Scanner kotor&#60;br /&#62; Solusi : Bersihkan mesin scanner &#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Jika solusi diatas tidak berhasil, b&#60;/strong&#62;&#60;strong&#62;uat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(46, 'backup database aplikasi gagal', ' &#60;strong&#62;A. Penyebab: koneksi terputus&#60;/strong&#62;&#60;br /&#62;&#60;strong&#62;Solusi: &#60;/strong&#62;&#60;br /&#62; 1. Cek kondisi fisik komputer (kabel LAN, &#60;em&#62;switch&#60;/em&#62;, dan lain-lain)&#60;br /&#62; 2. Cek pengaturan jaringan (konfigurasi IP dan non-aktifkan &#60;em&#62;firewall&#60;/em&#62;)&#60;br /&#62; 3. Buka &#60;em&#62;&#60;strong&#62;command prompt&#60;/strong&#62;&#60;/em&#62;, ketik&#60;strong&#62; ping[spasi][alamat IP komputer lain yang masih dalam satu jaringan]&#60;/strong&#62;&#60;br /&#62; 4. Jika pada &#60;em&#62;command prompt &#60;/em&#62;tampil \"Reply .....\" maka komputer telah terhubung dengan jaringan&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;B. Penyebab: &#60;em&#62;Database &#60;/em&#62;masih melakukan transaksi&#60;/strong&#62;&#60;br /&#62;&#60;strong&#62;Solusi: &#60;/strong&#62;&#60;br /&#62; 1. Tutup dahulu semua aplikasi &#60;em&#62;client &#60;/em&#62;yang sedang terhubung ke aplikasi &#60;em&#62;server &#60;/em&#62;tersebut&#60;br /&#62;2. Ulangi kembali proses &#60;em&#62;backup database&#60;/em&#62;&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;C. Penyebab: &#60;em&#62;Error 5 - Access is denied &#60;/em&#62;atau akses ditolak karena masalah autentifikasi&#60;br /&#62; Solusi: &#60;/strong&#62;&#60;br /&#62;Error ini dapat muncul jika lokasi penyimpanan hasil backup database tidak boleh diakses atau Read only. &#60;br /&#62;1. Klik kanan nama &#60;em&#62;folder &#60;/em&#62;(dimana hasil &#60;em&#62;backup&#60;/em&#62; data akan disimpan),pilih &#60;em&#62;properties&#60;/em&#62;&#60;br /&#62;2. Hilangkan pilihan atribut \"&#60;em&#62;Read only&#60;/em&#62;\" dan \"&#60;em&#62;Hidden&#60;/em&#62;\"&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;D. Penyebab: &#60;em&#62;Error 23 - Data error (cyclic redundancy check) &#60;/em&#62;atau lokasi (media) penyimpanan hasil tidak dapat di Read/Write&#60;/strong&#62;&#60;br /&#62;&#60;strong&#62;Solusi&#60;/strong&#62;: Ubah lokasi penyimpanan ke media/lokasi lain&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;E&#60;/strong&#62;. &#60;strong&#62;Penyebab: &#60;em&#62;Error 53 - The network path was not found&#60;/em&#62; atau &#60;em&#62;share folder &#60;/em&#62;dalam jaringan tidak ditemukan&#60;br /&#62; Solusi: &#60;/strong&#62;&#60;br /&#62;1. Cek apakah &#60;em&#62;path &#60;/em&#62;penyimpanan sudah benar&#60;br /&#62;2. Matikan &#60;em&#62;firewall&#60;/em&#62;&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;F. Penyebab: &#60;em&#62;Error 64 - The specified network name is no longer available&#60;/em&#62;.&#60;br /&#62;Solusi&#60;/strong&#62;: &#60;em&#62;Error &#60;/em&#62;ini mungkin disebabkan saat proses &#60;em&#62;backup &#60;/em&#62;berlangsung, tiba tiba terjadi masalah jaringan atau komputer tiba-tiba mati/&#60;em&#62;restart&#60;/em&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(47, 'koneksi database error', ' &#60;strong&#62;A. Penyebab: Komputer belum terhubung jaringan&#60;br /&#62;Solusi:&#60;br /&#62;&#60;/strong&#62;1. Cek kondisi fisik komputer (kabel LAN, switch, dan lain-lain)&#60;br /&#62;2. Cek pengaturan jaringan (konfigurasi IP dan non-aktifkan &#60;em&#62;firewall&#60;/em&#62;) &#60;br /&#62;3. Buka &#60;strong&#62;&#60;em&#62;command prompt&#60;/em&#62;&#60;/strong&#62;, ketik &#60;strong&#62;ping[spasi][alamat IP komputer lain yang masih dalam satu jaringan]&#60;/strong&#62;&#60;br /&#62;4. Jika pada &#60;em&#62;command prompt &#60;/em&#62;tampil \"&#60;em&#62;Reply ....&#60;/em&#62;.\" maka komputer telah terhubung dengan jaringan&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;B. Penyebab: Alamat database server salah&#60;br /&#62;Solusi:&#60;br /&#62;&#60;/strong&#62;1. Buka halaman pengaturan koneksi &#60;em&#62;database &#60;/em&#62;yang telah disediakan pada aplikasi &#60;em&#62;client&#60;/em&#62;&#60;br /&#62;2.Cek format penulisan alamat &#60;em&#62;database server &#60;/em&#62;yang digunakan &#60;strong&#62;([alamat IP][nama &#60;em&#62;instance database server&#60;/em&#62;])&#60;/strong&#62;, misalnya: 10.2.7.69SQLEXPRESS1&#60;br /&#62;3.Klik \"&#60;strong&#62;Test&#60;/strong&#62;\" untuk mencoba apakah aplikasi dapat terhubung ke &#60;em&#62;database server&#60;/em&#62;&#60;br /&#62;4. Jika keluar pesan \"&#60;strong&#62;Koneksi berhasil&#60;/strong&#62;\" maka aplikasi telah berhasil terhubung ke&#60;em&#62; database server&#60;/em&#62;&#60;br /&#62;5. Klik \"&#60;strong&#62;Simpan&#60;/strong&#62;\" untuk menyimpan pengaturan koneksi &#60;em&#62;database &#60;/em&#62;aplikasi&#60;br /&#62;&#60;strong&#62;&#60;br /&#62;C. Penyebab: Database server belum ada&#60;br /&#62;Solusi:&#60;/strong&#62;&#60;br /&#62;1. Pastikan aplikasi &#60;em&#62;server &#60;/em&#62;telah berhasil diinstal&#60;br /&#62;2. Buka aplikasi &#60;em&#62;server&#60;/em&#62;&#60;br /&#62;3. Pilih instance SQL &#60;em&#62;Server &#60;/em&#62;yang akan digunakan&#60;br /&#62;4. Klik \"&#60;strong&#62;Connect&#60;/strong&#62;\" &#60;br /&#62;3. Lakukan \"&#60;strong&#62;Create Database&#60;/strong&#62;\" &#60;br /&#62;4. Lakukan \"&#60;strong&#62;Import data persiapan&#60;/strong&#62;\"&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;D. Penyebab: Service SQL Server (di PC &#60;em&#62;Server&#60;/em&#62;) belum aktif&#60;br /&#62;Solusi:&#60;/strong&#62;&#60;br /&#62;1. Buka &#60;strong&#62;SQL &#60;em&#62;Server Configuration Manager &#60;/em&#62;&#60;/strong&#62;pada komputer &#60;em&#62;server &#60;/em&#62;(&#60;strong&#62;Start--&gt;All Programs--&gt; SQL Server Configuration Manager&#60;/strong&#62;)&#60;br /&#62;2. Expand &#60;strong&#62;SQL &#60;em&#62;Server Network Configuration&#60;/em&#62;&#60;/strong&#62;&#60;br /&#62;3. Pilih &#60;strong&#62;&#60;em&#62;instance &#60;/em&#62;&#60;/strong&#62;yang digunakan&#60;br /&#62;4. Pada &#60;strong&#62;Console Pane&#60;/strong&#62;, klik \"&#60;strong&#62;Protocols for\" &#60;/strong&#62;&#60;br /&#62;5. Pastikan &#60;strong&#62;&#60;em&#62;Shared Memory&#60;/em&#62;&#60;/strong&#62;,&#60;strong&#62; &#60;em&#62;Named Pipes&#60;/em&#62;&#60;/strong&#62;, &#60;strong&#62;TCP/IP &#60;/strong&#62;statusnya &#60;em&#62;&#60;strong&#62;Enable&#60;/strong&#62;&#60;/em&#62;, seperti gambar di atas. Jika masih &#60;em&#62;disable &#60;/em&#62;statusnya, klik kanan kemudian pilih \"&#60;strong&#62;&#60;em&#62;Enable&#60;/em&#62;&#60;/strong&#62;\"&#60;br /&#62;6. &#60;strong&#62;&#60;em&#62;Restart &#60;/em&#62;&#60;/strong&#62;instance SQL &#60;em&#62;Server &#60;/em&#62;tersebut setelah dilakukan &#60;em&#62;treatment &#60;/em&#62;seperti di atas. Pada &#60;strong&#62;&#60;em&#62;Console Pane&#60;/em&#62;&#60;/strong&#62;, klik \"&#60;strong&#62;SQL &#60;em&#62;Server Services&#60;/em&#62;\"&#60;/strong&#62;&#60;br /&#62;7. Pada &#60;em&#62;&#60;strong&#62;Details Pane&#60;/strong&#62;&#60;/em&#62;, klik kanan \"&#60;em&#62;&#60;strong&#62;SQL Server&#60;/strong&#62;\" &#60;/em&#62;dan kemudian klik \"&#60;strong&#62;&#60;em&#62;Restart&#60;/em&#62;&#60;/strong&#62;\" untuk &#60;em&#62;stop &#60;/em&#62;atau &#60;em&#62;restart service &#60;/em&#62;SQL &#60;em&#62;server&#60;/em&#62;&#60;br /&#62;8. Jika masih belum bisa terkoneksi antara &#60;em&#62;client &#60;/em&#62;dan &#60;em&#62;server&#60;/em&#62;:&#60;br /&#62;- matikan settingan &#60;em&#62;firewall&#60;/em&#62;-nya.&#60;br /&#62;- setting &#60;strong&#62;&#60;em&#62;User Account Control Settings&#60;/em&#62;&#60;/strong&#62; di &#60;strong&#62;Control Panel &#60;/strong&#62;menjadi&#60;strong&#62; &#60;/strong&#62;\"&#60;em&#62;&#60;strong&#62;Never notify&#60;/strong&#62;&#60;/em&#62;\"&#60;br /&#62;9. &#60;em&#62;&#60;strong&#62;Restart &#60;/strong&#62;&#60;/em&#62;laptop/PC&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;E. Penyebab: Belum melakukan &#60;em&#62;setup database &#60;/em&#62;(untuk aplikasi IMK)&#60;br /&#62;Solusi:&#60;/strong&#62;&#60;br /&#62;1. &#60;em&#62;Database &#60;/em&#62;harus dibuat dulu dengan menggunakan menu &#60;strong&#62;&#60;em&#62;database setup&#60;/em&#62;&#60;/strong&#62;. Menu ini berfungsi untuk membentuk &#60;em&#62;database &#60;/em&#62;VIMK[tahun] Tahunan sesuai dengan wilayah kerja (per provinsi) dan tahun kegiatan. &#60;br /&#62;2. Lokasi penyimpanan dapat berupa &#60;em&#62;shared folder &#60;/em&#62;jika komputer terhubung oleh jaringan maupun pada hardisk pada &#60;em&#62;local drive&#60;/em&#62;. Menu ini hanya dijalankan sekali ketika ingin membentuk &#60;em&#62;database &#60;/em&#62;baru. &#60;em&#62;Database &#60;/em&#62;yang sudah pernah terbentuk di dalam &#60;em&#62;folder &#60;/em&#62;yang dipilih tidak akan pernah terbentuk kembali sebelum &#60;em&#62;database &#60;/em&#62;tersebut di hapus secara manual dari dalam &#60;em&#62;folder &#60;/em&#62;yang dipilih, untuk menentukan wilayah kerja (provinsi) dilakukan dengan memberikan tanda &#60;strong&#62;&#60;em&#62;check&#60;/em&#62;&#60;/strong&#62; pada provinsi yang sesuai. &#60;em&#62;Database &#60;/em&#62;dapat dibuat lebih dari satu wilayah kerja pada tahun kegiatan yang sama.&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;F. Penyebab: &#60;em&#62;Database Location Setting &#60;/em&#62;(Pengaturan Lokasi Database) salah (untuk aplikasi IMK)&#60;br /&#62;Solusi:&#60;/strong&#62;&#60;br /&#62;1. Lakukan pengaturan Lokasi &#60;em&#62;database &#60;/em&#62;kerja melalui menu &#60;em&#62;&#60;strong&#62;Database Location Setting&#60;/strong&#62;&#60;/em&#62;&#60;br /&#62;2.Jika &#60;em&#62;database &#60;/em&#62;kerja ada di komputer lain (dalam &#60;em&#62;shared folder &#60;/em&#62;melalui &#60;em&#62;network&#60;/em&#62;), pilih Telah ada dalam &#60;em&#62;shared folder &#60;/em&#62;(melalui &#60;em&#62;network&#60;/em&#62;)&#60;br /&#62;3. Jika &#60;em&#62;database &#60;/em&#62;kerja ada di penyimpanan lokal, maka Pilih &#60;em&#62;folder &#60;/em&#62;di &#60;em&#62;local drive&#60;/em&#62;&#60;br /&#62;4. Kemudian &#60;strong&#62;&#60;em&#62;Browse &#60;/em&#62;&#60;/strong&#62;lokasi &#60;em&#62;database-&#60;/em&#62;nya&#60;br /&#62;5. Pilih Tahun&#60;br /&#62;6. Pilih Jenis Modul (Triwulan atau Tahunan), Pilih Triwulan (jika jenis modul adalah Triwulan)&#60;br /&#62;7. Pilih Wilayah kerja&#60;br /&#62;8. Pilih Propinsi kerja&#60;br /&#62;9. Klik \"&#60;strong&#62;OK\"&#60;/strong&#62;&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(48, 'Komputer ( PC atau Laptop atau Tablet ) tidak mau booting atau tidak mau masuk ke sistem operasi', 'Solusi :&#60;br /&#62;&#60;strong&#62;Buat tiket keluhan ke halosis, sebutkan merk, tipe dan nomor BMN perangkat.&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(49, 'Komputer ( PC atau Laptop atau Tablet ) lambat dalam melakukan proses / sering hang / bluescreen', 'A&#60;br /&#62;Penyebab: Komputer terserang virus&#60;br /&#62;Solusi: Install antivirus dan &#60;em&#62;scan&#60;/em&#62; virus menggunakan antivirus berlisensi milik BPS&#60;br /&#62;&#60;br /&#62;B&#60;br /&#62;Penyebab: banyak aplikasi-aplikasi yang terinstall (PC kepenuhan aplikasi)&#60;br /&#62;Solusi: &#60;br /&#62;- hapus/uninstall aplikasi yang tidak resmi dan atau tidak terpakai lagi.&#60;br /&#62;- lakukan &#60;em&#62;disk clean up&#60;/em&#62; dan &#60;em&#62;defragment.&#60;/em&#62;&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Apabila solusi diatas tidak berhasil, buat tiket keluhan ke halosis, sebutkan merk, tipe dan nomor BMN perangkat.&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(50, 'PC atau komputer mati total', 'Solusi:&#60;br /&#62;1. Cek kabel &#60;em&#62;power&#60;/em&#62; apakah sudah terpasang dengan benar.&#60;br /&#62;2. Jika menggunakan UPS, cek kabel dari komputer ke UPS apakah sudah terpasang dengan benar.&#60;br /&#62;3. Jika menggunakan UPS, cek apakah UPS sudah dinyalakan atau belum.&#60;br /&#62;4. Apabila solusi 1, 2, dan 3 tidak berhasil maka buat tiket keluhan ke halosis dengan menyebutkan merk, tipe dan nomor BMN komputer', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(51, 'Monitor pada PC mati total', 'Solusi: &#60;br /&#62;1. Cek kabel &#60;em&#62;power&#60;/em&#62; apakah sudah terpasang dengan benar.&#60;br /&#62;2. Jika menggunakan UPS, cek kabel dari monitor ke UPS apakah sudah terpasang dengan benar.&#60;br /&#62;3. Jika menggunakan UPS, cek apakah UPS sudah dinyalakan atau belum.&#60;br /&#62;&#60;strong&#62;Apabila solusi diatas tidak berhasil, buat tiket keluhan ke halosis, sebutkan merk, tipe dan nomor BMN perangkat.&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(52, 'Mouse atau keyboard mengalami kerusakan', 'Solusi :&#60;br /&#62;Untuk mouse/keyboard &#60;strong&#62;Wireless&#60;/strong&#62;&#60;strong&#62;/nirkabel&#60;/strong&#62;&#60;br /&#62;1. Cek baterai.&#60;br /&#62;2. Cek USB dongle yang terpasang pada CPU apakah sudah terpasang dengan benar.&#60;br /&#62;3. Jika nomor 1 dan 2 masih baik, pindahkan USB dongle pada port USB yang lain.&#60;br /&#62;&#60;br /&#62;Untuk mouse/keyboard &#60;strong&#62;Wire/kabel&#60;/strong&#62;&#60;br /&#62;1. Coba mouse/keyboard di komputer/laptop lain.&#60;br /&#62;&#60;br /&#62;Jika semua solusi diatas tidak berhasil, buat tiket keluhan ke halosis dengan menyebutkan merk, tipe dan serial number / &#60;em&#62;Service tag&#60;/em&#62; yang terletak diatas CPU', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(53, 'PC atau komputer menyala tetapi tidak muncul tampilan di monitor', '&#60;strong&#62;Buat tiket keluhan ke halosis, sebutkan merk, tipe dan nomor BMN perangkat.&#60;/strong&#62;', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(54, 'Laptop atau Tablet tidak bisa dicharge', 'Solusi :&#60;br /&#62;Buat tiket keluhan ke halosis, sebutkan merk, tipe dan nomor BMN perangkat.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(55, 'Laptop mati total', 'Penyebab: Laptop mengalami kerusakan pada satu atau beberapa &#60;em&#62;sparepart.&#60;br /&#62;&#60;/em&#62;Solusi: buat tiket keluhan ke halosis dengan menyebutkan merk, tipe dan nomor BMN laptop', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(56, 'Tidak bisa login windows', 'Penyebab: Lupa &#60;em&#62;password&#60;/em&#62; windows&#60;br /&#62;Solusi: &#60;em&#62;Reset&#60;/em&#62; password', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(57, 'Instalasi software tidak berhasil', 'A&#60;br /&#62;Penyebab: Spesifikasi &#60;em&#62;hardware&#60;/em&#62; dan &#60;em&#62;softwar&#60;/em&#62;e tidak mendukung&#60;br /&#62;Solusi: &#60;em&#62;Upgrade software&#60;/em&#62; dan &#60;em&#62;hardware&#60;/em&#62;&#60;br /&#62;&#60;br /&#62;B&#60;br /&#62;Penyebab: &#60;em&#62;Source&#60;/em&#62; tidak benar (&#60;em&#62;corrupt&#60;/em&#62; atau tidak asli)&#60;br /&#62;Solusi: &#60;em&#62;Download&#60;/em&#62; dengan menggunakan &#60;em&#62;source&#60;/em&#62; yang benar&#60;br /&#62;&#60;br /&#62;C&#60;br /&#62;Penyebab: Instalasi tidak dijalankan sebagai Administrator&#60;br /&#62;Solusi: Klik kanan pada &#60;em&#62;file&#60;/em&#62; instalasi, klik Run as Administrator&#60;br /&#62;&#60;br /&#62;D&#60;br /&#62;Penyebab: Komputer terkena virus&#60;br /&#62;Solusi: Bersihkan komputer dari virus', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(58, 'Windows not genuine', 'Penyebab: Lisensi Windows tidak asli&#60;br /&#62;Solusi: &#60;br /&#62;a. Ganti Windows asli&#60;br /&#62;b. Ganti lisensi Windows dengan yang asli', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(59, 'Aktivasi windows kadaluarsa / kadaluwarsa / kedaluwarsa', 'Penyebab: Windows belum berlisensi atau lisensi kadaluarsa/expired&#60;br /&#62;Solusi: Menggunakan lisensi baru', 1, 2, 1, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(60, 'Software tidak berfungsi dengan normal', 'Penyebab: Software &#60;em&#62;corrupt&#60;/em&#62;&#60;br /&#62;Solusi: Instal ulang software yang &#60;em&#62;corrupt&#60;/em&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(61, 'Aplikasi tidak dapat diakses', 'Penyebab: Server tidak dapat diakses&#60;br /&#62;Solusi:&#60;br /&#62;a. Memastikan &#60;em&#62;server&#60;/em&#62; menyala&#60;br /&#62;b. Memastikan &#60;em&#62;application pool&#60;/em&#62; menyala&#60;br /&#62;(Semua langkah di atas dilakukan oleh admin)', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(62, 'Error 500 - Internal server error', 'Penyebab: Server &#60;em&#62;busy&#60;/em&#62;&#60;br /&#62;Solusi: &#60;em&#62;Refresh&#60;/em&#62; halaman &#60;em&#62;browser&#60;/em&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(63, 'User atau pengguna tidak bisa login', 'A&#60;br /&#62;Penyebab: Username dan atau password yang dimasukkan salah&#60;br /&#62;Solusi:&#60;br /&#62;a. Pastikan username yang dimasukkan benar&#60;br /&#62;b. Pastikan password yang dimasukkan benar&#60;br /&#62;c. Pastikan username dan password dapat digunakan untuk login community (khusus untuk layanan dengan login community)&#60;br /&#62;d. Untuk Presensi Online Daerah dan Sipintar, jika user lupa password, password akan diriset (dilakukan oleh admin pusat)&#60;br /&#62;&#60;br /&#62;B&#60;br /&#62;Penyebab: Data pegawai belum sesuai&#60;br /&#62;Solusi: Melakukan transfer data pegawai dari data Simpeg (dilakukan oleh admin)&#60;br /&#62;&#60;br /&#62;C&#60;br /&#62;Penyebab: Server database tidak dapat diakses &#60;br /&#62;Solusi:&#60;br /&#62;a. Memastikan server database menyala&#60;br /&#62;b. Memastikan service database dalam status running&#60;br /&#62;c. Memastikan database dapat diakses dari aplikasi&#60;br /&#62;d. Memeriksa setting firewall.&#60;br /&#62;(Semua langkah di atas dilakukan oleh admin)&#60;br /&#62;&#60;br /&#62;D&#60;br /&#62;Penyebab: User belum terdaftar&#60;br /&#62;Solusi:&#60;br /&#62;a. Memastikan user memiliki hak akses aplikasi&#60;br /&#62;b. Menambahkan user&#60;br /&#62;(Semua langkah di atas dilakukan oleh admin)&#60;br /&#62;&#60;br /&#62;E&#60;br /&#62;Penyebab: Data status pegawai tidak lengkap&#60;br /&#62;Solusi:&#60;br /&#62;a. Periksa penulisan email melalui community &#60;br /&#62;b. Periksa status pegawai saat ini. Jika status masih kosong, lengkapi data pegawai (dilakukan oleh admin / Bag. Administrasi Kepegawaian ).&#60;br /&#62;c. Pastikan username dan password dapat digunakan untuk login community&#60;br /&#62;&#60;br /&#62;F&#60;br /&#62;Penyebab: Terdapat kesalahan penulisan email di community (terdapat spasi sebelum @)&#60;br /&#62;Solusi:&#60;br /&#62;a. Periksa penulisan email melalui community &#60;br /&#62;b. Pastikan pengguna dapat login ke community&#60;br /&#62;&#60;br /&#62;G&#60;br /&#62;Penyebab: Pegawai tidak terdaftar.&#60;br /&#62;Solusi: Mendaftarkan pegawai sebagai pengguna (dilakukan oleh admin).&#60;br /&#62;&#60;br /&#62;H&#60;br /&#62;Penyebab: Pegawai tidak mempuyai hak akses.&#60;br /&#62;Solusi: Memasikan bahwa pegawai ybs adalah pejabat struktural eselon 1/2/3 aktif pada bulan yang dinilai.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(64, 'instalasi aplikasi gagal', ' &#60;strong&#62;Penyebab&#60;/strong&#62;: Komputer tidak memenuhi spesifikasi minimum yang disyaratkan&#60;br /&#62;&#60;strong&#62;Solusi&#60;/strong&#62;: &#60;br /&#62;Secara umum spesifikasi minimum komputer yang diperlukan adalah:&#60;br /&#62;1. Komputer dengan sistem operasi minimal Windows 7&#60;br /&#62;2. Telah terinstall SQL Server 2008 R2&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(65, 'create database gagal', ' &#60;strong&#62;Penyebab&#60;/strong&#62;: Versi SQL &#60;em&#62;Server &#60;/em&#62;lebih rendah dari SQL Server 2008 R2&#60;br /&#62;&#60;strong&#62;Solusi&#60;/strong&#62;: &#60;em&#62;Upgrade &#60;/em&#62;versi SQL &#60;em&#62;Server &#60;/em&#62;minimal 2008 R2&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(66, 'restore database gagal', 'A. &#60;strong&#62;Penyebab: &#60;em&#62;Fi&#60;/em&#62;&#60;/strong&#62;&#60;em&#62;le backup &#60;/em&#62;tidak sesuai&#60;strong&#62;&#60;br /&#62;Solusi: &#60;/strong&#62;Cek kembali apakah &#60;em&#62;file &#60;/em&#62;yang akan di-&#60;em&#62;restore &#60;/em&#62;benar benar &#60;em&#62;file &#60;/em&#62;hasil backup dari aplikasi &#60;em&#62;server&#60;/em&#62;. &#60;em&#62;File backup &#60;/em&#62;biasanya berekstensi &#60;strong&#62;[namaaplikasi].bakz&#60;/strong&#62;&#60;br /&#62;&#60;br /&#62;B. &#60;strong&#62;Penyebab: &#60;/strong&#62;Memori komputer tidak cukup&#60;br /&#62;&#60;span&#62;&#60;strong&#62;Solusi: &#60;/strong&#62;Pastikan kapasitas komputer yang digunakan untuk melakukan &#60;em&#62;restore database &#60;/em&#62;masih mencukupi.&#60;/span&#62;&#60;strong&#62;&#60;br /&#62;&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(67, 'user atau pengguna tidak bisa login ke aplikasi', 'A. &#60;strong&#62;Penyebab&#60;/strong&#62;: &#60;strong&#62;&#60;em&#62;username &#60;/em&#62;&#60;/strong&#62;atau &#60;strong&#62;&#60;em&#62;password &#60;/em&#62;&#60;/strong&#62;salah&#60;br /&#62;&#60;strong&#62;Solusi&#60;/strong&#62;: pastikan &#60;em&#62;&#60;strong&#62;username &#60;/strong&#62;&#60;/em&#62;dan &#60;strong&#62;&#60;em&#62;password &#60;/em&#62;&#60;/strong&#62;yang dimasukkan benar&#60;br /&#62;&#60;br /&#62;B. &#60;strong&#62;Penyebab&#60;/strong&#62;: &#60;em&#62;&#60;strong&#62;username &#60;/strong&#62;&#60;/em&#62;belum terdaftar&#60;br /&#62;&#60;strong&#62;Solusi&#60;/strong&#62;: &#60;br /&#62;1. &#60;strong&#62;Login &#60;/strong&#62;sebagai &#60;strong&#62;&#60;em&#62;administrator&#60;/em&#62;&#60;/strong&#62;&#60;br /&#62;2. &#60;strong&#62;Tambahkan &#60;/strong&#62;sebagai &#60;em&#62;user &#60;/em&#62;atau pengguna&#60;em&#62; &#60;/em&#62;baru&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(68, 'user atau pengguna tidak dapat mengubah password', ' &#60;strong&#62;Penyebab&#60;/strong&#62;: &#60;em&#62;Password &#60;/em&#62;yang diganti bukan merupakan &#60;em&#62;password &#60;/em&#62;dari &#60;em&#62;account &#60;/em&#62;user yang sedang aktif (&#60;em&#62;login&#60;/em&#62;)&#60;br /&#62;&#60;strong&#62;Solusi&#60;/strong&#62;: &#60;em&#62;User &#60;/em&#62;tidak dapat mengubah &#60;em&#62;password &#60;/em&#62;dari user lainnya. Pastikan &#60;em&#62;Password &#60;/em&#62;yang diganti adalah &#60;em&#62;password &#60;/em&#62;dari &#60;em&#62;account user &#60;/em&#62;yang sedang aktif (&#60;em&#62;login&#60;/em&#62;)', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(69, 'Hak akses , kegiatan , atau data lain yang ditampilkan tidak sesuai', 'Penyebab: Data pegawai belum sesuai&#60;br /&#62;Solusi: Melakukan transfer data pegawai dari data Simpeg (dilakukan oleh admin)&#60;span&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(70, 'Report atau laporan tidak muncul', 'A&#60;br /&#62;Penyebab: Koneksi internet kurang stabil&#60;br /&#62;Solusi: Periksa koneksi internet yang digunakan&#60;br /&#62;&#60;span&#62;&#60;br /&#62;B&#60;br /&#62;&#60;/span&#62;Penyebab: &#60;em&#62;Report server &#60;/em&#62;dan atau &#60;em&#62;report servic&#60;/em&#62;&#60;em&#62;e&#60;/em&#62; tidak dapat diakses&#60;br /&#62;Solusi: &#60;br /&#62;a. Memastikan &#60;em&#62;report server&#60;/em&#62; menyala&#60;br /&#62;b. Memastikan &#60;em&#62;report service&#60;/em&#62; menyala&#60;br /&#62;(Semua langkah di atas dilakukan oleh admin)', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(71, 'File sudah diupload , tetapi setelah pindah halaman atau submit , file tersebut hilang', 'Penyebab: User belum meng-klik tombol upload setelah memilih dokumen yang diupload&#60;br /&#62;Solusi:&#60;br /&#62;a. Admin inpassing menolak usulan pengajuan inpassing pegawai bersangkutan (apabila sudah disubmit)&#60;br /&#62;b. User atau operator meng-upload dokumen', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(72, 'Jenis ujian tidak sesuai', 'Penyebab: Data tidak sesuai&#60;br /&#62;Solusi: Memperbaiki isian database Aplikasi Uji Kompetensi (dilakukan oleh admin)&#60;span&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(73, 'User atau pengguna tidak bisa login dan form login muncul berulang-ulang (looping)', 'A&#60;br /&#62;Penyebab: Koneksi internet menggunakan speedy&#60;br /&#62;Solusi: Ganti dengan menggunakan koneksi internet yang lain&#60;br /&#62;&#60;br /&#62;B&#60;br /&#62;Penyebab: Ketika login tidak menyertakan domain bps&#60;span&#62;&#60;br /&#62;Solusi:&#60;br /&#62;a. Pastikan username yang dimasukkan benar dengan menyertakan domain bps&#60;br /&#62;Contoh: bpsusername&#60;br /&#62;Setelah domain bps, gunakan backslash (), bukan garis miring&#60;br /&#62;b. Pastikan password yang dimasukkan benar&#60;br /&#62;c. Pastikan username dan password dapat digunakan untuk login community&#60;br /&#62;&#60;br /&#62;C&#60;br /&#62;Penyebab: Username yang terdaftar masih berupa NIP&#60;br /&#62;Solusi:&#60;br /&#62;&#60;/span&#62;a. Hapus user bersangkutan dari daftar pengguna&#60;br /&#62;b. Login community dengan menggunakan akun user bersangkutan&#60;br /&#62;c. Tambahkan kembali user tesebut ke daftar pengguna&#60;br /&#62;d. Login kembali ke aplikasi TK Online&#60;br /&#62;e. Jika belum berhasil, silakan menghubungi helpdesk kembali', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(74, 'User atau pengguna berhasil masuk ke aplikasi TK Online tetapi menu aplikasi tidak muncul', 'Penyebab: User yang bersangkutan terdaftar sebagai operator tetapi username-nya belum terdaftar pada user group.&#60;br /&#62;Solusi: Menambahkan username pada user group yang sesuai.&#60;span&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(75, 'Tidak bisa menambah operator baru pada aplikasi TK Online', 'A&#60;br /&#62;Penyebab: User yang bersangkutan tidak memiliki wewenang.&#60;br /&#62;Solusi: Untuk mengelola operator aplikasi TK Online, dapat menghubungi penanggung jawab masing-masing satker.&#60;br /&#62;Penanggung jawab untuk satker provinsi adalah Kabag TU, sedangkan penanggung jawab untuk satker kabupaten/kota adalah Kepala BPS Kab/Kota.&#60;br /&#62;&#60;br /&#62;B&#60;br /&#62;Penyebab: Jumlah user yang terdaftar untuk satker tersebut sudah maksimal (3 orang).&#60;br /&#62;Solusi: Setiap satker hanya dapat mendaftarkan 3 pegawai sebagai operator TK Online, satu sebagai penanggung jawab, dua sebagai operator entri.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(76, 'Username yang tercatat pada aplikasi TK Online tidak sama dengan username yang digunakan untuk login community', 'Penyebab: Username community tersebut belum disinkronisasi dengan username yang ada di Active Directory.&#60;br /&#62;Solusi: &#60;br /&#62;a. Sinkronisasi antara username di community dan username di Active Directory.&#60;br /&#62;(dilakukan oleh admin)&#60;br /&#62;b. Admin akan menghubungi jika sudah disinkronisasi&#60;br /&#62;c. Pastikan dapat digunakan pada login community&#60;br /&#62;d. Login aplikasi TK Online dengan menyertakan domain bps.&#60;br /&#62;Username: bps[username community]&#60;br /&#62;Password: [password community]', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(77, 'Status pegawai , jabatan atau grade tidak berubah walaupun sudah melakukan pengajuan melalui aplikasi TK Online', 'A&#60;br /&#62;Penyebab: Perubahan status mulai berlaku pada penghitungan TK sejak TMT + 1 bulan. &#60;br /&#62;Solusi: Tidak ada yang perlu dilakukan, perubahan akan otomatis terjadi sesuai masa berlaku-nya.&#60;br /&#62;&#60;br /&#62;B&#60;br /&#62;Penyebab: Pengajuan belum disetujui atau ditolak.&#60;br /&#62;Solusi: &#60;br /&#62;Untuk pengajuan yang memang belum disetujui, pengguna harus menunggu sampai pengajuan disetujui. &#60;br /&#62;Untuk pengajuan yang ditolak, pengguna dapat memperbaiki pengajuan yang telah diusulkan dengan memperhatikan alasan penolakan.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(78, 'Aplikasi error', 'A&#60;br /&#62;Penyebab: Data corrupt&#60;br /&#62;Solusi: &#60;br /&#62;a. Memastikan file mana yang corrupt &#60;br /&#62;b. Fixing TPS &#60;br /&#62;c. Me-replace (mengganti) data yang sudah fix&#60;br /&#62;d. Mengganti owner data agar aplikasi dapat dipakai kembali&#60;br /&#62;(Semua langkah tersebut dilakukan oleh admin)&#60;br /&#62;&#60;br /&#62;B&#60;br /&#62;Penyebab: Komputer terkena virus&#60;br /&#62;Solusi: &#60;br /&#62;a. Memeriksa alamat IP komputer mana yang terkena virus &#60;br /&#62;b. Melakukan blok komputer tersebut agar tidak bisa masuk ke sistem &#60;br /&#62;c. Membersihkan komputer tersebut dari virus&#60;br /&#62;d. Melakukan unblock terhadap komputer tersebut&#60;br /&#62;(Semua langkah tersebut dilakukan oleh admin)', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(79, 'Jam di mesin handkey tidak sesuai regional daerah', 'A&#60;br /&#62;Penyebab: Jam di mesin handkey tidak tersinkronisasi dengan server aplikasi presensi online&#60;br /&#62;Solusi: &#60;br /&#62;a. Pastikan status mesin online di aplikasi presensi online&#60;br /&#62;b. Pastikan mesin tidak rusak&#60;br /&#62;&#60;br /&#62;B&#60;br /&#62;Penyebab: Data zona waktu (Time Zone/TZ) yang terdapat di aplikasi woowtime salah&#60;span&#62;&#60;br /&#62;&#60;/span&#62;Solusi: Pastikan isian data Time Zone untuk mesin handkey yang ada di aplikasi presensi online benar', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(80, 'Mesin handkey tidak ada security ketika mengakses menu di dalamnya', 'Penyebab: Tidak ada pegawai yang dijadikan admin, supervisor / enroller pada aplikasi presensi online&#60;br /&#62;Solusi: Pastikan ada pegawai di aplikasi presensi online yang dijadikan admin, supervisor / enroller', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(81, 'Hari libur Nasional / Daerah dihitung hari kerja oleh aplikasi presensi online', 'Penyebab: Hari libur Nasional / Daerah belum dientri ke aplikasi presensi online&#60;br /&#62;Solusi: Pastikan Hari Libur Nasional / Daerah sudah dientri ke aplikasi presensi online (dilakukan oleh admin pusat)&#60;span&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(82, 'Fingerprint pegawai tidak bisa digunakan untuk absen / tidak terbaca dengan baik oleh mesin handkey', 'Penyebab: Ada masalah dengan sidik jari pegawai&#60;br /&#62;Solusi: Tambahkan password untuk pegawai tersebut di presensi online untuk security pegawai tersebut di mesin handkey', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(83, 'Tidak bisa absen', 'Penyebab: Mesin rusak, mati listrik dll&#60;br /&#62;Solusi: Lakukan entri manual jam datang / jam pulang melalui menu roster management', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(84, 'User atau pengguna tidak bisa masuk BackOffice', 'Penyebab: User belum dimasukkan ke sistem BackOffice&#60;br /&#62;Solusi: Melakukan import user tersebut ke BackOffice dan memberikan hak akses yang tepat untuk user tersebut (dilakukan oleh admin)', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(85, 'Modul tertentu tidak muncul ketika masuk ke BackOffice', 'Penyebab: User belum didaftarkan ke roles dan hak akses yang tepat&#60;br /&#62;Solusi: Memastikan telah memberikan roles dan hak akses yang tepat untuk user tersebut &#60;br /&#62;(dilakukan oleh admin)', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(86, 'Jumlah jam lembur ketika proses absen lembur tidak sesuai', 'Penyebab: User belum memeriksa usulan lembur yang terdaftar dan presensi pegawai&#60;br /&#62;Solusi: &#60;br /&#62;a. Pastikan jumlah usulan lembur yang terdaftar untuk pegawai bersangkutan telah sesuai&#60;br /&#62;b. Pastikan bahwa syarat lembur telah terpenuhi. Contohnya untuk lembur hari biasa jam datang ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(87, 'Pegawai tidak dapat dimasukkan di usulan lembur', 'Penyebab: Pegawai tersebut mempunyai status tidak aktif seperti pensiun dan unit kerja tersebut baru melakukan usulan lembur setelah lewat bulan lembur&#60;br /&#62;Solusi: Melakukan perubahan status pegawai secara sementara di tabel pegawai BackOffice menjadi status aktif (kdstpeg=02) (dilakukan oleh admin)', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(88, 'Tidak dapat mengirim usulan lembur ke Eselon II', 'Penyebab: Terdapat pegawai yang tidak mempunyai usulan lembur dan total nilai lemburnya adalah 0&#60;br /&#62;Solusi: Hapusan daftar pegawai yang mempunyai nilai lembur 0&#60;span&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(89, 'POK tidak muncul ketika mengisi daftar POK di form permintaan belanja', 'Penyebab: POK tidak dikategorikan ke tipe form permintaan belanja yang sesuai&#60;br /&#62;Solusi: Masukkan POK ke dalam tipe form yang sesuai&#60;span&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(90, 'Permintaan belanja yang baru ditambahkan tidak terdapat di daftar', 'Penyebab: Pencarian belum diubah dengan status usulan \"Create Eselon 3\"&#60;br /&#62;Solusi: Ubah pencarian status usulan menjadi \"Create Eselon 3\" karena secara default status usulan berisi pencarian \"Proses Hari Ini\"&#60;span&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(91, 'Nilai Pagu POK yang sudah direvisi belum sesuai', 'Penyebab: Revisi belum disetujui oleh admin anggaran&#60;br /&#62;Solusi: Pastikan revisi sudah disetujui oleh admin anggaran kalau belum disetujui maka menunggu revisi tersebut disetujui oleh admin anggaran&#60;span&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(92, 'Daftar POK milik unit kerja tidak sesuai', 'Penyebab: POK tidak didaftarkan ke unit kerja tersebut&#60;br /&#62;Solusi: Ubah kode organisasi yang bertanggung jawab terhadap POK tersebut&#60;span&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(93, 'Daftar pegawai yang muncul tidak sesuai', 'A&#60;br /&#62;Penyebab: Pegawai penilai belum / tidak mempunyai hak akses untuk menilai pegawai pada unit yang bersangkutan pada bulan yang dinilai&#60;br /&#62;Solusi: Memasikan bahwa pegawai ybs adalah pejabat struktural eselon 1/2/3 aktif di unit ybs pada bulan yang dinilai.&#60;br /&#62;&#60;br /&#62;B&#60;br /&#62;Penyebab: Data kepegawaian belum sesuai&#60;span&#62;&#60;br /&#62;Solusi: Melakukan penyesuaian data pegawai (dilakukan oleh admin).&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(94, 'Data rekap presensi tidak sesuai', 'Penyebab: Data presensi diperbarui di Kepegawaian dan belum melewati jadwal scheduler rekap presensi. &#60;br /&#62;Solusi: &#60;br /&#62;1. Memberikan informasi bahwa data rekap akan sesuai setelah jadwal scheduler rekap.&#60;br /&#62;2. Jika data rekap dibutuhkan segera (sebagai bahan pertimbangan pengisian prestasi), admin menjalankan scheduler rekap secara manual (dilakukan oleh admin)', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(95, 'Penggantian foto', 'Penyebab: Penggantian foto di simpeg, tidak merubah foto di community&#60;br /&#62;Solusi: Memberikan informasi bahwa foto di community akan berubah 1x 24 jam setelah pengajuan usulan foto di simpeg disetujui oleh supervisor', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(96, 'Data pegawai tidak sesuai', 'Penyebab: Data pegawai ybs tidak sesuai , tetapi tidak dapat melakukan perbaikan &#60;br /&#62;Solusi: memberikan informasi usulan dam pembaharuan data dapat dilakukan oleh pengguna sesuai hak akses yang tercantum pada menu Panduan, pada baris \"Hak Akses Pengguna\"', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(97, 'Data Istri dan Anak tidak sesuai', 'Penyebab: Data Istri &amp; Anak tidak sesuai tetapi tidak dapat melakukan pembaharuan data&#60;br /&#62;Solusi: memberikan informasi bahwa yang dapat melakukan usulan / pembaharuan data istri dan anak adalah petugas kab./kota, operator provinsi dan bagian administrasi kepegawaian.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(98, 'Gagal upload file', 'A&#60;br /&#62;Penyebab: Pengguna tidak mempunyai akses untuk upload file jenis tersebut &#60;br /&#62;Solusi: &#60;br /&#62;a. meminta informasi pesan error yang tampil pada halaman gagal upload.&#60;br /&#62;b. Memberikan informasi, hak akses upload file ada pada menu Panduan pada baris \"Hak Akses Pengguna\".&#60;br /&#62;c. Meminta bantuan petugas yang berhak meng-upload file jenis tersebut sesuai petunjuk pada panduan \"Hak Akses Pengguna\" untuk meng-upload di Simpeg&#60;br /&#62;&#60;br /&#62;B&#60;br /&#62;Penyebab: Tempat penyimpanan arsip, penuh&#60;br /&#62;Solusi: &#60;br /&#62;a. Memeriksa tempat penyimpanan arsip&#60;br /&#62;b. Memindahkan file ke tempat penyimpananan dengan space yang lebih banyak (dilakukan oleh admin)', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(99, 'Web tidak dapat diakses', 'Penyebab: Web tidak dapat diakses&#60;br /&#62;Solusi: &#60;br /&#62;a. Memeriksa koneksi jaringan web bps yang lain ,misal : community&#60;br /&#62;b. Memeriksa koneksi server hosting dan server database (dilakukan oleh admin)', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(100, 'Gagal create job diKTA untuk pengolahan sensus dengan KTA', 'Penyebab : Service KTA belum jalan&#60;br /&#62;Solusi : &#60;br /&#62;1. Tutup browser&#60;br /&#62;2. Restart semua service yang berhubungan dengan KTA local service, misal:&#60;br /&#62; a. Kofax Import Connector&#60;br /&#62; b. Kofax License Server&#60;br /&#62; c. Kofax TotalAgility Core Worker&#60;br /&#62; d. Kofax TotalAgility Export Worker, dll&#60;br /&#62;3. Buka kembali Daftar Penerimaan Dokumen&#60;br /&#62;4. Jika belum muncul setelah beberapa saat, cek pada Menu Cek Posisi Dokumen Menurut Batchname&#60;br /&#62;5. Silakan Delete Job/Batchname dengan status suspend.&#60;br /&#62;6. Silakan lakukan penerimaan dokumen kembali.&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(101, 'Pesan Error : Failed to executed rule: \"br_GetDoubleNSBS\" The executor returned: \"Straight through processing of a process failed. The executor said \"Error. Failed to execute business rule: â€¦. In the event you require technical assistance please reference', 'Penyebab : Karena memasukkan kembali BS yang sama, padahal job tersebut belum terbentuk (belum muncul di Daftar Dokumen)&#60;br /&#62;&#60;br /&#62;Solusi : &#60;br /&#62;1.Tutup browser&#60;br /&#62;2. Restart IIS &#60;br /&#62;3. Restart service KTA &#60;br /&#62;4. Buka kembali Penerimaan dokumen, dan lakukan penerimaan untuk dokumen yang berbeda.&#60;br /&#62;5. Untuk dokumen yang eror tadi, silakan Delete di Cek Posisi Dokumen (status suspend)&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(102, 'Pesan Error : Failed to executed rule: \"br_createResourceTromDB\" The executor returned: \"Straight through processing of a process failed. The executor said \"Error. Failed to execute business rule: â€¦. In the event you require technical assistance please re', 'Penyebab : Hal ini terjadi karena membuat resource (operator) dengan menggunakan login selain adminkab. &#60;br /&#62;&#60;br /&#62;Solusi : Login kembali sebagai adminkab&#60;span&#62;&#60;br /&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(103, 'Pesan Error:  Argument NotFound Debugging resource strings are unavailable. Often the key and arguments provide â€¦..', 'Solusi : Klik tombol OK', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(104, 'Aplikasi tertutup dengan cara tidak normal (aplikasi web)', 'Penyebab : Aplikasi tertutup lewat tombol close (baik tab page maupun browser) atau dengan cara lainnya&#60;br /&#62;&#60;br /&#62;Solusi : Aplikasi harus dibuka kembali di komputer yang sama &#60;br /&#62;Data yang sudah dientri masih tersimpan di local computer, tetapi belum tersimpan di server pusat. Untuk membuka kembali, harus pada computer yang sama. Hal ini dimaksudkan untuk menjaga konsistensi data yang tersimpan di server.&#60;br /&#62;Untuk meload kembali tampilan tetap membutuhkan koneksi internet.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(105, 'Gagal simpan (upload) data ke server pusat (aplikasi web)', 'Penyebab : Koneksi Terputus&#60;br /&#62;Solusi :&#60;br /&#62;1. jika koneksi terputus data yang sudah dientri dapat tersimpan di lokal komputer.&#60;br /&#62;Pesan yang muncul adalah: &#60;br /&#62;â€œData disimpan di lokal (gagal ke server) dengan kondisi error/clean â€&#60;br /&#62;2. Untuk menghindari ketidakkonsistenan data yang tersimpan, jangan membuka dokumen untuk identitas yang sama di komputer yang berbeda.&#60;br /&#62;&#60;br /&#62;Contoh: operator 1 sedang melakukan entri data dokumen A di komputer 1. Entrian belum selesai, tetapi dia harus meninggalkan sebentar pekerjaan entri data tsb. Operator 1 telah menyimpan isian (klik tombol simpan) dan pergi meninggalkan komputer 1. Maka saat operator 1 akan melanjutkan pekerjaannya mengentri dokumen A kembali, dia harus membuka dokumen A tsb di komputer yang sama (komputer 1). &#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(106, 'Gagal Import DSRT di aplikasi client (SUSENAS)', '1. Penyebab : Login komputer tidak sebagai administrator&#60;br /&#62; Solusi : Jalankan aplikasi client dengan \"Run as administrator\"&#60;br /&#62;&#60;br /&#62;2. Penyebab : Belum ada komponen VFPOLEDB&#60;br /&#62; Solusi :&#60;br /&#62; 1. install VFPOLEDBSetup.msi yang sudah ada di folder AplikasiExt &#60;br /&#62; 2. Apabila user menggunakan Windows 8 dan tidak bisa menjalankan VFPOLEDBSetup.msi dengan run as administrator, berikut langkah-langkah yang bisa dilakukan:&#60;br /&#62; a. Melalui program files, ketikkan cmd&#60;br /&#62; b. Klik kanan, pilih Run as Administrator&#60;br /&#62; c. Dilanjutkan, ketikkan command di bawah ini Msiexec /a â€œ lokasi installer VFPOLEDBSetup.msiâ€&#60;br /&#62; Misal, pada PC, lokasi VFPOLEDBSetupSetup.msi berada di D:__KERJAAN2016SUSENAS2016Semester 1Bahan AjarPelatihan Pengolahan SSN2016AplikasiExt&#60;br /&#62; Maka cara pengetikan di command prompt adalah seperti berikut ini:&#60;br /&#62;msiexec /a \"D:__KERJAAN2016SUSENAS2016Semester 1Bahan AjarPelatihan Pengolahan SSN2016AplikasiExtVFPOLEDBSetup.msi\"&#60;br /&#62; d. Klik Enter, untuk menjalankan VFPOLEDBSetup.msi. Jika command prompt diketikkan dengan benar, maka installer akan berjalan&#60;br /&#62; e. Pada tahapan pengisian \"Network Location\" pada kolom Folder isikan \"C:Program FIles (x86)Microsoft Visual FoxPro ole DB Provider\"&#60;br /&#62; f. Buka lokasi yang di-copy tadi, contoh diatas lokasinya adalah C:Program Files (x86)Microsoft Visual FoxPro OLE DB Provider&#60;br /&#62; g. Buka folder Program Files &gt; Common Files &gt; System &gt;ole db. Pada folder ole db akan ada file bernama vfpoledb.dll&#60;br /&#62; h. Copy lokasi vfpoledb.dll berikut ini:&#60;br /&#62; C:Program Files (x86)Microsoft Visual FoxPro OLE DB ProviderProgram FilesCommon FilesSystemole db&#60;br /&#62; i. Buka kembali folder AplikasiExt. Ada file-file berikut ini reg_32_vfp.bat dan reg_64_vfp.bat&#60;br /&#62; j. Sesuaikan bit OS Laptop/PC yang akan diinstall. Jika OS laptop 64 bit, maka pilih reg_64_vfp.bat.&#60;br /&#62; k. Klik kanan reg_64_vfp.bat, kemudian pilih Edit with Notepad &#60;br /&#62; l. Setelah dibuka melalui notepad, maka muncul :&#60;br /&#62; regscr32 \"C:Program Files (x86)Common FilesSystemOle DBvfpoledb.dll\" yang ada di notepad, dengan lokasi vfpoledb.dll sesuai dengan laptop masing-masing. Contohnya, jika lokasinya sama seperti panduan sebelumnya, maka cara penulisannya adalah berikut ini&#60;br /&#62;regsvr32 \"C:Program Files (x86)Microsoft Visual FoxPro OLE DB ProviderProgram FilesCommon FilesSystemole dbvfpoledb.dll\"&#60;br /&#62;Setelah selesai edit lokasi, Save notepad tersebut, kemudian Close notepad.&#60;br /&#62; m. Pilih kembali reg_64_vfp.bat dengan klik kanan dan Run as Administrator&#60;br /&#62; n. Setelah dijalankan dengan run as administrator, muncul konfirmasi register dll sukses&#60;br /&#62;&#60;br /&#62;3. Penyebab : DSRT sudah pernah diimport sebelumnya&#60;br /&#62;Solusi : Jangan import file untuk DSRT yang sama&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(107, 'Pesan Error : sudah instalasi VFPOLEDBSetup.msi di laptop 32 bit tetapi masih belum terdeteksi, dan muncul error \"VFPOLEDB1.0 is not registered on the local Machine\" (SUSENAS)', 'penyebab : Login komputer tidak sebagai administrator&#60;br /&#62;Solusi : Klik kanan reg_32_vfp.bat atau reg_64_vfp.bat pilih Run As Administrator&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(108, 'Range harga sudah sesuai tapi aplikasi mendeteksi harga di luar range', 'Penyebab : Pengaturan regional setting pada komputer salah&#60;br /&#62;Solusi :&#60;br /&#62;1. Buka Halaman Pengaturan Regional, Time , and Language (dapat melalui Control Panel)&#60;br /&#62;2. Ubah pengaturan Regional ke dalam \"English (United States)&#60;br /&#62;3. Settings Keyboard hanya gunakan English(US), jika ada keyboard Indonesia mohon dihapus terlebih dahulu. Pengaturan ini dilakukan melalui \"Text Services and Input languages\"&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(109, 'sudah instalasi VFPOLEDBSetup.msi di laptop 32 bit tetapi masih belum terdeteksi, dan muncul error \"VFPOLEDB1.0 is not registered on the local Machine\"', 'Penyebab : Login komputer tidak sebagai administrator&#60;br /&#62;Solusi : Klik kanan reg_32_vfp.bat atau reg_64_vfp.bat pilih Run As Administrator', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(110, 'Pesan error : \" Could not load file or assembly System.Web, Version = 4.000, Culture=neutral, PublicKeyToken = â€¦.. \"  (SUSENAS)', 'Penyebab : Belum ada komponen .NetFramework 4.0&#60;br /&#62;Solusi : Maka install .NetFramework4.0, installer tersebut sudah disertakan di folder AplikasiExt dengan nama dotNetFx40_Full_x86_x64.exe', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(111, 'Error saat Entri atau aplikasi stopped working (SUSENAS)', 'Penyebab : Belum melakukan import data persiapan di aplikasi server&#60;br /&#62;Solusi : &#60;br /&#62;&#60;br /&#62;1. import data persiapan terlebih dahulu di aplikasi server&#60;br /&#62;2. import DSRT di aplikasi client&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(112, 'SUSENAS: Ketika akan membuka menu Laporan di aplikasi Client ( Progress, Pengecekan, Kabupaten, Propinsi), tiba-tiba aplikasi menjadi not responding atau aplikasi stopped working', 'Penyebab : Belum ada komponen Report Viewer &#60;br /&#62;Solusi :&#60;br /&#62;1.lnstall Report Viewer 2010 terlebih dahulu&#60;br /&#62;2. Install report viewer 2012 &#60;br /&#62;3. Install SQLSysClrTypes32&#60;br /&#62;&#60;br /&#62;Installer tersebut juga berada di folder Add Tools. Install terlebih dahulu ReportViewer2010.exe lanjut SQLSysClrTypes32.msi, dilanjutkan ReportViewer2012.msi. &#60;br /&#62;4. Coba kembali membuka menu Laporan&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(113, 'Gagal Create File KRM (file kirim)', 'penyebab : data sudah lengkap di-entri dan sesuai dengan aturan range dan konsistensi isian maka file KRM akan terbentuk&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;br /&#62; ', 0, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(114, 'Error impor data persiapan', 'A. Penyebab : Belum melakukan create database :&#60;br /&#62; Solusi : &#60;br /&#62; 1. Buka aplikasi server&#60;br /&#62; 2. Lakukan \"Create database\" pada menu yang telah disediakan&#60;br /&#62;&#60;br /&#62;b. Penyebab : Database yang dipake telah kadaluwarsa (belum menggunakan versi terbaru)&#60;br /&#62; Solusi :&#60;br /&#62; 1. Lihat versi yang tertera pada aplikasi, pastikan versi aplikasi dan database yang sedang berjalan adalah versi terbaru&#60;br /&#62; 2. Jika versi yang berjalan belum yang terbaru, perbarui aplikasi/database dengan patch terbaru&#60;br /&#62; 3. Lakukan kembali impor master persiapan&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(115, 'Salah penerimaan doumen di KTA pada Pengolahan data sensus dengan KTA', 'A. Penyebab : Salah identitas (kode wilayah)&#60;br /&#62; Solusi : &#60;br /&#62; 1. Jika masih pada Proses Pengecekan, ubah No Box Kecil untuk BS yang bersangkutan, agar terpisah dari Box sebelumnya.&#60;br /&#62; 2. Jika ingin job tetap ada di Pengecekan Dokumen, jangan isikan RBL atau Peta pada isian tersebut, dan klik Complete.&#60;br /&#62;&#60;br /&#62;B. Penyebab :salah input jumlah dok L1 atau L2&#60;br /&#62; Solusi :&#60;br /&#62;1. Diperbaiki pada bagian Pengecekan/pemeriksaan kelengkapan dokumen SE2016&#60;br /&#62;2. Diperbaiki pada penerimaan dokumen hasil edit dari petugas editor&#60;br /&#62;&#60;br /&#62;C. Penyebab : Jika terjadi kesalahan alokasi box besar &#60;br /&#62; Solusi : pindah box besar&#60;span&#62;&#60;br /&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(116, 'Pengolahan Sensus dengan KTA: Error pada saat create user adminkab (KTA)', 'Penyebab : Hal ini terjadi karena melakukan create database tetapi belum melakukan Delete Job (Job Clear Down) dan Delete Resource&#60;br /&#62;&#60;br /&#62;Solusi :&#60;br /&#62;1. Lakukan Delete Resource secara manual: Masuk Kofax TotalAgility dan Pilih Resource&#60;br /&#62;2. Pilih Group Resource yang akan di Delete&#60;br /&#62;3. Pilih Resource yang akan di Delete&#60;br /&#62;4. Create user selain adminkab, harus dilakukan dengan login adminkab&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(117, 'Pengolahan Sensus dengan KTA: Pesan Error:  Database error occurred. Contact your administrator. In the event you require technical assistance please reference action. DBQueryInsertUpdateSipmen.', 'Penyebab : Terdapat beberapa browser penerimaan yang login dengan username yang sama&#60;br /&#62;Solusi : &#60;br /&#62;1. Tutup semua browser yang akses sipmen&#60;br /&#62;2. Restart semua service KTA di local service&#60;br /&#62;3. Restart IIS Manager (Control panel -&gt;Administrative Tools -&gt; Internet Information Service (IIS) Manager&#60;br /&#62;4. Jika perlu Restart WS-nya. Tunggu WS beberapa saat (jangan langsung digunakan)&#60;br /&#62;5. Silakan lakukan kembali Penerimaan Dokumen dengan BS yang baru.&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(118, 'Tidak dapat login ke filelib', 'Penyebab:&#60;br /&#62;Filelib sudah end of support dan sudah diganti dengan laci bps&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. File lama di filelib masih dapat diunduh dengan mengetikkan &#60;a href=\"http://filelib.bps.go.id/(akun\"&#62;http://filelib.bps.go.id/(akun&#60;/a&#62; user). Akan tetapi pengguna tidak dapat lagi mengunggah file ke filelib. Penggantinya adalah laci bps&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(119, 'Bandwidth limit exceeded', 'Penyebab:&#60;br /&#62;bandwidth yang telah disediakan telah habis digunakan&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Eskalasi ke technical support JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(120, 'Koneksi ke handkey online terganggu', 'Penyebab:&#60;br /&#62;Network Error (tcp_error)&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Cek konfigurasi ip, subnet sudah benar&#60;br /&#62;2. Cek koneksi ke firewall apakah sudah benar&#60;br /&#62;3. Pastikan kabel jaringan yang terhubung ke switch ujungnya menyala (tanda terhubung) &#60;br /&#62;4. Instal aplikasi team viewer dan Eskalasi ke technical support agar dapat di-remote.&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(121, 'Reported Attack Page', 'Penyebab:&#60;br /&#62;Script yang membahayakan yang dimiliki oleh beberapa file web. Review dapat dilihat dengan click tombol \"Why was this page blocked?\"&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Pastikan PC yang akan digunakan bersih dari virus atau malware&#60;br /&#62;2. Selanjutnya Admin Website mendownload semua file websitenya (di folder public_html/) ke local komputer.&#60;br /&#62;Kemudian coba scan menggunakan antivirus atau anti malware.&#60;br /&#62;3. Untuk script-script yang terindikasi malware, harap di cek apakah script tersebut adalah coding-an sendiri&#60;br /&#62;4. jika iya, perbaiki code, jika tidak (kemungkinan besar), maka script tersebut sebaiknya dihapus&#60;br /&#62;5. Hindari penggunaan untuk akses page diluar domain tersebut.&#60;br /&#62;Contoh script malware:&#60;/iframe&#62;&#60;br /&#62;Coba scan sekali lagi seluruh file websitenya dengan antivirus/malware&#60;br /&#62;6. Jika sudah bersih dari virus, hapus seluruh file yang ada di hosting [di folder public_html/]&#60;br /&#62;Ubah password CPanel (admin dapat merubah sendiri)&#60;br /&#62;7. Upload semua file yang di local komputer ke hosting BPS [di folder public_html/]&#60;br /&#62;8. Selanjutnya minta google untuk mereview kembali website tersebut &#60;a href=\"https://support.google.com/webmasters/answer/168328\"&#62;https://support.google.com/webmasters/answer/168328&#60;/a&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(122, 'Error pada mesin fingerprint (misalnya : sering berbunyi padahal tidak ada yang melakukan presensi)', 'Penyebab:&#60;br /&#62;Kerusakan pada fisik mesin fingerprint karena terkena lonjakan listrik, dsb&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Restart mesin handkey&#60;br /&#62;2. Eskalasi ke technical support JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(123, 'Error displaying the error page: Application Instatiation Error', 'Penyebab:&#60;br /&#62;Error displaying the error page: Application Instatiation Error&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Konfigurasi database disesuaikan&#60;br /&#62;public $dbtype = &#39;mysql&#39;;&#60;br /&#62;public $host = &#39;localhost&#39;;&#60;br /&#62;public $user = [user db];&#60;br /&#62;public $password = [password user db];&#60;br /&#62;public $db = [nama db]&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(124, 'Error log yang berhubungan dengan fungsi eval', 'Penyebab:&#60;br /&#62;Web terdeteksi menggunakan fungsi php eval yang beresiko terhadap keamanan web (dimanfaatkan peretas). Fungsi tersebut tidak dapat digunakan lagi&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Website yang memanfaatkan fungsi tersebut harus melakukan penyesuaian dengan memanfaatkan fungsi lain pengganti fungsi eval() agar website dapat tampil kembali.&#60;br /&#62;2. Ikuti panduan yang tersedia di noc.bps.go.id/blog/solusi-error-use-of-eval-is-forbidden-by-configuration&#60;br /&#62;3. Eskalasi ke technical support JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(125, 'This account has been suspended', 'Penyebab:&#60;br /&#62;Website tersebut terkena deface/hack dari pihak luar&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Menyiapkan file website yang baru , karena pada file web yang lama sudah banyak backdoor yang ditanam peretas.&#60;br /&#62;2. Pastikan juga update versi CMS yang anda pakai jika menggunakan CMS seperti joomla, wordpress, drupal , dll.&#60;br /&#62;3. Jika sudah siap upload file baru, silahkan menghubungi Subdit JKD, email jkd@bps.go.id untuk membuka kembali akses web.&#60;br /&#62;4. Upload file melalui salah satu cara berikut :&#60;br /&#62;manajemen cpanel pada url &#60;a href=\"https://namasudbdomain.bps.go.id:2083\"&#62;https://namasudbdomain.bps.go.id:2083&#60;/a&#62;&#60;br /&#62;melalui ftp client (disarankan menggunakan winscp) menggunakan&#60;br /&#62;host : namasubdomain.bps.go.id.&#60;br /&#62;username : bpsxxyy&#60;br /&#62;password : sesuai password untuk login cpanel.&#60;br /&#62;5. Apabila lupa password dapat menghubungi Sub dit. JKD untuk reset password.&#60;br /&#62;6. Seluruh file-file web diletakkan langsung di bawah direktori www atau public_html.&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(126, 'Tidak bisa sign in lync/skype for business', 'Penyebab 1:&#60;br /&#62;Belum instal sertifikat&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Masuk ke noc.bps.go.id/blog&#60;br /&#62;2. Ketikkan Skype for Business pada tombol pencarian&#60;br /&#62;3. Ikut panduan instalasi lync/skype for business dan instalasi sertifikat&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Akun user belum diaktivasi&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Eskalasi ke technical support JKD untuk aktivasi akun lync&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(127, 'Tidak dapat akses spool', 'Penyebab:&#60;br /&#62;Setting berubah untuk mengantisipasi wannacry&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Aktifkan SMB karena kemungkinan fitur SMB telah nonaktif&#60;br /&#62;2. Eskalasi ke technical support JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(128, 'Tidak dapat upload file ke laci', 'Penyebab:&#60;br /&#62;Tidak dapat upload file ke laci&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Pastikan kecepatan download dan upload anda stabil (untuk speed test ke server bps &#60;a href=\"http://filelib.bps.go.id/speed\"&#62;http://filelib.bps.go.id/speed&#60;/a&#62; )&#60;br /&#62;untuk laci, &#60;br /&#62;2. Bila memang kesulitan upload menggunakan web, silahkan menggunakan aplikasi owncloud desktop, dengan aplikasi desktop tersebut, memungkinkan untuk resume upload. Silahkan klik username dan pilih personal, setelah masuk personal pilih desktop app, akan muncul window baru, pilih desktop client, nah download berdasar sistem operasi yang dipakai di komputer anda&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(129, 'Tidak dapat membuka laci', 'Penyebab:&#60;br /&#62;Muncul error \"This connection is untrusted\"&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Clear recent history pada browser Anda&#60;br /&#62;2. Eskalasi ke technical support JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(130, 'Gagal enroll pegawai baru', 'Penyebab:&#60;br /&#62;gagal sinkronisasi&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Forward ke sim@bps.go.id atau eskalasi ke technical support PTI mengenai SIM&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(131, 'Gagal login ke s.bps.go.id dengan akun user tertentu', 'Penyebab:&#60;br /&#62;Login dengan akun unit kerja&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;Login ke s.bps.go.id hanya dapat dilakukan dengan menggunakan akun perorangan, bukan akun unit kerja&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(132, 'Gagal login ke sharepoint', 'Penyebab:&#60;br /&#62;belum diketahui penyebabnya&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Eskalasi ke technical support JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(133, 'Gagal menambahkan add-on sharepoint', 'Penyebab:&#60;br /&#62;Farm sharepoint masih terus dikembangkan&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Eskalasi ke technical support JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(134, 'Pegawai tidak ada di community / unit kerja pegawai tidak update', 'Penyebab:&#60;br /&#62;Data pegawai belum diupdate Kepegawaian&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Pastikan bahwa pegawai tersebut dapat login ke email BPS&#60;br /&#62;2. Eskalasi permasalahan ke Kepegawaian&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(135, 'Tidak bisa login ke community', 'Penyebab:&#60;br /&#62;Pegawai belum didaftarkan alamat emailnya di community atau data pegawai pada Active Directory kurang lengkap&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Pastikan bahwa pegawai tersebut dapat login ke email BPS&#60;br /&#62;2. Pastikan bahwa pegawai tersebut sudah terdaftar di community dan periksa apakah alamat email pegawai tersebut tampil di community&#60;br /&#62;3. Jika pegawai dapat login ke email BPS, tetapi alamat email pegawai tidak tampil di community, eskalasi permintaan ke JKD untuk didaftarkan ke community&#60;br /&#62;4. Jika pegawai dapat login ke email BPS dan alamat email pegawai tampil di community, eskalasi permintaan ke JKD untuk pengecekan di Active Directory &#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(136, 'Tidak dapat mengakses server hosting tertentu (misalnya http://spkonline.bps.go.id)', 'Penyebab:&#60;br /&#62;HTTP Status 404&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Eskalasi ke technical support JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(137, 'Minta tambahan kuota untuk server hosting', 'Penyebab:&#60;br /&#62;Bandwidth limit exceeded&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Eskalasi ke technical support JKD&#60;br /&#62;NB:&#60;br /&#62;a. Secara default kuota bandwidth setiap website kabupaten adalah 3GB dan direset setiap awal bulan. &#60;br /&#62;b. Statistik penggunaan bandwidth secara lebih detail dapat dilihat melalui menu \"Awstat\" di CPanel. &#60;br /&#62;c. Mengenai loading time, ada beberapa faktor yang perlu diperhatikan, antara lain koneksi internet, besarnya file website yang diakses, aktivitas yang sedang dilakukan dari dan ke server hosting. Jadi besarnya file publikasi memang berpengaruh terhadap loading time. Jika memungkinkan kompres file sekecil2nya.&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(138, 'Gagal koneksi', 'Penyebab 1:&#60;br /&#62;Failed to establish a connection to &#39;localhost&#39; di PST&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Pengguna harap memastikan apakah service postgre masih berjalan atau tidak dengan menggunakan windows service. Jika dalam kondisi tidak aktif, silakan untuk coba start service postgre tersebut.&#60;br /&#62;2. Apabila service postgre gagal direstart, coba hapus file berikut C:\\Program FilesPostgre8.4Datapostmaster.pid lalu jalankan kembali service postgrenya&#60;br /&#62;3. Jika tetap gagal, silakan hubungi tim developer PST di email perpustakaan@bps.go.id untuk tindakan lebih lanjut&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(139, 'Tidak bisa login email.', 'Penyebab 1:&#60;br /&#62;User belum memiliki akun email.&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Cek nama akun (username) email Anda pada Community (community.bps.go.id).&#60;br /&#62;2. Apabila rincian &#39;Email&#39; pada profile akun Community Anda masih kosong, maka Anda belum memiliki akun email.&#60;br /&#62;3. Silakan mengajukan permohonan pembuatan akun email melalui tiket dengan dilampirkan memo yang ditandatangani oleh minimal pejabat Eselon III.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Kesalahan penulisan username atau password email.&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Perhatikan apakah fungsi capslock menyala/hidup (penulisan email mengggunakan â€˜case sensitiveâ€™ sehingga penulisan huruf besar dan kecil harus dibedakan).&#60;br /&#62;2. Username akun email ditulis menggunakan huruf kecil.&#60;br /&#62;3. Kesalahan penulisan username atau password pada saat login email hanya ditolerir sebanyak 5 kali, lebih dari itu Anda harus&#60;br /&#62;menunggu selama 30 menit sebelum mencoba login kembali.&#60;br /&#62;4. Apabila sudah dipastikan username dan password yang dimasukkan benar dan tetap tidak bisa login, Anda dapat mengajukan permohonan untuk mengganti password melalui tiket.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 3:&#60;br /&#62;Email terkunci (lockout).&#60;br /&#62;Solusi 3:&#60;br /&#62;1. Salah memasukkan username atau password email sebanyak 5 kali berturut-turut akan menyebabkan email terkunci (lockout). Silakan menunggu selama 30 menit sebelum mencoba untuk login kembali.&#60;br /&#62;2. Apabila Anda menggunakan aplikasi Email pada Smartphone, silakan dicek apakah username dan password yang digunakan pada Aplikasi sudah sesuai dengan kondisi terbaru. Hal ini dikarenakan smartphone akan mereload terus-menerus menggunakan username atau password lama yang terdaftar, yang menyebabkan akun akan terkunci apabila username dan password yang diload tidak sesuai dengan kondisi sekarang.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 4:&#60;br /&#62;Email ditutup sementara (closed) karena akun email terindikasi melakukan spam.&#60;br /&#62;Solusi 4:&#60;br /&#62;1. Pengguna diwajibkan menginstal antivirus pada PC yang digunakan jika belum ada antivirus yang terinstal&#60;br /&#62;2. Pengguna diwajibkan mengupdate antivirus pada PC yang digunakan jika sudah ada antivirus yang terinstal tetapi belum diupdate&#60;br /&#62;3. Pengguna melakukan scan pada PC yang digunakan sehingga bersih dari virus dan malware lainnya&#60;br /&#62;4. Pengguna mengajukan permohonan ke Admin melalui tiket untuk mengajukan permohonan pergantian password untuk mengaktifkan kembali email dengan password baru&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(140, 'Pengajuan reset (pergantian) password email BPS.', 'Penyebab 1:&#60;br /&#62;User lupa password email BPS dan mengajukan pergantian password.&#60;br /&#62;Penyebab 2:&#60;br /&#62;Password email bocor (diketahui banyak orang) sehingga user ingin mengajukan pergantian password email.&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Silakan mengajukan permintaan reset password melalui tiket dengan disertai alamat email alternatif lain untuk dikirimkan password yang baru.&#60;br /&#62;2. Admin JKD akan melakukan reset password pada akun email yang bersangkutan (dengan password sementara) dan user dapat melakukan pergantian password sendiri pada saat pertama kali login.&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(141, 'Pengajuan pergantian nama (username) email.', 'Penyebab 1:&#60;br /&#62;User mengajukan pergantian alamat (username) email&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;User dapat mengajukan pergantian alamat (username) email melalui tiket dengan ketentuan penamaan email sebagai berikut:&#60;br /&#62;1. Nama tunggal&#60;br /&#62; nama@bps.go.id&#60;br /&#62; Contoh: Miswar akan memiliki alamat email miswar@bps.go.id&#60;br /&#62;2. Nama dengan dua suku kata&#60;br /&#62; sukukatapertama.sukukatakedua@bps.go.id&#60;br /&#62; Contoh: Siska Ambarwati akan memiliki alamat email siska.ambarwati@bps.go.id&#60;br /&#62;3. Nama duplikat&#60;br /&#62; sukukatapertama.sukukatakedua(n)@bps.go.id. dimana n menyatakan nomor yang belum digunakan.&#60;br /&#62; Contoh: Siska Ambarwati yang kedua akan memiliki alamat email siska.ambarwati2@bps.go.id&#60;br /&#62;4. Nama dengan spasi&#60;br /&#62; Spasi akan dihilangkan dan nama akan digabungkan. Ini akan dilakukan baik pada nama depan maupun nama belakang.&#60;br /&#62; Contoh: Hery Al Amin akan memiliki alamat email hery.alamin@bps.go.id&#60;br /&#62;5. Nama dengan apostrof (tanda petik) atau tanda baca yang lain&#60;br /&#62; Apostrof atau tanda baca yang lain akan dihilangkan&#60;br /&#62; Contoh: Saâ€™diyah akan memiliki alamat email sadiyah@bps.go.id&#60;br /&#62;6. Nama dengan lebih dari dua suku kata&#60;br /&#62; Sukukatapertama.sukukatakedua@bps.go.id atau sukukatapertama.sukukataterakhir@bps.go.id&#60;br /&#62; Contoh: Ahmad Hartiono Utomo akan memiliki email ahmad.hartiono@bps.go.id atau ahmad.utomo@bps.go.id bila&#60;br /&#62; email pertama sudah terpakai&#60;br /&#62;7. Nama dengan gelar&#60;br /&#62; Gelar dihilangkan dan hanya digunakan nama resminya&#60;br /&#62; Contoh: Dr. Indria Sasmita akan memiliki email indria.sasmita@bps.go.id&#60;br /&#62; RA. Asih Sulistiowati akan memiliki email asih.sulistiowati@bps.go.id&#60;br /&#62;9. Nama Panggilan&#60;br /&#62; Nama panggilan tidak lagi diperkenankan sebagai alamat email&#60;br /&#62; Contoh: Handi Priyadi lebih dikenal dengan nama panggilan Jebot. Maka, email yang diberikan tetap handi.priyadi@bps.go.id&#60;br /&#62;Permintaan penggantian alamat email dapat dilakukan untuk hal-hal berikut :&#60;br /&#62;1. Admin salah membuatkan nama email&#60;br /&#62;2. Penamaan email mencirikan kesalahan gender (Pemilik email laki-laki tapi diberikan nama akun perempuan atau sebaliknya)&#60;br /&#62;3. Nama akun terdengar â€˜porno/tidak pantasâ€™ pada bahasa tertentu&#60;br /&#62;4. Jika dilakukan penggantian username email, maka pengguna disarankan membackup file di layanan laci-nya dikarenakan akun laci yang lama tidak akan bisa diakses lagi setelah username diganti&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(142, 'Kuota email telah penuh.', 'Penyebab 1:&#60;br /&#62;Email yang masuk ke alamat email pengguna telah mencapai batas kuota yang ditetapkan (1.25 GB).&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Hapus email-email yang menurut Anda sudah tidak penting.&#60;br /&#62;2. Email-email yang telah dihapus akan masuk ke folder &#39;Trash&#39; dan masih memakan kuota dari email. Kosongkan folder &#39;Trash&#39; agar tidak memenuhi kuota email Anda, dengan cara klik kanan lalu pilih &#39;Empty Trash&#39;.&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;Anda dapat menyimpan di komputer lokal untuk email-email penting melalui Zimbra Desktop. Panduan menggunakan Zimbra Desktop dapat diunduh pada link berikut: &#60;a href=\"https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf\"&#62;https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf&#60;/a&#62;&#60;br /&#62;&#60;br /&#62;User dapat mengajukan penambahan kuota email baik untuk email pribadi maupun unit kerja, dengan ketentuan: &#60;br /&#62;a. Email pribadi : Kuota yang diberikan untuk email pribadi adalah 1.25 GB. Penambahan kuota sementara hanya diberikan untuk hal-hal yang bersifat urgensi, seperti misalnya kebutuhan untuk mengirim/menerima email dalam jumlah besar.&#60;br /&#62;b. Email unit kerja : Kuota yang diberikan untuk email unit kerja adalah 1.25 GB. Penambahan kuota dapat diberikan secara bertahap tergantung kebutuhan unit kerja hingga maksimal 4 GB.&#60;br /&#62;Permintaan penambahan kuota email harus disertai memo minimal pejabat eselon III.&#60;br /&#62; ', 0, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(143, 'Email yang dikirimkan ke domain @bps.go.id tidak sampai.', 'Penyebab 1:&#60;br /&#62;Kuota email dari si pengirim email telah penuh.&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Cek kuota dari si pengirim email, dengan cara mengarahkan kursor ke &#39;nama Anda&#39; disebelah pojok kanan atas tampilan email. &#60;br /&#62;2. Lakukan penghapusan pada email-email yang sudah tidak digunakan lagi.&#60;br /&#62;3. Sebelum di hapus, Anda dapat melakukan back-up untuk email-email yang dirasa penting melalui Zimbra Desktop. Panduan dapat diunduh pada link berikut:&#60;br /&#62;&#60;a href=\"https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf\"&#62;https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf&#60;/a&#62;&#60;br /&#62;3. Email-email yang telah dihapus akan masuk ke folder &#39;Trash&#39; dan masih memakan kuota dari email. Kosongkan folder &#39;Trash&#39; agar tidak memenuhi kuota email Anda, dengan cara klik kanan lalu pilih &#39;Empty Trash&#39;.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Kuota email dari si penerima email telah penuh.&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Setelah menghapus beberapa email atau mengosongkan kuota email pada si penerima, silakan menunggu beberapa saat agar email-email yang tertunda mulai masuk ke Inbox si penerima email.&#60;br /&#62;2. Email yang dapat masuk ke inbox penerima email hanyalah email-email yang dikirim kurang dari 3 hari yang lalu sejak si penerima mengosongkan kuota emailnya.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 3:&#60;br /&#62;Akun email si penerima sementara di close oleh admin JKD karena terkena spam atau virus.&#60;br /&#62;Solusi 3:&#60;br /&#62;1. Akun email yang diclose oleh admin JKD tidak dapat menerima email untuk sementara waktu.&#60;br /&#62;2. Apabila dalam 3 hari sejak email dikirimkan akun penerima masih dalam status close, maka email yang dikirimkan tidak akan masuk ke kedalam inbox (kotak masuk) email si penerima.&#60;br /&#62;3. Silakan menunggu sampai akun penerima diaktifkan kembali oleh admin JKD.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 4:&#60;br /&#62;Terdapat filter pada email si penerima yang membuat email-email yang mengandung kata tertentu di tolak atau langsung di hapus oleh email si penerima&#60;br /&#62;Solusi 4:&#60;br /&#62;1. Cek kembali filter pada si penerima email (pada menu Preferences &gt; Filters)&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 5:&#60;br /&#62;Email masuk ke folder Junk karena dianggap spam.&#60;br /&#62;Solusi 5:&#60;br /&#62;1. Cek folder Junk pada email penerima.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 6:&#60;br /&#62;Kesalahan setting/konfigurasi Zimbra Destop pada email si penerima, yang mengakibatkan email baru akan langsung dihapus setelah didownload oleh Zimbra Desktop.&#60;br /&#62;Solusi 6:&#60;br /&#62;1. Cek kembali konfigurasi Zimbra Desktop pada email si penerima.&#60;br /&#62;2. Silakan ikuti panduan Back Up Email Melalui Zimbra Desktop pada link berikut untuk memastikan konfigurasi yang digunakan sudah sesuai:&#60;br /&#62;&#60;a href=\"https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf\"&#62;https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf&#60;/a&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(144, 'Terdapat email dari Administrator yang memberikan peringatan perihal kuota email yang sudah penuh dan meminta username dan password untuk proses maintenance.', 'Penyebab 1:&#60;br /&#62;Email penipuan (phising) yang ditujukan untuk mengambil alih akun email dari si korban.&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Agar berhati-hati terhadap email yang mengatas namakan Admin/Administrator dan meminta info mengenai username dan password, karena hal tersebut kemungkinan besar adalah â€˜phisingâ€™ yang dilakukan oleh virus.&#60;br /&#62;2. Subdit Jaringan Komunikasi Data (JKD) tidak pernah mengirimkan email yang meminta username dan password dari akun email pegawai BPS.&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(145, 'Pada folder SENT terdapat pengiriman email ke banyak alamat email, tapi bukan saya yang mengirimkan.', 'Penyebab 1:&#60;br /&#62;Email terinfeksi virus.&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Pengguna diwajibkan menginstal antivirus pada PC yang digunakan jika belum ada antivirus yang terinstal&#60;br /&#62;2. Pengguna diwajibkan mengupdate antivirus pada PC yang digunakan jika sudah ada antivirus yang terinstal tetapi belum diupdate&#60;br /&#62;3. Pengguna melakukan scan pada PC yang digunakan sehingga bersih dari virus dan malware lainnya&#60;br /&#62;4. Pengguna mengajukan permohonan ke Admin melalui tiket untuk mengajukan permohonan pergantian password untuk mengaktifkan kembali email dengan password baru&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(146, 'Akun email pegawai BPS yang telah meninggal/pensiun tidak dapat dibuka.', 'Penyebab 1:&#60;br /&#62;Akun email pegawai BPS yang telah pensiun akan dinonaktifkan oleh admin JKD dalam waktu 3 bulan sejak tanggal pension.&#60;br /&#62;Solusi 1:&#60;br /&#62;1. User yang telah memasuki masa pensiun/purnabakti akan diberikan waktu selama 3 bulan sejak tanggal pensiun untuk memindahkan/membackup email-email yang dianggap penting. Setelah itu, akun akan di non-aktifkan.&#60;br /&#62;2. Apabila user ingin melihat kembali email setelah di nonaktifkan, silakan menghubungi Subdit JKD melalui tiket.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Akun email pegawai BPS yang telah meninggal akan langsung dinonaktifkan oleh admin JKD.&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Pegawai lain yang ingin melihat kembali akun email pegawai yang telah dinonaktifkan, silakan menghubungi Subdit JKD melalui tiket dengan dilampirkan memo minimal pejabat Eselon III.&#60;br /&#62; ', 0, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(147, 'Tidak dapat terkoneksi jaringan LAN dan Internet', 'Penyebab 1:&#60;br /&#62;Kabel UTP belum terpasang.&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Cek apakah kabel jaringan terhubung komputer&#60;br /&#62;2. Apakah ada indikator kedip lampu dikonektor kabel utp di pc&#60;br /&#62;3. apakah perangkat switch diruangan hidup.&#60;br /&#62;4. Cek apakah kabel sudah terhubung sempurna ke switch dengan cara mengganti kabel tersebut ke port lain di switch. Jika lampu switch berkedip berarti ada hubungan ke switch pada port yang bersangkutan&#60;br /&#62;5. Ganti kabel jaringan dengan cara pinjam kabel di komputer lain &#60;br /&#62;6. Jika tetap tidak bisa sementara komputer yang lain jalan makan kemungkinan adapternya rusak, maka eskalasi ke technical support JKD&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Konfigurasi Perangkat PC atau Notebook belum terkonfigurasi&#60;br /&#62;Solusi 2:&#60;br /&#62;1. apakah ip address dan dns sudah diisi sesuai nomenkelatur .&#60;br /&#62;2.Melihat panduan penggunaan Konfigurasi Jaringan BPS&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 3:&#60;br /&#62;PC/komputer terkena operating sistem bermasalah&#60;br /&#62;Solusi 3:&#60;br /&#62;1.Komputer terkena virus dan harus di install antivirus&#60;br /&#62;2.harus install operating sistem baru&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 4:&#60;br /&#62;PC/komputer terhubung dengan jaringan BPS akan tetapi tidak bisa akses internet&#60;br /&#62;Solusi 4:&#60;br /&#62;1. Pastikan terlebih dahulu dengan membuka browser internet kita dan check ke website tertentu misal saja ke &#60;a href=\"http://www.detik.com\"&#62;www.detik.com&#60;/a&#62; atau www.google.com. &#60;br /&#62;2. Lepaskan sambungan kabel UTP (kabel jaringan LAN BPS), tunggu beberapa saat kemudian sambung lagi.&#60;br /&#62;3. Restart komputer anda dan ulangi untuk membuka dan akses website. 4. Jika anda bisa mengakses website akan tetapi koneksinya lambat sekali sementara komputer lain bisa mengakses (jika ada lebih dari dua komputer dalam jaringan) anda bisa mencurigai beberapa komputer yang lain sedang mengkonsumsi bandwidth sangat intensive atau banyak melakukan sharing files dengan beberapa komputer. &#60;br /&#62;5. Ketikan internet.bps.go.id pada browser internet, kemudian masukkan username dan password email bps anda.&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 5:&#60;br /&#62;Limited atau no connectivity&#60;br /&#62;Solusi 5:&#60;br /&#62;1. Klik kanan adapter jaringan dan pilih repair.&#60;br /&#62;2. Pastikan konfigurasi TCP/IP sudah benar&#60;br /&#62;3. Setting proxy browser dengan 10.0.0.94 port 3128 atau ke link &#60;a href=\"http://proxy.bps.go.id\"&#62;http://proxy.bps.go.id&#60;/a&#62;&#60;br /&#62;4. Restart komputer anda&#60;br /&#62;5. Jika masih status limited, eskalasi ke technical support JKD&#60;br /&#62;&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(148, 'Tidak dapat akses ke wifi BPSHQ', 'Penyebab 1:&#60;br /&#62;Signal lemah/tidak ditemukan&#60;br /&#62;Solusi 1:&#60;br /&#62;1.Fitur wifi di Notebook/smartphone belum di aktifkan. &#60;br /&#62;2.Lebih mendekat kearah perangkat akses point.&#60;br /&#62;3.Cek apakah ada indikator hidup di akses point di lantai tersebut&#60;br /&#62;4. Jika sebelumnya sudah diaktifkan, maka reconnect ke wifi tersebut (refresh)&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Tidak dapat Login&#60;br /&#62;Solusi 2:&#60;br /&#62;1.user name atau password salah&#60;br /&#62;2.gunakan user dan password akun email tanpa (@.bps.go.id)&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 3:&#60;br /&#62;Belum terinstall software agen wifi&#60;br /&#62;Solusi 3:&#60;br /&#62;1.konek terlebih dahulu ke SSID BPS Guest&#60;br /&#62;2.Membaca manual penggunaan koneksi wifi BPS Guest&#60;br /&#62;&#60;br /&#62;&#60;br /&#62;Penyebab 4:&#60;br /&#62;NIC atau wireless adapter status disable&#60;br /&#62;Solusi 4:&#60;br /&#62;1. Enable-kan wireless adapter&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(149, 'Tidak dapat terkoneksi dengan VPN Site Ke BPS Pusat', 'Penyebab 1:&#60;br /&#62;Perangkat pendukung ada yang tidak/belum di aktifkan&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Pastikan Modem dan Router ISP sudah aktif.&#60;br /&#62;2. Perangkat Switch utama aktik&#60;br /&#62;3. Perangkat Firewall NSA 2600 aktif&#60;br /&#62;4.Switch yang langsung menghubungkan PC ke jaringan VPN&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Konfigurasi Perangkat PC atau Notebook belum terkonfigurasi&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. apakah ip address dan dns sudah diisi sesuai nomenkelatur PC yang akan konek ek jalaur VPN&#60;br /&#62;2. Melihat panduan penggunaan Konfigurasi Jaringan VPN&#60;br /&#62;&#60;br /&#62;Penyebab 3:&#60;br /&#62;ISP VPN Mengalami Gangguan Koneksi&#60;br /&#62;&#60;br /&#62;Solusi 3:&#60;br /&#62;1.Test koneksi dari LAN Internal ke gateway vpn ( Ping 10.pp.254.254 )&#60;br /&#62;2. Hubungi Hotline engginer onsite BPS atau teknisi JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(150, 'Tidak dapat terkoneksi atau  lambat koneksi VSAT', 'Penyebab 1:&#60;br /&#62;Perangkat pendukung ada yang tidak/belum di aktifkan&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Pastikan Modem dan Router ISP Vsat sudah aktif.&#60;br /&#62;2. Perangkat Switch utama aktik&#60;br /&#62;3. Perangkat Firewall sonicwall TZ300 sudah aktif&#60;br /&#62;4. Switch yang langsung menghubungkan PC ke jaringan Vsat sudah Aktif&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Konfigurasi Perangkat PC atau Notebook belum terkonfigurasi&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. apakah ip address dan dns sudah diisi sesuai nomenkelatur PC yang akan konek Vsat&#60;br /&#62;2. Melihat panduan penggunaan Konfigurasi Jaringan Vsat&#60;br /&#62;&#60;br /&#62;Penyebab 3:&#60;br /&#62;ISP Vsat Mengalami Gangguan Koneksi&#60;br /&#62;&#60;br /&#62;Solusi 3:&#60;br /&#62;1. Test koneksi dari LAN Internal ke gateway vpn ( Ping 10.pp.254.254 )&#60;br /&#62;2. Hubungi teknisi JKD dan teknisi vsat&#60;br /&#62;&#60;br /&#62;Penyebab 4:&#60;br /&#62;Koneksi sangat lambat terkesan mati.&#60;br /&#62;&#60;br /&#62;Solusi 4:&#60;br /&#62;1. Pastikan hanya 3 PC saja yang terkoneksi jalur Vsat.&#60;br /&#62;2. Akses speedtest.net pastikan sesuai bandwith yang di informasikan BPS Pusat.&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(151, 'Tidak dapat upload data', 'Penyebab 1:&#60;br /&#62;Kabel UTP belum terpasang.&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Cek apakah kabel jaringan terhubung komputer&#60;br /&#62;2. Apakah ada indikator kedip lampu dikonektor kabel utp di pc&#60;br /&#62;3. Pastikan perangkat switch diruangan hidup.&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Konfigurasi Perangkat PC atau Notebook belum terkonfigurasi&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. apakah ip address dan dns sudah diisi sesuai nomenkelatur PC yang sudah ditentukan&#60;br /&#62;2. Melihat panduan penggunaan Konfigurasi Jaringan BPS&#60;br /&#62;&#60;br /&#62;Penyebab 3:&#60;br /&#62;Aplikasi atau web service tidak dapat di akses.&#60;br /&#62;&#60;br /&#62;Solusi 3:&#60;br /&#62;1. Setting port dan IP sesuai dengan manual pertukaran data.&#60;br /&#62;2. Pastikan user dan password benar&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(152, 'Tidak dapat terkonek  Personal VPN', 'Penyebab 1:&#60;br /&#62;Tidak dapat terkoneksi dengan vpn.bps.go.id&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Pastikan memiliki akses internet baik melalui modem atau konelsi lainnya misal ( telkom speedy, firstmedia )&#60;br /&#62;2. coba akses web ke vpn.bps.go.id&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Tidak dapat akses vpn personal&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Pastikan akun username dan password sesuai dengan login email&#60;br /&#62;2. Install software vpn personal akses domain vpn.bps.go.id&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(153, 'Tidak sesuai akses PC/Server yang dinginkan', 'Penyebab 1:&#60;br /&#62;Tidak dapat akses ke IP PC/Server&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. PC/Server yang akan di remote dalam kondisi hidup&#60;br /&#62;2. Memiliki akses ke PC/Server&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Operating Sistem atau browser tidak di support&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Pastikan Operating system minimal windows 7&#60;br /&#62;2. Browser minimal IE&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(154, 'Perangkat VOIP tidak Berfungsi', 'Penyebab 1:&#60;br /&#62;Perangkat belum aktif/hidup&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Adaptor tidak terkoneksi dengan power listrik.&#60;br /&#62;2. Adaptor tidak berfungsi&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Display perangkat tidak ada indikator keterangan identitas perangkat dan lain lain&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Perangkat dikonfigurasi jaringan sesuai dengan nomenklatur ip Voip BPS.&#60;br /&#62;&#60;br /&#62;Penyebab 3:&#60;br /&#62;Perangkat voip di display terdapat pesan image downloading field&#60;br /&#62;&#60;br /&#62;Solusi 3:&#60;br /&#62;1. Update firmware perangkat voip hubungi teknisi JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(155, 'Perangkat Endpoint tidak  aktif/terhubung', 'Penyebab 1:&#60;br /&#62;Perangkat belum aktif/hidup&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Adaptor tidak terkoneksi dengan power listrik.&#60;br /&#62;2. Adaptor tidak berfungsi&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Perangkat tidak dapat konek ataupun di call dari pusat&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Perangkat endpoint belum dikonfigurasi jaringan sesuai dengan nomenklatur ip perangkat Vicon&#60;br /&#62;2. restart terlebih dahulu&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(156, 'Vicon tidak berfungsi baik', 'Penyebab 1:&#60;br /&#62;Perangkat vicon dan vpn bermasalah&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Gunakan fasilitas Conferens Me&#60;br /&#62;2. Masuk ke 203.123.60.147 (bila menggunakan ip speedy atau koneksi selain VPN) &#60;br /&#62;3. Masukan username dan password (silakan hubungi subdit jkd untuk mendapatkannya)&#60;br /&#62;4. Pilih Conferences&#60;br /&#62;5. Pilih conferenceMe pada salah satu room conference&#60;br /&#62;6. Bila belum terinstall silakan pilih click here to install&#60;br /&#62;7. Untuk instalasi, setelah memilih click here to install akan ada pop up, silakan pilih Save File&#60;br /&#62;8. Setelah proses download selesai silakan jalankan program yang telah diunduh&#60;br /&#62;9. Centang pop up accept dan kemudian pilih instal&#60;br /&#62;10. Setelah instalasi selesai, silakan pilih click here to join the conference using Conference-Me&#60;br /&#62;11. Akan keluar pop up launch application, pilih conference-Me, kemudian pilih OK&#60;br /&#62;12. Program conference-Me akan terbuka dan menghubungkan laptop/komputer yang digunakan dengan server vicon&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Perangkat vicon bermasalah&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Gunakan fasilitas Conferens Me&#60;br /&#62;2. Masuk ke 10.0.0.147 (bila menggunakan koneksi VPN) &#60;br /&#62;3. Masukan username dan password (silakan hubungi subdit jkd untuk mendapatkannya)&#60;br /&#62;4. Pilih Conferences&#60;br /&#62;5. Pilih conferenceMe pada salah satu room conference&#60;br /&#62;6. Bila belum terinstall silakan pilih click here to install&#60;br /&#62;7. Untuk instalasi, setelah memilih click here to install akan ada pop up, silakan pilih Save File&#60;br /&#62;8. Setelah proses download selesai silakan jalankan program yang telah diunduh&#60;br /&#62;9. Centang pop up accept dan kemudian pilih instal&#60;br /&#62;10. Setelah instalasi selesai, silakan pilih click here to join the conference using Conference-Me&#60;br /&#62;11. Akan keluar pop up launch application, pilih conference-Me, kemudian pilih OK&#60;br /&#62;12. Program conference-Me akan terbuka dan menghubungkan laptop/komputer yang digunakan dengan server vicon&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(157, 'Web Hosting tidak dapat akses', 'Penyebab 1:&#60;br /&#62;Bandwith exided limeted&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Eskalasi ke technical support JKD&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Bloking Firewall&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Kontak admin web hosting untuk membuka akses untuk ip yang sudah di pastikan confirm aman.&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(158, 'Tidak dapat login ke management web Hosting', 'Penyebab 1:&#60;br /&#62;User atau password tidak dikenal&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. Kontak admin web hosting jaringan untuk reset password akun&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62;Tidak dapat terkoneksi Management web&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. menggunakan koneksi vpn site atau personal vpn&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(159, 'Gagal backup data', 'Penyebab:&#60;br /&#62;Backup Restore has stopped working&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Untuk kasus tersebut, versi terakhir dari database masih belum support proses backup restore di windows 7 64 bit. Untuk lebih jelasnya, pengguna dapat langsung menghubungi ke tim pst di perpustakaan@bps.go.id&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(160, 'Gagal koneksi ke server', 'Penyebab 2:&#60;br /&#62;Critical error: could not connect to server&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Eskalasi ke technical support JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(161, 'Server Error', 'Penyebab 1:&#60;br /&#62; PCI1360 Bus fatal error on slot 6. Reseat PCI card.&#60;br /&#62;&#60;br /&#62;Solusi 1:&#60;br /&#62;1. silahkan mencabut PCIe yang berada di slot no. 6 lalu memasangnya kembali. Setelah dipasang, seharusnya sudah tidak terjadi error tsb.&#60;br /&#62;&#60;br /&#62;Penyebab 2:&#60;br /&#62; PCI1318 fatal error on bus 3 device 0 function 1. Power cycle system&#60;br /&#62;&#60;br /&#62;Solusi 2:&#60;br /&#62;1. Pengguna harap mengatur IP iDRAC agar dapat dilakukan remote via VPN melalui firewall BPS Kabupaten/Kota dan menginformasikan IP iDRAC ke technical support JKD&#60;br /&#62;2. Eskalasi ke technical support&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(162, 'Akses internet ke eksternal tidak bisa setelah melakukan setting firewall', 'Penyebab:&#60;br /&#62;1. Topologi jaringan di BPS Kab/Kota tidak sesuai dengan yang diberikan oleh JKD&#60;br /&#62;2. Port pada modem internet/hub/switch masih tertutup&#60;br /&#62;3. Kabel UTP dalam keadaan rusak&#60;br /&#62;4. Konfigurasi port pada firewall tidak sesuai&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Pengguna harap menyediakan laptop yang terkoneksi dengan internal, dan melakukan instalasi teamviewer&#60;br /&#62;2. Eskalasi ke technical support JKD agar dapat dilakukan remote pc menggunakan teamviewer&#60;br /&#62; ', 1, 2, 1, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(163, 'Akses internet lancar tapi tidak dapat terhubung ke jaringan BPS', 'Penyebab:&#60;br /&#62;1. Fitur VPN Site-to-Site di BPS Kab/Kota dinonaktifkan&#60;br /&#62;2. Konfigurasi VPN di BPS Kab/Kota tidak sesuai&#60;br /&#62;3. Terdapat permasalahan oleh provider ISP&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Pengguna harap menyediakan laptop yang terkoneksi dengan internal, dan melakukan instalasi teamviewer&#60;br /&#62;2. Eskalasi ke technical support JKD agar dapat dilakukan remote pc menggunakan teamviewer&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(164, 'Power, lampu lan dan lampu wan menyala, tetapi ketika kabel lan dihubungkan ke port x0, x1 tidak ada respon, portnya tidak berfungsi', 'Penyebab:&#60;br /&#62;Port-port yang ada pada firewall mengalami kerusakan&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Pengguna harap menginformasikan nomor service tagnya&#60;br /&#62;2. Eskalasi ke technical support JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(165, 'Gagal koneksi ke wi-fi tertentu', 'Penyebab:&#60;br /&#62;PC/laptop sudah terhubung terlalu lama dengan wifi&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Refresh koneksi wi-fi dengan menonaktifkan terlebih dahulu dan mengaktifkan lagi&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(166, 'WAN menggunakan setting DHCP dan seringkali mati hidup', 'Penyebab:&#60;br /&#62;Jangkauan access point Sonicwall TZ-300W yang kurang kuat.&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;IP Address WAN DHCP telah kami ubah ke IP Static, detailnya Bapak/Ibu bisa lihat di konfigurasi Sonicwall pada menu Network-Interface. Konfigurasi Radio Mode pada Sonicwall diubah ke 2.4 Ghz.&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(167, 'Server hanya mendapat akses jaringan lokal dan tidak mendapat akses internet (sebelumnya sudah dibuatkan IP Static dalam menu admin SonicWall, yaitu 10.153.13.20) (sama dengan KB-JKD-41)', 'Penyebab:&#60;br /&#62;Kabel dari X0 yang connect ke port pertama switch Dell&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;reconnect kabel dan berhasil&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(168, 'Jaringan Wireless tidak dapat melakukan Ping pada jaringan kabel (PC).', 'Penyebab:&#60;br /&#62;Access rules WAN to LAN pada Sonicwall statusnya DENY.&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;Ubah access rules WAN to LAN ke ALLOW.&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(169, 'Power On, tetapi ketika kabel LAN dicolokkan tidak ada respon', 'Penyebab: &#60;br /&#62;Ada kemungkinan switch/kabel mengalami kerusakan&#60;br /&#62;&#60;br /&#62;Solusi:&#60;br /&#62;1. Ganti kabel UTP. &#60;br /&#62;2. Pengguna harap menginformasikan nomor service tag dari switch&#60;br /&#62;3. Eskalasi ke technical support JKD&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(170, 'UPS berbunyi', 'Penyebab : UPS tidak mendapat arus listrik&#60;br /&#62;Solusi : Periksa kabel power UPS apakah sudah dicolokkan ke stop kontak. kencangkan sambungan kabel power ke UPS dan pastikan UPS sudah terhubung sempurna ke stop kontak melalui kabel power.&#60;br /&#62;&#60;br /&#62;&#60;strong&#62;Jika solusi diatas tidak berhasil, buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(171, 'Monitor pada PC redup, goyang, atau no signal', 'Solusi:&#60;br /&#62;1. Cek kabel dari monitor ke CPU apakah sudah terpasang dengan benar.&#60;br /&#62;&#60;strong&#62;Apabila solusi diatas tidak berhasil, buat tiket keluhan ke halosis, sebutkan merk, tipe dan nomor BMN perangkat.&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(172, 'PC atau Laptop ganti Operating System', 'Solusi :&#60;br /&#62;- Back up seluruh data.&#60;br /&#62;- &#60;strong&#62;Buat tiket keluhan ke halosis, sebutkan merk, tipe dan nomor BMN perangkat.&#60;/strong&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
