(179, 'Kondisi tinta masih banyak/penuh namun print out yang keluar hanya hitam, merek printer Xerox tipe DPC3055DX', 'Cek setting printernya.&#60;br /&#62; Ubah setting printer cukup dilakukan di komputer saja tidak perlu di menu mesin dengan cara:&#60;br /&#62; -buka menu setting printer (printer preferences), kemudian klik Paper/Output, lalu ubah setting Paper Source menjadi Auto&#60;br /&#62; -kemudian klik OK&#60;br /&#62; (bisa lihat di gambar yang dilampirkan)&#60;br /&#62;&#60;br /&#62;Catatan: &#60;br /&#62;1. Untuk BPS Pusat, jika masih belum menemukan solusi atas permasalahan tersebut, &#60;strong&#62;b&#60;/strong&#62;&#60;strong&#62;uat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.&#60;/strong&#62; &#60;span&#62;&#60;br /&#62;2. Untuk BPS Daerah, apabila langkah tadi belum bisa menyelesaikan masalah, bisa cek nomor call center yang berada di bagian belakang printer, kemudian telpon ke nomor tersebut untuk menanyakan alternatif penyelesaiannya. &#60;br /&#62;Tiap wilayah (misalnya Kota atau Kabupaten) nomor call center bisa berbeda tergantung Provinsinya.&#60;br /&#62;Namun apabila tidak dapat menemukan nomor call center tersebut, bisa meminta bantuan dengan telepon di nomor: 1500345.&#60;br /&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(180, 'Muncul error \"Reboot Printer (092-310)\" merek printer Xerox tipe DPC3055DX', 'Penyebab: toner catridge tidak terletak pada posisi yang benar.&#60;br /&#62;Solusi: matikan printer, keluarkan toner catridge kemudian masukkan kembali toner catridge ke posisi semula, nyalakan printer.&#60;br /&#62;Untuk melihat letak posisi toner catridge pada printer, lihat gambar pada lampiran.&#60;br /&#62;&#60;br /&#62;Catatan: &#60;br /&#62;1. Untuk BPS Pusat, jika masih belum menemukan solusi atas permasalahan tersebut, &#60;strong&#62;b&#60;/strong&#62;&#60;strong&#62;uat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.&#60;/strong&#62; &#60;br /&#62;2. Untuk BPS Daerah, apabila langkah tadi belum bisa menyelesaikan masalah, bisa cek nomor call center yang berada di bagian belakang printer, kemudian telpon ke nomor tersebut untuk menanyakan alternatif penyelesaiannya. &#60;br /&#62;Tiap wilayah (misalnya Kota atau Kabupaten) nomor call center bisa berbeda tergantung Provinsinya.&#60;br /&#62;Namun apabila tidak dapat menemukan nomor call center tersebut, bisa meminta bantuan dengan telepon di nomor: 1500345.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(181, 'Login aplikasi presensi online daerah', ' &#60;p&#62;Untuk memulai Aplikasi Presensi Online ini pengguna dapat menggunakan browser dengan mengakses ke alamat &#60;a href=\"http://10.0.36.41/woowtime\"&#62;http://10.0.36.41/woowtime&#60;/a&#62;&#60;/p&#62; &#60;p&#62;Berikut adalah tampilan awal ketika mengakses alamat tersebut:&#60;/p&#62; &#60;img src=\"cid:qmaprrx4vdl_-skyeo8rsblrs6gg1rou\" width=\"670\" height=\"383\" alt=\"image\" /&#62;&#60;br /&#62;&#60;p&#62;Agar dapat login ke aplikasi ini dibutuhkan username dan password, secara default login untuk BPS Kabupaten/Kota :&#60;/p&#62; &#60;p&#62;Username : bpsppkk&#60;/p&#62; &#60;p&#62;Password : passwordppkk!&#60;/p&#62; &#60;p&#62;Silahkan Masukkan username dan password diatas untuk masuk ke halaman utama aplikasi woowtime.&#60;/p&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(182, 'Bagaimana melakukan device management', 'Pada device mangement terdapat dua bagian, yaitu device setting dan transaction monitor.&#60;br /&#62;1. Device setting&#60;br /&#62;Pada Device Setting beberapa hal yang umum dilakukan admin kabupaten adalah sebagai berikut:&#60;br /&#62;&#60;br /&#62;&#60;ul&#62; &#60;li&#62;Download&#60;/li&#62; &#60;li&#62;Upload&#60;/li&#62; &#60;/ul&#62; Pada submenu download ini admin dapat mendownload user, log dari mesin ke dalam database aplikasi woowtime. Pengguna juga dapat mendownload attlog yang ada di mesin kedalam USB.&#60;br /&#62;&#60;br /&#62; Pada submenu upload ini admin dapat mengupload user yang ada di database aplikasi woowtime ke mesin handkey yang ada di Kab/Kota. Biasanya dilakukan setelah admin mengeset pegawai sebagai admin/enroller mesin handkey. Setelah pegawai diset sebagai admin mesin handkey pada menu manage employee lakukan upload user dengan submenu ini untuk mempercepat proses sinkronisasi. &#60;br /&#62;&#60;br /&#62;&#60;br /&#62;&#60;img src=\"cid:des2x3zsgxtoqnh1pokyeanwp_fzczzg\" alt=\"image\" width=\"670\" height=\"102\" /&#62;&#60;br /&#62;2. Transaction monitor&#60;br /&#62;&#60;p&#62;Pada Transaction Monitor ini admin dapat memonitor transaksi-transaksi yang terjadi pada mesin handkey.&#60;/p&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(183, 'Tata kelola data pegawai (Manage Employee)', 'Pada menu manage employee ini admin dapat melakukan administrasi pegawai (Entri, edit dan delete), termasuk juga untuk melakukan enroll fingerprint. Untuk menambahkan pegawai terdapat dua cara yaitu dengan entri langsung pada aplikasi woowtime atau dengan import dokumen excel. Pada pengentrian pegawai ini yang perlu diperhatikan pada entrian kolom-kolomnya adalah:&#60;br /&#62;&#60;br /&#62;&#60;ul&#62;&#60;li&#62;&#60;strong&#62;User ID&#60;/strong&#62;&#60;/li&#62;&#60;/ul&#62; Untuk User ID pegawai terdapat ketentuan dari admin pusat yaitu:&#60;br /&#62;&#60;br /&#62; - Untuk mitra (satpam, CS dll) memakai kode 9 digit, 4 digit pertama adalah kode daerahContoh: &#60;br /&#62;&#60;br /&#62; Untuk mitra ke 9 BPS kota Semarang 337400009&#60;br /&#62;&#60;br /&#62;- Untuk pegawai yang pindahan dari instansi lain atau NIP lama bukan kepala 34, ID dibuat sama seperti NIP nya yang dari instansi lain tsb.Contoh:&#60;br /&#62;&#60;br /&#62; Bu Sri Sarwendah NIP Lama dari instansi lain: 730008493 maka User ID nya adalah 730008493&#60;br /&#62;&#60;br /&#62;- Untuk pegawai BPS atau yang NIP Lama kepala 34 dibuat dari 5 digit terakhir NIP LamanyaContoh:&#60;br /&#62;&#60;br /&#62; Viktor Suwiyanto NIP Lama dari BPS: 340056479 maka User IDnya: 56479&#60;br /&#62;&#60;br /&#62;&#60;ul&#62; &#60;li&#62; &#60;strong&#62;Badge Number&#60;/strong&#62;&#60;ul&#62; &#60;li&#62;Untuk mitra, isian BadgeNumber sama seperti ID.&#60;/li&#62; &#60;li&#62;Untuk pegawai pindahan dari instansi lain (NIP Lama bukan berawalan 34), sama seperti ID.&#60;/li&#62; &#60;li&#62;Untuk pegawai BPS (NIP Lama berawalan 34), dimasukkan NIP Lama lengkap (tanpa dipotong 5 digit terakhir).&#60;/li&#62; &#60;/ul&#62; &#60;/li&#62; &#60;li&#62; &#60;strong&#62;Password&#60;/strong&#62; harus kosong, hanya menggunakan Fingerprint (FP) untuk absen, untuk pegawai yang 10 jarinya tidak bisa dienroll karena kualitas pola sidik jarinya rendah diperbolehkan untuk menggunakan password.&#60;/li&#62; &#60;li&#62; &#60;strong&#62;Organization dan Area ID&#60;/strong&#62; disesuaikan dengan Kabupaten/kota masing-masing 4 digit â€œppkkâ€ (kode Provinsi dan kabupaten kota).&#60;/li&#62; &#60;/ul&#62; Entri pegawai juga dapat dilakukan dengan import file excel dengan format seperti template yang dapat di download pada submenu export. Berikut contoh isian excel yang benar.&#60;br /&#62;&#60;br /&#62;&#60;img src=\"cid:xnwqaag7xcvg--oabbdjscgoodbvspzw\" alt=\"image\" /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(184, 'Bagaimana melakukan rooster management', 'Dalam rooster management terdapat dua tahap yng harus dilakukan, yaitu assign work dan rooster.&#60;br /&#62;&#60;ul&#62;&#60;li&#62;Assign Work Schedule&#60;/li&#62;&#60;/ul&#62; &#60;p&#62;Menu ini berfungsi untuk assign shift pada pegawai, shift diperlukan untuk penghitungan terlambat dan pulang cepat serta penghitungan hari kerja.&#60;/p&#62; &#60;p&#62;Untuk assign shift pegawai dapat dilakukan sekali untuk satu organisasi (satker) bisa juga diassign per pegawai. Untuk assign shift seluruh pegawai dari organisi, masuk ke menu assign work schedule, kemudian pilih organisasi kemudian tekan tombol assign shift maka akan muncul dialog.&#60;/p&#62; &#60;img src=\"cid:91bro40uqe94_kqwpq8c_-ydmjl6dfpy\" width=\"529\" height=\"160\" alt=\"image\" /&#62;&#60;br /&#62;&#60;br /&#62;&#60;img src=\"cid:covkqb9okfmrttu3s8eqcyxmagxb62gy\" width=\"537\" height=\"439\" alt=\"image\" /&#62;&#60;br /&#62;&#60;p&#62;Untuk jam kerja biasa dihari Senin sampai Kamis memakai S1 dengan jam kerja masuk 07:30 dan pulang 16:00. Untuk jumat memakai S2 dengan jam kerja masuk 07:30 dan pulang 16:30. Untuk hari Sabtu dan Minggu karena bukan hari kerja maka harus di uncheck (hilangkan checklist) working day-nya dan shiftnya dipilih OFF kemudian tekan tombol Submit. Untuk Assign shift idealnya dilakukan sebelum tanggal itu berjalan sehingga penghitungan terlambat dan pulang cepat dapat langsung diproses ketika pegawai melakukan Absen. Jika ada shift pegawai yang berbeda harap dilaporkan ke pusat untuk selanjutnya menunggu keputusan bagian administrasi kepegawaian untuk dientri di woowtime. Berikut adalah daftar shift yang telah dibuat oleh admin Pusat&#60;/p&#62; &#60;img src=\"cid:pzu8rfqmdxfvvaowwyggcuyfamudyahk\" width=\"670\" height=\"139\" alt=\"image\" /&#62;&#60;br /&#62;&#60;br /&#62;&#60;ul&#62;&#60;li&#62;Roster&#60;/li&#62;&#60;/ul&#62; &#60;p&#62;Menu Roster digunakan untuk pengelolaan shift, monitoring transaksi handkey per pegawai perhari, serta untuk melakukan bloking absen dengan status kehadiran (attendance status; contoh: tugas luar, perjalanan dinas dan lain-lain) dan status ketidak-hadiran (absence status; contoh: sakit, ijin,cuti tahun ini dan lain-lain).&#60;/p&#62; &#60;p&#62;Sebelum melakukan fungsi-fungsi diatas admin kabupaten harus terlebih dahulu me-generate roster (matriks absen pegawai perhari) pegawai di kabupatennya. Caranya pilih organisasi, tanggal awal dan akhir roster kemudian tekan tombol â€œGenerateâ€ berikut adalah contoh hasil generate roster.&#60;/p&#62; &#60;img src=\"cid:rzfelxmllfnwtk1x6q09axhvrcib9w70\" width=\"670\" height=\"205\" alt=\"image\" /&#62;&#60;br /&#62;&#60;p&#62;Untukmemonitoring transaksi absen per pegawai per hari pilih tab transaction log details kemudian pilih pegawai dan tanggal yang ingin dimonitoring transaksi absennya.&#60;/p&#62; &#60;img src=\"cid:eo3ci8lvdac54djvjjqu7u798rk_dfia\" width=\"670\" height=\"343\" alt=\"image\" /&#62;&#60;br /&#62;&#60;p&#62;Untuk melakukan blok kehadiran atau ketidak hadiran misal tugas belajar (TB) dalam negeri (kehadiran) pilih pegawai dan tanggal yang ingin diset untuk status TB kemudian klik menu status, pilih status kehadiran (Attendance Status) maka akan muncul dialog.&#60;/p&#62; &#60;img src=\"cid:lc-wrxigewgwwwrclznml20m54ayyt-g\" width=\"470\" height=\"199\" alt=\"image\" /&#62;&#60;br /&#62;&#60;br /&#62;&#60;img src=\"cid:nupauz9z_evwusdxscripvemjp63mkpw\" width=\"670\" height=\"255\" alt=\"image\" /&#62;&#60;br /&#62; Untuk blok ketidak-hadiran caranya sama seperti blok kehadiran hanya beda pilihan submenu status yang dipilih saja. Untuk kasus seperti harus absen manual jika terjadi masalah seperti lampu mati, dapat dilakukan entri manual dengan attandance status dengan isian: attendance status dikosongkan kemudian untuk edit time di check misal ingin mengentri manual jam masuk berarti check pada edit start time log kemudian isikan jam masuknya.&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(185, 'Bagaimana menjalankan menu prosess', ' Menu Process ini difungsikan untuk penghitungan HT dan PC untuk pegawai yang belakangan dilakukan assign shiftnya (sudah melakukan absen tapi belum diassign shiftnya kemudian diassign belakangan). Pemrosesan ini dapat dilakukan untuk satu atau lebih pegawai bisa juga untuk seluruh pegawai di kabupaten kota. Jika ingin satu atu lebih pegawai tinggal dipilih pegawainya (highlight). Cara memilih pegawai cukup klik pada pegawai yang dipilih, untuk membatalkan pemilihan pegawai cukup diklik lagi setelah selesai memilih klik tombol process employee.&#60;br /&#62;&#60;br /&#62;&#60;img src=\"cid:belh8uilqrtdbi2kprzmdpffayf0pa0e\" alt=\"image\" /&#62;&#60;br /&#62;&#60;span&#62;&#60;br /&#62;&#60;/span&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(186, 'Cara mengatur agar jam di mesin sesuai dengan zona waktu masing -masing daerah', ' &#60;p&#62;Pengaturan zona waktu dapat dilakukan di device setting dengan cara:&#60;br /&#62; 1. Pastikan status mesin di device setting Online&#60;br /&#62; 2. double klik pada mesin yang ingin disetting zona waktunya&#60;br /&#62; 3. edit pada bagian kolom TZ, isian dari kolom TZ sesuai dari zona waktunya GMT+x&#60;br /&#62; Untuk WIB (GMT+7) isian TZ adalah 7&#60;br /&#62; Untuk WITA (GMT+8) isian TZ adalah 8&#60;br /&#62; Untuk WIT (GMT+9) isian TZ adalah 9&#60;/p&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(187, 'Pengaturan Admin pada mesin handkey untuk presensi online', ' &#60;p&#62;Dikarenakan presensi online ini terkoneksi ke seluruh kabupaten/kota, untuk admin mesin handkey diharuskan dari pegawai, untuk mengeset pegawai tersebut sebagai admin mesin handkey dapat dilakukan di menu manage employee kemudian double klik pada pegawai yang ingin diset sebagai admin, setelah muncul dialog dibagian isian priviledge pilih pada pilihan admin kemudian tekan save. secara otomatis sistem akan sinkronisasi dengan mesin.&#60;/p&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(188, 'Penandaan hari libur', ' &#60;p&#62;Untuk pengentrian hari libur nasional dilakukan oleh admin BPS RI, sehingga admin kab/kota tidak perlu mengentrikan, sedangkan untuk hari libur daerah seperti pilkada dan acara kedaerahan yang mengharuskan libur, bisa dilaporkan ke email sim@bps.go.id untuk dientrikan dan diberlakukan hanya untuk daerahnya.&#60;/p&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(189, 'Penggunaan password untuk verifikasi absen presensi online', ' &#60;p&#62;Untuk verifikasi absen presensi online ini diharuskan memakai sidik jari / fingerprint. Pengecualian diberlakukan untuk pegawai yang 10 jarinya tidak bisa didaftarkan/enroll sidik jarinya dikarenakan kualitas hasil enroll nya rendah (Low Quality) dapat diberikan password untuk verifikasi absennya.&#60;/p&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(190, 'Shift penjaga kantor/security atau pekerja honorer yang kerja malam', ' &#60;p&#62;Untuk pegawai mitra tetap seperti CS, penjaga kantor dll, mohon untuk tetap dientri di mesin handkey dan dienroll serta tetap absen sesuai jam masuk dan pulangnya masing-masing, untuk shift nanti akan ada peraturan dan SOP dari Biro Kepegawaian mengenai shift pegawai mitra tetap&#60;/p&#62;.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(191, 'Status checkin, checkout, breakin dan breakout di mesin dengan di presensi online berbeda', 'Masih ada bug pada aplikasi presensi online, permasalahan ini sudah direkap dan dikirimkan ke vendor untuk kemudian diperbaiki aplikasinya.&#60;br /&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(192, 'Pegawai sudah dientri di woowtime sudah diperiksa memang sudah ada pegawainya, dan sudah dilakukan upload user (kondisi device sudah Online) tetapi status jumlah usernya masih 0, di mesin tidak ada user', 'Mohon untuk dilaporkan ke Subdit. Jaringan Komunikasi Data.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(193, 'Mengenai Pegawai pindahan yang sudah dientri di kabupaten lain', 'Untuk pegawai pindahan yang telah didaftarkan ke presensi online pada kabupaten asalnya bisa dilaporkan ke admin BPS Pusat melalui halosis@bps.go.id untuk dipindahkan datanya ke kabupaten yang baru.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(194, 'Error Duplicate ID ketika entri pegawai', 'Mohon untuk dilaporkan ke halosis@bps.go.id dengan menyertai NIP Lama serta nama pegawainya untuk dibantu memperbaiki.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(195, 'Filter organisasi dan area pada search tidak berlaku pada saat search nama pegawai, muncul semua pegawai dari daerah (kab kota) lain', 'Masih ada bug pada aplikasi presensi online, permasalahan ini sudah direkap dan dikirimkan ke vendor untuk kemudian diperbaiki aplikasinya.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(196, 'Mengapa tampilan pada rooster kosong atau putih', 'Tampilan rooster kosong biasanya hal ini terjadi karena belum membuat assign shift.&#60;br /&#62;Tampilan rooster putih biasanya hal ini terjadi karena salah membuat assign shift.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(197, 'Fasilitas entri jam datang dan jampulang untuk solusi jika terjadi masalah tidak bisa absen karena mesin rusak dan lain-lain', ' &#60;p&#62;Masuk ke menu roster kemudian blok attendance untuk tanggal yang ingin dientri manual jam datang dan jam pulangnya, kemudian pilih status -&gt; attendance status muncul dialog kosongkan attendance status kemudian untuk edit jam datang atau jam pulang bisa dengan uncheck edit time log kemudian isikan jam datangnya.&#60;/p&#62; ', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(198, 'Mengapa absensi tidak muncul pada transaction log dan attendace report', 'Biasanya terjadi karena assign shift belum dibuat.&#60;br /&#62;Langkah penyelesaian:&#60;br /&#62;1. Buat assign shift&#60;br /&#62;2. Buat rooster, kemudian generate&#60;br /&#62;3. Lakukan/klik Prosess&#60;br /&#62;4. Lakukan proses transaction log dan attendance report', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(199, 'Bagaimana mengakses BackOffice dari smart-web?', 'Untuk pengguna yang sudah terdaftar di BackOffice. Silahkan membuka lampiran untuk mengakses BackOffice menggunakan smart.bps.go.id', 0, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(200, 'Cara Update Windows 10 ke versi 1805 secara offline', 'Download dan Ektrak file update windows 10 1805 pada tautan dibawah ini:&#60;br /&#62;&#60;a href=\"https://drive.google.com/file/d/16BZKptbamP6mfTNczxq2-PMmSi-4RM_s/view?usp=sharing\"&#62;https://drive.google.com/file/d/16BZKptbamP6mfTNczxq2-PMmSi-4RM_s/view?usp=sharing&#60;/a&#62;&#60;br /&#62;&#60;br /&#62;Ikuti langkah-langkahnya pada file pdf yang sudah dilampirkan.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(201, 'Insiden yang mungkin muncul dan dilaporkan', ' &#60;ul&#62;&#60;li&#62;Kegagalan dalam proses instalasi&#60;/li&#62;&#60;/ul&#62;Solusi: Tolong informasikan merk dan type gadget yang digunakan, versi android dan pesan error yang muncul. Lebih baik apabila dalam bentuk screenshot dan dikirimkan ke email: halosis@bps.go.id &#60;br /&#62;&#60;br /&#62;&#60;ul&#62;&#60;li&#62;Kegagalan dalam pengiriman data&#60;/li&#62;&#60;/ul&#62;Solusi: Tolong informasikan merk dan type gadget yang digunakan, versi android dan pesan error yang muncul. Lebih baik apabila dalam bentuk screenshot dan dikirimkan ke email: halosis@bps.go.id&#60;br /&#62;&#60;br /&#62;&#60;ul&#62;&#60;li&#62;Kegagalan dalam proses penggunaan (error activity)&#60;/li&#62;&#60;/ul&#62;Solusi: mengirimkan file-file log error yang ada di memory internalbpsLogError, kemudian mengirimkannya ke email halosis@bps.go.id&#60;br /&#62;&#60;br /&#62;&#60;ul&#62;&#60;li&#62;Kegagalan dalam login&#60;/li&#62;&#60;/ul&#62;Solusi: pastikan user yang digunakan adalah sp_{user community}, dengan password 123456. Apabila tidak bisa juga, tanyakan apakah pegawai tersebut masuk tahun sebelum 2017. Apabila pegawai tersebut masuk BPS setelah 2017 ada kemungkinan tidak bisa login dikarenakan belum dibuatkan usernya. Jika pegawai tersebut masuk BPS setelah 2017, hubungi PBD untuk menambahkan user&#60;br /&#62;&#60;br /&#62;&#60;ul&#62;&#60;li&#62;Kegagalan lainnya&#60;/li&#62;&#60;/ul&#62;Solusi: sampaikan kegagalan secara detail dan akan lebih membantu apabila disediakan screnshot dari gadget anda saat kegagalan muncul.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(202, 'Bagaimana cara hapus data pada mesin jika mesin absensi sudah penuh', ' Untuk mendelete data pada mesin apabila mesin telah penuh, yang dilakukan adalah:&#60;br /&#62; 1. Pastikan yang melakukan &#60;em&#62;backup&#60;/em&#62; dan &#60;em&#62;delete&#60;/em&#62; adalah &#60;strong&#62;administrator&#60;/strong&#62; yang memang sudah ditunjuk&#60;br /&#62; 2. Lakukan proses seperti melakukan absensi seperti biasanya&#60;br /&#62; 3. Backup data pada mesin dengan cara masukkan flasdisk ke mesin absensi&#60;br /&#62; 4. Pilih menu &#60;em&#62;Pendrive/USB&#60;/em&#62;, kemudian cari menu &#60;em&#62;Download log&#60;/em&#62;, tunggu hingga proses download selesai&#60;i&#62;&#60;br /&#62;&#60;/i&#62;5. Apabila download log telah selesai dan berhasil&#60;em&#62;,&#60;/em&#62; keluarkan flashdisk kemudian cek isi log yang di flashdisk tadi ke wootime dengan cara membukanya di Transaction log&#60;br /&#62; 6. Jika di transaction log seluruh absensi pegawai telah muncul semua, maka data pada mesin baru dapat dihapus.', 1, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
(203, 'Bagaimana cara mengajukan permintaan lisensi zoom', 'Pengajuan lisensi zoom satu paket dengan pembuatan undangan rapat di aplikasi &#60;strong&#62;MeetApp&#60;/strong&#62; dengan link &#60;strong&#62;meetapp.bps.go.id&#60;/strong&#62;.&#60;br /&#62;&#60;br /&#62;&#60;span&#62;&#60;strong&#62;Sebelum &#60;/strong&#62;&#60;span&#62;melakukan pengajuan di aplikasi MeetApp &#60;strong&#62;ada tahapan yang harus dilakukan&#60;/strong&#62;, yaitu:&#60;/span&#62;&#60;/span&#62;&#60;br /&#62;&#60;ol&#62; &#60;li&#62;&#60;span&#62;&#60;strong&#62;Membuat akun zoom&#60;/strong&#62;&#60;span&#62; dengan menggunakan &#60;strong&#62;email BPS&#60;/strong&#62;&#60;span&#62; di &#60;a href=\"https://zoom.us/signup\"&#62;https://zoom.us/signup&#60;/a&#62;&#60;/span&#62;&#60;/span&#62;&#60;/span&#62;&#60;/li&#62; &#60;li&#62;&#60;span&#62;&#60;span&#62;&#60;span&#62;&#60;strong&#62;Membuat meeting&#60;/strong&#62;&#60;span&#62; di akun tersebut. Panduan dapat dilihat di &#60;a href=\"https://support.zoom.us/hc/en-us/articles/201362413-Scheduling-meetings\"&#62;https://support.zoom.us/hc/en-us/articles/201362413-Scheduling-meetings&#60;/a&#62;&#60;span&#62;. Setelah berhasil membuat meeting maka akan mendapatkan &#60;strong&#62;ID Meeting&#60;/strong&#62;&#60;span&#62; dan &#60;strong&#62;Password&#60;/strong&#62;&#60;span&#62; yang akan dimasukkan ke dalam aplikasi &#60;strong&#62;MeetApp&#60;/strong&#62;&#60;span&#62;.&#60;/span&#62;&#60;/span&#62;&#60;/span&#62;&#60;/span&#62;&#60;br /&#62;&#60;/span&#62;&#60;/span&#62;&#60;/span&#62;&#60;/span&#62;&#60;/li&#62; &#60;/ol&#62; &#60;strong&#62;Setelah&#60;/strong&#62; melakukan tahapan di atas lalu buka aplikasi &#60;strong&#62;MeetApp&#60;/strong&#62;&#60;span&#62; untuk membuat undangan rapat dan pengajuan lisensi zoom. &#60;strong&#62;Alur penggunaan aplikasi Meetapp&#60;/strong&#62;&#60;span&#62; dan &#60;strong&#62;Panduan pengajuan lisensi zoom&#60;/strong&#62;&#60;span&#62; dapat dilihat di halaman &#60;strong&#62;Home&#60;/strong&#62;&#60;span&#62; pada aplikasi &#60;strong&#62;MeetApp&#60;/strong&#62;&#60;/span&#62;&#60;/span&#62;&#60;/span&#62;&#60;/span&#62;&#60;br /&#62; ', 0, 2, 0, '2023-02-15 01:15:09', '2023-02-15 01:15:09', NULL, NULL),
