(26, 26, '', '##domain.action## : ##domain.name##', '##lang.domain.entity## :##domain.entity##\r\n   ##lang.domain.name## : ##domain.name## - ##lang.domain.dateexpiration## : ##domain.dateexpiration##', '&lt;p&gt;##lang.domain.entity## :##domain.entity##&lt;br /&gt; &lt;br /&gt;\r\n                        ##lang.domain.name##  : ##domain.name## - ##lang.domain.dateexpiration## :  ##domain.dateexpiration##&lt;br /&gt;\r\n                        &lt;/p&gt;'),
(27, 27, '', '##user.action##', '##user.realname## ##user.firstname##,\r\n\r\n##IFuser.password.has_expired=1##\r\n##lang.password.has_expired.information##\r\n##ENDIFuser.password.has_expired##\r\n##ELSEuser.password.has_expired##\r\n##lang.password.expires_soon.information##\r\n##ENDELSEuser.password.has_expired##\r\n##lang.user.password.expiration.date##: ##user.password.expiration.date##\r\n##IFuser.account.lock.date##\r\n##lang.user.account.lock.date##: ##user.account.lock.date##\r\n##ENDIFuser.account.lock.date##\r\n\r\n##password.update.link## ##user.password.update.url##', '&lt;p&gt;&lt;strong&gt;##user.realname## ##user.firstname##&lt;/strong&gt;&lt;/p&gt;\r\n\r\n##IFuser.password.has_expired=1##\r\n&lt;p&gt;##lang.password.has_expired.information##&lt;/p&gt;\r\n##ENDIFuser.password.has_expired##\r\n##ELSEuser.password.has_expired##\r\n&lt;p&gt;##lang.password.expires_soon.information##&lt;/p&gt;\r\n##ENDELSEuser.password.has_expired##\r\n&lt;p&gt;##lang.user.password.expiration.date##: ##user.password.expiration.date##&lt;/p&gt;\r\n##IFuser.account.lock.date##\r\n&lt;p&gt;##lang.user.account.lock.date##: ##user.account.lock.date##&lt;/p&gt;\r\n##ENDIFuser.account.lock.date##\r\n\r\n&lt;p&gt;##lang.password.update.link## &lt;a href=\"##user.password.update.url##\"&gt;##user.password.update.url##&lt;/a&gt;&lt;/p&gt;'),
(28, 28, '', '##lang.plugins_updates_available##', '##lang.plugins_updates_available##\r\n\r\n##FOREACHplugins##\r\n##plugin.name## :##plugin.old_version## -&gt; ##plugin.version##\r\n##ENDFOREACHplugins##', '&lt;p&gt;##lang.plugins_updates_available##&lt;/p&gt;\r\n&lt;ul&gt;##FOREACHplugins##\r\n&lt;li&gt;##plugin.name## :##plugin.old_version## -&gt; ##plugin.version##&lt;/li&gt;\r\n##ENDFOREACHplugins##&lt;/ul&gt;'),
(29, 29, '', 'Tiket ##ticket.action## (##ticket.title##) telah dibuka ', 'Yth. Bapak/Ibu ##ticket.authors##,\r\n\r\nTerimakasih telah menghubungi Halosis. Tim kami akan segera menangani permasalahan Anda dengan nomor tiket ##ticket.action## dan akan segera menghubungi Bapak/Ibu kembali. Berikut ringkasan permasalahan yang Bapak/Ibu laporkan, yaitu ##ticket.content##.\r\nSilahkan menghubungi kami jika Bapak/Ibu memiliki pertanyaan lagi. Kami akan dengan senang hati membantu Bapak/Ibu.\r\n\r\nTerima kasih,\r\nTim Pusat Layanan TI Badan Pusat Statistik', ''),
(30, 30, '', 'Tiket (##ticket.title##) telah diteruskan ke Tim Teknis', 'Yth. Bapak/Ibu ##ticket.authors##,\r\n\r\nPermasalahan Bapak/Ibu dengan nomor tiket ##ticket.number## sedang ditangani oleh tim teknis kami yaitu ##ticket.assigntousers##. Kami akan menghubungi Bapak/Ibu kembali seteleh permasalahan selesai kami tangani. Terima kasih atas kesediaan Bapak/ibu untuk menunggu.\r\n\r\nTerima kasih,\r\nTim Pusat Layanan TI Badan Pusat Statistik\r\n', ''),
(31, 31, '', 'Tiket ##ticket.action## (##ticket.title##) telah ditangani ke Tim Teknis', 'Yth. Bapak/Ibu ##ticket.authors##,\r\n\r\nPermasalahan Anda pada tiket nomor ##ticket.action## telah selesai kami tangani. Jika Bapak/Ibu ada hal lain yang memerlukan bantuan, silakan balas email ini atau hubungi kami kembali di extensi 1122. Kami akan dengan senang hati membantu. \r\nJika dalam waktu 2x24 jam tidak ada balasan, maka masalah ##ticket.action## akan kami anggap selesai dan tiket akan kami tutup. \r\n\r\nTerima kasih,\r\nTim Pusat Layanan TI Badan Pusat Statistik\r\n', ''),
(33, 33, '', '##ticket.action## ##ticket.title##', ' ##IFticket.storestatus=5##\r\n ##lang.ticket.url## : ##ticket.urlapprove##\r\n ##lang.ticket.autoclosewarning##\r\n ##lang.ticket.solvedate## : ##ticket.solvedate##\r\n ##lang.ticket.solution.type## : ##ticket.solution.type##\r\n ##lang.ticket.solution.description## : ##ticket.solution.description## ##ENDIFticket.storestatus##\r\n ##ELSEticket.storestatus## ##lang.ticket.url## : ##ticket.url## ##ENDELSEticket.storestatus##\r\n\r\n ##lang.ticket.description##\r\n\r\n ##lang.ticket.title## : ##ticket.title##\r\n ##lang.ticket.authors## : ##IFticket.authors## ##ticket.authors## ##ENDIFticket.authors## ##ELSEticket.authors##--##ENDELSEticket.authors##\r\n ##lang.ticket.creationdate## : ##ticket.creationdate##\r\n ##lang.ticket.closedate## : ##ticket.closedate##\r\n ##lang.ticket.requesttype## : ##ticket.requesttype##\r\n##lang.ticket.item.name## :\r\n\r\n##FOREACHitems##\r\n\r\n ##IFticket.itemtype##\r\n  ##ticket.itemtype## - ##ticket.item.name##\r\n  ##IFticket.item.model## ##lang.ticket.item.model## : ##ticket.item.model## ##ENDIFticket.item.model##\r\n  ##IFticket.item.serial## ##lang.ticket.item.serial## : ##ticket.item.serial## ##ENDIFticket.item.serial##\r\n  ##IFticket.item.otherserial## ##lang.ticket.item.otherserial## : ##ticket.item.otherserial## ##ENDIFticket.item.otherserial##\r\n ##ENDIFticket.itemtype##\r\n\r\n##ENDFOREACHitems##\r\n##IFticket.assigntousers## ##lang.ticket.assigntousers## : ##ticket.assigntousers## ##ENDIFticket.assigntousers##\r\n ##lang.ticket.status## : ##ticket.status##\r\n##IFticket.assigntogroups## ##lang.ticket.assigntogroups## : ##ticket.assigntogroups## ##ENDIFticket.assigntogroups##\r\n ##lang.ticket.urgency## : ##ticket.urgency##\r\n ##lang.ticket.impact## : ##ticket.impact##\r\n ##lang.ticket.priority## : ##ticket.priority##\r\n##IFticket.user.email## ##lang.ticket.user.email## : ##ticket.user.email ##ENDIFticket.user.email##\r\n##IFticket.category## ##lang.ticket.category## : ##ticket.category## ##ENDIFticket.category## ##ELSEticket.category## ##lang.ticket.nocategoryassigned## ##ENDELSEticket.category##\r\n ##lang.ticket.content## : ##ticket.content##\r\n ##IFticket.storestatus=6##\r\n\r\n ##lang.ticket.solvedate## : ##ticket.solvedate##\r\n ##lang.ticket.solution.type## : ##ticket.solution.type##\r\n ##lang.ticket.solution.description## : ##ticket.solution.description##\r\n ##ENDIFticket.storestatus##\r\n\r\n##FOREACHtimelineitems##\r\n[##timelineitems.date##]\r\n##lang.timelineitems.author## ##timelineitems.author##\r\n##lang.timelineitems.description## ##timelineitems.description##\r\n##lang.timelineitems.date## ##timelineitems.date##\r\n##lang.timelineitems.position## ##timelineitems.position##\r\n##lang.timelineitems.type## ##timelineitems.type##\r\n##lang.timelineitems.typename## ##timelineitems.typename##\r\n##ENDFOREACHtimelineitems##\r\n\r\n##lang.ticket.numberoffollowups## : ##ticket.numberoffollowups##\r\n##lang.ticket.numberoftasks## : ##ticket.numberoftasks##', '&lt;!-- description{ color: inherit; background: #ebebeb; border-style: solid;border-color: #8d8d8d; border-width: 0px 1px 1px 0px; }    --&gt;\r\n&lt;div&gt;##IFticket.storestatus=5##&lt;/div&gt;\r\n&lt;div&gt;##lang.ticket.url## : &lt;a href=\"##ticket.urlapprove##\"&gt;##ticket.urlapprove##&lt;/a&gt; &lt;strong&gt;&#160;&lt;/strong&gt;&lt;/div&gt;\r\n&lt;div&gt;&lt;strong&gt;##lang.ticket.autoclosewarning##&lt;/strong&gt;&lt;/div&gt;\r\n&lt;div&gt;&lt;span style=\"color: #888888;\"&gt;&lt;strong&gt;&lt;span style=\"text-decoration: underline;\"&gt;##lang.ticket.solvedate##&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; : ##ticket.solvedate##&lt;br /&gt;&lt;span style=\"text-decoration: underline; color: #888888;\"&gt;&lt;strong&gt;##lang.ticket.solution.type##&lt;/strong&gt;&lt;/span&gt; : ##ticket.solution.type##&lt;br /&gt;&lt;span style=\"text-decoration: underline; color: #888888;\"&gt;&lt;strong&gt;##lang.ticket.solution.description##&lt;/strong&gt;&lt;/span&gt; : ##ticket.solution.description## ##ENDIFticket.storestatus##&lt;/div&gt;\r\n&lt;div&gt;##ELSEticket.storestatus## ##lang.ticket.url## : &lt;a href=\"##ticket.url##\"&gt;##ticket.url##&lt;/a&gt; ##ENDELSEticket.storestatus##&lt;/div&gt;\r\n&lt;p class=\"description b\"&gt;&lt;strong&gt;##lang.ticket.description##&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=\"color: #8b8c8f; font-weight: bold; text-decoration: underline;\"&gt; ##lang.ticket.title##&lt;/span&gt;&#160;:##ticket.title## &lt;br /&gt; &lt;span style=\"color: #8b8c8f; font-weight: bold; text-decoration: underline;\"&gt; ##lang.ticket.authors##&lt;/span&gt;&#160;:##IFticket.authors## ##ticket.authors## ##ENDIFticket.authors##    ##ELSEticket.authors##--##ENDELSEticket.authors## &lt;br /&gt; &lt;span style=\"color: #8b8c8f; font-weight: bold; text-decoration: underline;\"&gt; ##lang.ticket.creationdate##&lt;/span&gt;&#160;:##ticket.creationdate## &lt;br /&gt; &lt;span style=\"color: #8b8c8f; font-weight: bold; text-decoration: underline;\"&gt; ##lang.ticket.closedate##&lt;/span&gt;&#160;:##ticket.closedate## &lt;br /&gt; &lt;span style=\"color: #8b8c8f; font-weight: bold; text-decoration: underline;\"&gt; ##lang.ticket.requesttype##&lt;/span&gt;&#160;:##ticket.requesttype##&lt;br /&gt;\r\n&lt;br /&gt;&lt;span style=\"color: #8b8c8f; font-weight: bold; text-decoration: underline;\"&gt; ##lang.ticket.item.name##&lt;/span&gt;&#160;:\r\n&lt;p&gt;##FOREACHitems##&lt;/p&gt;\r\n&lt;div class=\"description b\"&gt;##IFticket.itemtype## ##ticket.itemtype##&#160;- ##ticket.item.name## ##IFticket.item.model## ##lang.ticket.item.model## : ##ticket.item.model## ##ENDIFticket.item.model## ##IFticket.item.serial## ##lang.ticket.item.serial## : ##ticket.item.serial## ##ENDIFticket.item.serial## ##IFticket.item.otherserial## ##lang.ticket.item.otherserial## : ##ticket.item.otherserial## ##ENDIFticket.item.otherserial## ##ENDIFticket.itemtype## &lt;/div&gt;&lt;br /&gt;\r\n&lt;p&gt;##ENDFOREACHitems##&lt;/p&gt;\r\n##I